{"url": "https://dothi.net/ban-can-ho-chung-cu-kingdom-101/ban-gap-ch-kingdom-101-q10-sieu-pham-view-to-hien-thanh-quan-1-sieu-dep-gia-6-ty-180-pr13712752.htm", "code": "13712752", "title": "Bán gấp CH Kingdom 101, Q. 10 siêu phẩm view Tô Hiến Thành, Quận 1 siêu đẹp. Giá 6 tỷ 180", "description": "Bán gấp CH Kingdom 101, Q. 10 siêu phẩm view Tô Hiến Thành, Quận 1 siêu đẹp. Giá 6 tỷ 180      Khu vực:    Bán căn hộ chung cư tại Kingdom 101  - Quận 10 - Hồ Chí Minh     Giá:   6.18 Tỷ  Diện tích:  79 m²       Thông tin mô tả    BĐS Hoàng Anh Land xin giới thiệu đến quý khách hàng siêu phẩm căn hộ cao cấp Kingdom 101 Quận 10. Với diện tích 79 m2 (diện tích lớn nhất trong phân khúc 2PN). Hướng Đông Nam mát mẻ, thoáng đãng. Tầng cao, view tô hiến thành, quận 1 cực chất. Giá bán không thể tốt hơn cho một siêu phẩm đẹp. Chỉ 6,18 tỷ (chưa bao gồm phí quản lý 2%). Liên hệ ngay em Hưng để xem nhà thực tế. Tư vấn 24/7. Nhân kỷ niệm ngày thành lập công ty. Để gửi lời cảm ơn và tri ân khách hàng. Công ty xin gửi tới quý khách hàng một phần quà nhỏ. Khi chốt giao dịch thành công. Chân thành cảm ơn quý khách hàng đã tin tưởng, ủng hộ công ty trong suốt thời gian qua. Công ty TNHH đầu tư phát triển đầu tư Hoàng Anh Land. Ký gửi mua bán và cho thuê căn hộ Sài Gòn. Đc: 180 Tô Hiệu, Hiệp Tân, Tân Phú, Tp. Hcm.          Tìm kiếm theo từ khóa :  Bán căn hộ Quận 10 ,  Bán căn hộ Kingdom 101               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    13712752       Loại tin rao    Bán căn hộ chung cư       Ngày đăng tin    05/07/2021       Ngày hết hạn    12/07/2021       Hướng nhà    Đông-Nam       Hướng ban công           Số phòng    2       Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Việt Hưng       Địa chỉ           Điện thoại           Di động    0901482639       Email     <!-- document