{"url": "https://dothi.net/cho-thue-can-ho-chung-cu-carillon-7/cho-thue-carillon-7-1pn2pn3pn-gia-uu-dai-mua-dichchi-tu-7tr-pr13712976.htm", "code": "13712976", "title": "Cho thuê Carillon 7 1PN + 2PN + 3PN. Giá ưu đãi mùa dịch chỉ từ 7tr/th", "description": "Cho thuê Carillon 7 1PN + 2PN + 3PN. Giá ưu đãi mùa dịch chỉ từ 7tr/th      Khu vực:    Cho thuê căn hộ chung cư tại Carillon 7  - Quận Tân Phú - Hồ Chí Minh     Giá:   7 Triệu/tháng  Diện tích:  50 m²       Thông tin mô tả    Công ty BĐS Hoàng Anh Land xin trân trọng gửi tới quý khách hàng những căn hộ cho thuê giá tốt nhất đầu tháng 7 tại Carillon 7. + 1PN, 1 WC. Nhà trống giá 7tr/th. Full nt giá 9tr/th. + 2PN, 1 WC. Nhà trống giá 7.5tr/th. Full nt giá 9,5tr/th. + 2PN, 2 WC. Nhà trống giá 8tr/th. Full nội thất giá 10tr/th. + 3PN, 2 WC. Nhà trống giá 9tr/th. Full nội thất 11tr/th. LH: 0901482639 Mr. Hưng. Để xem nhà trực tiếp. Cảm ơn quý khách hàng đã quan tâm.          Tìm kiếm theo từ khóa :  Cho thuê căn hộ Tân Phú ,  Cho thuê căn hộ Carillon 7               Hình ảnh  ()   Bản đồ                                                                           Đặc điểm bất động sản         Mã số    13712976       Loại tin rao    Cho thuê căn hộ chung cư       Ngày đăng tin    06/07/2021       Ngày hết hạn    13/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    1       Đường vào           Mặt tiền           Số tầng           Số toilet    1       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Việt Hưng       Địa chỉ           Điện thoại           Di động    0901482639       Email     <!-- document.write(\"&#66;&#100;&#115;&#46;&#115;&#103;&#46;&#104;&#117;&#110;&#103;&#110;&#103;&#117;&#121;&#101;&#110;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0901482639"}
{"url": "https://dothi.net/ban-nha-rieng-duong-nguyen-duc-canh-phuong-quang-hanh/chinh-chu-ban-gap-nha-dep-gan-bien-dau-tu-truong-hoc-khu-vuc-tiem-nang-dang-rat-phat-trien-pr13713841.htm", "code": "13713841", "title": "Chính chủ bán gấp nhà đẹp, gần biển, đầu tư trường học. Khu vực tiềm năng đang rất phát triển", "description": "Chính chủ bán gấp nhà đẹp, gần biển, đầu tư trường học. Khu vực tiềm năng đang rất phát triển      Khu vực:    Bán nhà riêng tại Đường Nguyễn Đức Cảnh  - Thành phố Cẩm Phả - Quảng Ninh     Giá:   25 Tỷ  Diện tích:  1000 m²       Thông tin mô tả    - Nhà chính chủ xây to đẹp, có 2 cổng đi riêng biệt. Tại Km6, Quang Hanh, Cẩm Phả, Quảng Ninh. Đường trước nhà 2 - 3 ô tô tránh. Cạnh nhà là trung tâm đào tạo và sát hạch lái xe cơ giới. - Vị trí đất hiếm, siêu đẹp, khu vực tiềm năng đang rất phát triển, nhà gần biển. Cách khu nghỉ dưỡng/ resort Tuấn Mai 2km. Có dự án đường bao biển Hạ Long - Cẩm Phả chạy qua nhà. Rất phù hợp cho các nhà Đầu tư lâu dài, tương lai rất sáng lạn. - Hiện đang là trường mầm non, được xây dựng và chia làm 2 tòa nhà. Có đầy đủ các phòng chức năng, trang thiết bị phục vụ cho công tác dạy và học cho các cháu. - Khách mua đầu tư, có thể chuyển đổi mục đích sử dụng làm văn phòng công ty, cho thuê hoặc kinh doanh - nhà hàng, khách sạn... - DT 778/1000m2, đất sử dụng thực tế là 1.000m2, được xây và ngăn bằng tường rào xung quanh nhà rất chắc chắn. - Bao gồm 2 tòa nhà cao tầng + sân vườn: + DT tòa 1: 100m2 x 4 tầng. + DT tòa 2: 270m2 x 5 tầng xây mới. - Sổ đỏ chính chủ, sẵn sàng giao dịch. - Các anh/chị đầu tư ai có nhu cầu mua. Liên hệ chính chủ: Em Hoa 0833686116, để được xem nhà và thương lượng về giá.          Tìm kiếm theo từ khóa :  Bán nhà gần biển Hạ Long thành phố Cẩm Phả ,  Bán nhà đường Nguyễn Đức Cảnh thành phố Cẩm Phả ,  Bán nhà phường Quang Hanh thành phố Cẩm Phả ,  Bán nhà thành phố Cẩm Phả               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản      