{"url": "https://dothi.net/ban-can-ho-chung-cu-vinhomes-dcapitale/ban-can-ho-c6-tan-hoang-minh-96m2-lo-goc-view-ho-va-dai-lo-thang-long-59-ty-cau-giay-pr13712423.htm", "code": "13712423", "title": "Bán căn hộ C6 Tân Hoàng Minh 96m2 lô góc view hồ và Đại Lộ Thăng Long 5.9 tỷ Cầu Giấy", "description": "Bán căn hộ C6 Tân Hoàng Minh 96m2 lô góc view hồ và Đại Lộ Thăng Long 5.9 tỷ Cầu Giấy      Khu vực:    Bán căn hộ chung cư tại Vinhomes D'Capitale  - Quận Cầu Giấy - Hà Nội     Giá:   5.9 Tỷ  Diện tích:  96 m²       Thông tin mô tả    D'Capitale là tổ hợp siêu dự án do hai tập đoàn hàng đầu của Việt Nam là Tân Hoàng Minh và Vingroup cùng thực hiện, tọa lạc tại ngã tư Trần Duy Hưng và Khuất Duy Tiến vị trí đắc địa nhất của thủ đô, với tầm nhìn bao quát những công trình hàng đầu của đất nước như khu nhà Quốc Hội, sân Mỹ Đình, khu thương mại Big C, Đại lộ Thăng Long... Tòa C6 là tòa án ngữ ở mặt phố Trần Duy Hưng gồm 6 tầng thương mại có đủ các dịch vụ mua sắm và giải trí đẳng cấp Châu u, 39 tầng 1800 căn hộ, các dịch vụ, an sinh theo tiêu chuẩn cao nhất của Vingroup với khu vui chơi, thể thao, bể bơi, cinema, an ninh... Căn hộ thuộc tầng 35 lô góc view Đại Lộ Thăng Long, và bể bơi, với 3 phòng ngủ, phòng khách, bếp, 2 wc, ban công hướng Đông Nam, với đầy đủ trang thiết bị đẳng cấp chuẩn Châu u cao cấp và Mỹ, trị giá 1.4 tỷ chủ tặng lại toàn bộ, sàn gỗ mỹ. Với diện tích 96m2 có đầy đủ dịch vụ của khách hàng vip. Chủ nhà là cán bộ thuộc Bộ Công An do có nhu cầu chuyển công tác vào Sài Gòn bán giá thấp hơn thị trường 300tr. Pháp lý chuẩn tập đoàn Tân Hoàng Minh. Liên hệ: Trường BG: 0904750110.          Tìm kiếm theo từ khóa :  Bán căn hộ Vinhomes D'Capitale ,  Bán căn hộ tòa C6 Vinhomes D'Capitale ,  Bán căn hộ quận Cầu Giấy ,  Bán căn hộ gần Big C quận Cầu Giấy ,  Bán căn hộ gần ngã tư Trần Duy Hưng quận Cầu Giấy               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    1371