{"url": "https://dothi.net/ban-nha-rieng-duong-duy-tan-phuong-dich-vong-hau/lo-goc-duy-tan-2-mat-ngo-o-to-tranh-kd-vp-an-sinh-tuyet-voi-55m2-x-4-tang-nhinh-12-ty-pr13701478.htm", "code": "13701478", "title": "Lô góc Duy Tân - 2 mặt ngõ ô tô tránh KD VP - an sinh tuyệt vời, 55m2 x 4 tầng, nhỉnh 12 tỷ", "description": "Lô góc Duy Tân - 2 mặt ngõ ô tô tránh KD VP - an sinh tuyệt vời, 55m2 x 4 tầng, nhỉnh 12 tỷ      Khu vực:    Bán nhà riêng tại Đường Duy Tân  - Quận Cầu Giấy - Hà Nội     Giá:   12.5 Tỷ  Diện tích:  55 m²       Thông tin mô tả    - Nhà khu phân lô cực kỳ vip của phố Duy Tân, diện tích 55m2, 4 tầng, giá 12,5 tỷ. - Lô góc cả 2 mặt đều ô tô tránh, ngõ thông các ngả, xung quanh nhiều cán bộ nhà nước, an ninh và dân trí cao. - Duy Tân là khu phố sầm uất nhất quận Cầu Giấy, tập trung số lượng rất lớn các Công ty, văn phòng và cơ quan. - Nhà 4 tầng bề thế, view 2 mặt rất thoáng. Toàn bộ thiết bị nhập ngoại, đèn trần, cầu thang, cửa, sàn từ gỗ lim nguyên khối làm cực kỳ cẩn thận, vị trí nhà rất đẹp có thể ở hay KD văn phòng đều được. - Thiết kế: Tầng 1: Khách + bếp + kinh doanh tốt (ô tô 7 chỗ vào nhà). Tầng 2: Phòng khách + 1 phòng ngủ + WC. Tầng 3: 2 phòng ngủ + WC. Tầng 4: 1 phòng ngủ + phòng thờ. - Sổ đỏ vuông đẹp, giá chỉ gia lộc nhẹ. LH: C. Trinh 0936043368.          Tìm kiếm theo từ khóa :  Bán nhà quận Cầu Giấy ,  Bán nhà phường Dịch Vọng Hậu quận Cầu Giấy ,  Bán nhà đường Duy Tân quận Cầu Giấy               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    13701478       Loại tin rao    Bán nhà riêng       Ngày đăng tin    03/07/2021       Ngày hết hạn    17/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào    5 m       Mặt tiền    4.1 m       Số tầng    4       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Tuyết Trinh       Địa chỉ           Điện thoại    0834029617     