{"url": "https://dothi.net/ban-nha-biet-thu-lien-ke-tieu-khu-do-thi-nam-la-khe/ban-nha-lien-ke-khu-do-thi-nam-la-khe-ha-dong-70m-6-ty-pr13531216.htm", "code": "13531216", "title": "Bán nhà liền kề khu đô thị Nam La Khê Hà Đông 70m2, giá 6 tỷ", "description": "Bán nhà liền kề khu đô thị Nam La Khê Hà Đông 70m2, giá 6 tỷ      Khu vực:    Bán nhà biệt thự, liền kề tại Tiểu khu đô thị Nam La Khê  - Quận Hà Đông - Hà Nội     Giá:   6 Tỷ  Diện tích:  70 m²       Thông tin mô tả    + Nhà liền kề khu đô thị Nam La Khê, hạ tầng hoàn chỉnh đồng bộ, đường vỉa hè nội bộ khu đô thị rộng 8m, giao thông rất thuận tiện thông ra Quang Trung, Lê Trọng Tấn. + Khu vực trung tâm Hà Đông, gần ngã 4 đèn xanh đèn đỏ, tiếp giáp các khu đô thị Văn Phú, Park City, Văn Khê đầy đủ dịch vụ tiện ích! + Nhà hoàn thiện 4 tầng mới đẹp như vừa mới xây xong, mặt tiền 4 m không gian rộng thoáng, thiết kế khoa học tỉ mỉ từng chi tiết, nội thất hoàn thiện đều dùng đồ cao cấp, cửa đi, lan can cầu thang, mặt bậc cầu thang đều bằng gỗ Lim, hệ thống điện nước, điện nhẹ trong nhà đều lắp đặt đầy đủ hoàn chỉnh. Chủ để lại toàn bộ nội thất theo hiện trạng trong nhà. - Tầng 1: Sân + Phòng khách + Bếp. - Tầng 2, 3: Mỗi tầng 2 phòng + 1 WC. - Tầng 4: Phòng thờ + Sân phơi. + Sổ đỏ chính chủ, pháp lý chuẩn, sẵn sàng giao dịch!              Hình ảnh  ()   Bản đồ                                       Đặc điểm bất động sản         Mã số    13531216       Loại tin rao    Bán nhà biệt thự, liền kề (nhà trong dự án quy hoạch)       Ngày đăng tin    12/12/2020       Ngày hết hạn    12/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào    8 m       Mặt tiền    4 m       Số tầng    4       Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Anh Quang       Địa chỉ    Dự án Nam La Khê, Hà Đông, Hà Nội       Điện thoại    0988970936       Di động    0988970936       Email     <!-- document.write(\"&#84;&#97;&#97;&#110;&#104;&#113;&#117;&#97;&#110;&#103