{"url": "https://dothi.net/ban-dat-duong-dh09-xa-hoa-thach/can-ban-dat-lan-2-duong-dh09-hoa-thach-201m2-lo-goc-gia-dau-tu-pr13609565.htm", "code": "13609565", "title": "Cần bán đất làn 2 đường DH09 Hoà Thạch 201m2 lô góc giá đầu tư", "description": "Cần bán đất làn 2 đường DH09 Hoà Thạch 201m2 lô góc giá đầu tư      Khu vực:    Bán đất tại Đường DH09  - Huyện Quốc Oai - Hà Nội     Giá:   12 Triệu/m²  Diện tích:  201 m²       Thông tin mô tả    Vị trí lô đất cách mặt đường DH09 khoảng 30m, đường 2 xe tải tránh nhau, ngay khu trung tâm Hoà Thạch, xung quanh vị trí đất đầy đủ mọi tiện ích như trường liên cấp, trạm y tế, chợ, gần nhiều trường học từ mầm non đến cấp 1,2 cấp 3 Minh Khai Hòa Thạch. Gần khu Công Nghệ Cao Bắc Phú Cát. Với diện 201m2 x 6m mặt tiền, lô góc full đất ở giá 12 triệu/m2 có thương lượng. Sổ đỏ sẵn sàng giao dịch liên hệ Mr: Hùng. 825806999 - 0963878477.          Tìm kiếm theo từ khóa :  Bán đất xã Hòa Thạch huyện Quốc Oai ,  Bán đất gần khu công nghệ cao Bắc huyện Quốc Oai ,  Bán đất đường DH09 huyện Quốc Oai ,  Bán đất huyện Quốc Oai               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13609565       Loại tin rao    Bán đất       Ngày đăng tin    07/07/2021       Ngày hết hạn    21/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Trần Hùng       Địa chỉ           Điện thoại    0963878477       Di động    0963878477       Email     <!-- document.write(\"&#72;&#117;&#110;&#103;&#98;&#100;&#115;&#110;&#97;&#109;&#118;&#105;&#101;&#116;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0963878477"}
{"url": "https://dothi.net/ban-dat-nen-du-an-century-city/century-city-khu-dat-vang-dang-de-dau-tu-pr13612624.htm", "code": "13612624", "title": "Century City khu đất vàng đáng để đầu tư", "description": "Century City khu đất vàng đáng để đầu tư      Khu vực:    Bán đất nền dự án tại Century City  - Huyện Long Thành - Đồng Nai     Giá:   17 Triệu/m²  Diện tích:  120 m²       Thông tin mô tả    Thế mạnh nổi trội của Century City. Vị trí kết nối trực tiếp các tuyến giao thông trọng điểm: Quốc Lộ 1A, cao tốc Long Thành Dầu Giây. Cách sân bay Long Thành 3 km, là khu đô thị hạt nhân, được quy hoạch bài bản, chất lượng. Pháp lý dự án Century City: Sổ đỏ từng sản phẩm. Tổng quan dự án Century City Long Thành. Vị trí: Đường ĐT 769 xã Bình Sơn, Long Thành, Đồng Nai. Chủ đầu tư: Công ty Cổ phần đầu tư và phát triển Thuận Lợi. Phát triển và phân phối độc quyền: Kim Oanh Group. Quy mô dự án: 49,2 hecta. Mật độ xây dựng: 40%. Tổng số sản phẩm: 2150 nền. Diện tích phân lô: 80m2, 100m2, 120m2. Hạ tầng tiện ích nội khu: Đường nhựa, công viên trung tâm, thương mại. Giá bán dự kiến: 18 triệu/m2. Tiến độ xây dựng: Hoàn thiện giao nền quý 4/2020. Vị trí vượt trội, cách sân bay Long Thành chưa đầy 2km, tâm điểm thu hút giới đầu tư trong một địa bàn được xem như cửa ngõ giao thương, có ý nghĩa chiến lược trọng điểm trong phát triển kinh tế thương mại dịch vụ của khu vực. Dự án Century City Long Thành Kim Oanh Group nằm đối diện Khu công nghiệp Lộc An Bình Sơn, liền kề UBND xã Bình Sơn, khu du lịch Thác Giang Điền, cách thành phố Biên Hòa 13km. Bên cạnh đó, Century City còn thừa hưởng giá trị từ các dự án quy hoạch hạ tầng khu vực như: Dự án mở rộng cao tốc Long Thành Dầu Giây và Dầu Giây Liên Khương. Dự án cao tốc Biên Hòa Vũng Tàu, nâng cấp Quốc lộ 51. Dự án cao tốc Bến Lức Nhơn Trạch Long. Hiện tại các sản phẩm đã gần hết, mong quí anh/chị cùng các nhà đầu tư liên hệ sớm để biết thêm chi tiết và sở hữu 1 trong các sản phẩm hot nhất hiện nay.          Tìm kiếm theo từ khóa :  Bán đất nề