{"url": "https://dothi.net/ban-can-ho-chung-cu-valencia-garden/ban-can-goc-3pn-tang-dep-full-do-valencia-garden-gia-205-ty-bao-phi-sang-ten-so-pr13516086.htm", "code": "13516086", "title": "Bán căn góc 3PN tầng đẹp full đồ, Valencia Garden, giá 2,05 tỷ bao phí sang tên sổ", "description": "Bán căn góc 3PN tầng đẹp full đồ, Valencia Garden, giá 2,05 tỷ bao phí sang tên sổ      Khu vực:    Bán căn hộ chung cư tại Valencia Garden  - Quận Long Biên - Hà Nội     Giá:   2.05 Tỷ  Diện tích:  80 m²       Thông tin mô tả    Không có nhu cầu sử dụng, chủ nhà gửi bán căn hộ 3 phòng ngủ, full đồ, tầng trung đẹp tại dự án Valencia Garden, KĐT Việt Hưng. Căn hộ có diện tích 80m2, thiết kế 3 phòng ngủ, 2wc, 1 bếp, 1 khách, là căn góc, tất cả các phòng đều thoáng. Cửa chính hướng Đông Nam, ban công Tây Bắc Đông Bắc. Bàn giao full nội thất, chỉ việc xách vali về ở. Đã có sổ. Ưu tiên giao dịch trước tết. Giá công khai 2,05 tỷ bao phí sang tên sổ đỏ. Mọi chi tiết liên hệ: 0912 293 262 - Mrs Hằng. Tọa lạc tại lô đất CT19B khu đô thị mới Việt Hưng Valencia Garden là dự án nằm trên 3 mặt tiền đường hướng ra các tuyến phố thanh bình, sạch đẹp rợp bóng cây xanh và sắc đỏ của hàng phượng vỹ. Dự án bao gồm 3 khối nhà với những con đường dạo bộ thơ mộng và hơn 40 tiện ích nội khu được thiết kế hiện đại, thân thiện sẽ giúp cư dân nơi đây trải nghiệm không gian sống lý tưởng, thư thái đến từng khoảnh khắc. - Được xây dựng theo mô hình khu phức hợp nhà ở kết hợp với dịch vụ thương mại khép kín, với lối thiết kế đơn giản, hiện đại nhưng tinh tế, Valencia Garden tạo nên một không gian sống thoải mái, tiện nghi và năng động, phù hợp với mọi lứa tuổi. - Nằm trong trung tâm KĐT Việt Hưng, sát Vinhomes Riverside, là khu vực có dân trí cao, cơ sở hạ tầng, tiện ích đồng bộ, gần 2 cây cầu lớn là cầu Vĩnh Tuy và cầu Chương Dương, gần các trường học công lập chất lượng cao như mầm non đô thị Việt Hưng, tiểu học & THCS Đức Giang các bệnh viện tuyến TW như Bệnh viện đa khoa Đức Giang, Bệnh viện Việt Xô, Viện quân y 108các khu giải trí & trung tâm mua sắm sầm uất như sân golf Long Biên, Vincom Long Biên, Savico Megamall, Aeon Mall Long Biên... - Nhờ hệ thống hạ tầng phát triển, cư dân Valencia Garden chỉ mất 10 phút đi xe để di chuyển đến trung tâm thành phố Hà Nội như Hồ Hoàn Kiếm, Nhà Hát Lớn, Tràng Tiền Plaza. Mọi chi tiết liên hệ: 0912 293 262 - Mrs Hằng. Web: https://chungcuhanoi360.net/valencia-garden/          Tìm kiếm theo từ khóa :  Bán căn hộ Valencia Garden ,  Bán căn hộ CT19B Valencia Garden ,  Bán căn hộ quận Long Biên ,  Bán căn hộ gần mầm non đô thị Việt Hưng quận Long Biên ,  Bán căn hộ gần cầu Chương Dương quận Long Biên ,  Bán căn hộ gần cầu Vĩnh Tuy quận Long Biên               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13516086       Loại tin rao    Bán căn hộ chung cư       Ngày đăng tin    24/04/2021       Ngày hết hạn    08/05/2021       Hướng nhà    Đông-Nam       Hướng ban công    Tây-Bắc       Số phòng    3       Đường vào           Mặt tiền           Số tầng           Số toilet    2       Nội thất                 Thông tin liên hệ       Tên liên lạc    Lê Thị Hằng       Địa chỉ    Hà Nội       Điện thoại           Di động    0912293262       Email     <!-- document.write(\"&#108;&#101;&#104;&#97;&#110;&#103;&#49;&#57;&#51;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0912293262"}
