{"url": "https://dothi.net/ban-dat-xa-lai-yen/chinh-chu-ban-dat-dau-gia-lai-yen-hoai-duc-dt-54m2-so-do-ngay-gia-ban-345-trieum2-pr13419726.htm", "code": "13419726", "title": "Chính chủ bán đất đấu giá Lại Yên, Hoài Đức, DT 54m2 sổ đỏ ngay, giá bán 34,5 triệu/m2", "description": "Chính chủ bán đất đấu giá Lại Yên, Hoài Đức, DT 54m2 sổ đỏ ngay, giá bán 34,5 triệu/m2      Khu vực:   Bán đất tại Xã Lại Yên  - Huyện Hoài Đức - Hà Nội     Giá:   34.5 Triệu/m²  Diện tích:  54 m²       Thông tin mô tả    Chính chủ em trúng đấu giá đất đấu giá Lại Yên, Hoài Đức ngay mặt hồ và chợ.  Diện tích từ 54m2 đến 68m2.  Mặt tiền 4m hoặc 5m.  Hướng Đông Bắc hoặc Tây Nam.  Có quyết định trúng đấu giá.  Đợt 1 Cọc ngay khoảng 50 triệu đến 100 triệu,  Đợt 2: Sau đợt 1 khoảng 1 tháng thanh toán 50% giá trị trúng giá.  Đợt 3: Sau đợt 2 thời gian là 2 tháng thanh toán nốt số tiền còn lại.  Rất phù hợp để đầu tư, hoặc để ở.  Sổ đỏ chính chủ, đất được phê duyệt quy hoạch rõ ràng.  Vị trí quá ổn, trước là view hồ, chợ lớn Lại Yên, nằm sát trục đường 40m lối Lại Yên và Vân Canh đang thi công ầm ầm.  Cách cầu vượt An Khánh 2,5km và Đại Lộ Thăng Long.  Cách khu đô thị Bắc An Khánh Splendora 500m.  Giá bán từ 34 triệu/m2 tuỳ thuộc vị trí.  Liên hệ: Mr Thái: 0983.692.566.          Tìm kiếm theo từ khóa :  Bán đất Hoài Đức ,  Bán đất gần cầu vượt An Khánh Hoài Đức ,  Bán đất Lại Yên Hoài Đức               Hình ảnh  ()   Bản đồ                                                       Đặc điểm bất động sản         Mã số    13419726       Loại tin rao    Bán đất       Ngày đăng tin    23/06/2021       Ngày hết hạn    07/07/2021       Hướng nhà    Đông-Bắc       Hướng ban công           Số phòng           Đường vào    10 m       Mặt tiền    4 m       Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Vietthaiphat       Địa chỉ    Hà Đông - Hà Nội       Điện thoại    0979904853       Di động    0979904853       Email     <!-- document.write(\"&#110;&#104