{"url": "https://dothi.net/ban-dat-duong-tran-cong-an-phuong-trung-dung-1/dat-no-hau-trung-tam-bien-hoa-ke-quang-truong-tinh-dien-tich-143m2-chi-76-ty-lh-0937793964-pr13597746.htm", "code": "13597746", "title": "Đất nở hậu trung tâm Biên Hòa kề quảng trường tỉnh diện tích 143m2 chỉ 7,6 tỷ, LH 0937793964", "description": "Đất nở hậu trung tâm Biên Hòa kề quảng trường tỉnh diện tích 143m2 chỉ 7,6 tỷ, LH 0937793964      Khu vực:    Bán đất tại Đường Trần Công An  - Thành phố Biên Hòa - Đồng Nai     Giá:   7.6 Tỷ  Diện tích:  143 m²       Thông tin mô tả    + Gia đình bán nhà cấp 4 chỉ tính giá đất sở hữu vị trí trung tâm tại Biên Hòa, vị trí đất ở đường Trần Công An cách quảng trường tỉnh 200m. May mắn sở hữu vị trí trung tâm buôn bán tấp nập các loại hình, đường thông thoáng 2 xe hơi dân cư an ninh dân trí tốt anh chị mua để ở cũng như đầu tư đều tiện lợi. + Diện tích ngang 7,2m dài 20m hậu nở 7,6m. + Hướng Nam. + Sổ hồng thổ cư. + Gía bán 7,6 tỷ (thương lượng). + Liên hệ 0937 793964 hoặc 0918 362646 gặp Vinh để được tư vấn tận tâm và giá bán tốt nhất. + Nhận ký gửi nhà đất tìm kiếm nhà theo yêu cầu và sang nhượng mặt bằng tại Đồng Nai. * Với nhiều năm kinh nghiệm trong nghề anh chị yên tâm về các sản phẩm BĐS của bên em, giá hợp lý với thị trường làm việc tận tâm, nhiệt tình. Rất vui được hợp tác với quí khách.          Tìm kiếm theo từ khóa :  Bán đất thành phố Biên Hòa ,  Bán đất đường Trần Công An thành phố Biên Hòa ,  Bán đất phường Trung Dũng thành phố Biên Hòa               Hình ảnh  ()   Bản đồ                                                                           Đặc điểm bất động sản         Mã số    13597746       Loại tin rao    Bán đất       Ngày đăng tin    06/06/2021       Ngày hết hạn    20/06/2021       Hướng nhà    Nam       Hướng ban công           Số phòng           Đường vào    7 m       Mặt tiền    7.2 m       Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Phạm Trung Vinh       Địa chỉ   