{"url": "https://dothi.net/cho-thue-can-ho-chung-cu-flc-complex-36-pham-hung/cho-thue-can-ho-chung-cu-tai-du-an-flc-complex-36-pham-hung-dien-tich-70m2-g-pr13708107.htm", "code": "13708107", "title": "Cho thuê căn hộ chung cư tại dự án FLC Complex 36 Phạm Hùng, diện tích 70m2", "description": "Cho thuê căn hộ chung cư tại dự án FLC Complex 36 Phạm Hùng, diện tích 70m2      Khu vực:    Cho thuê căn hộ chung cư tại FLC Complex 36 Phạm Hùng  - Quận Nam Từ Liêm - Hà Nội     Giá:   11.5 Triệu/tháng  Diện tích:  70 m²       Thông tin mô tả    Cho thuê căn hộ chung cư FLC 36 Phạm Hùng. Diện tích: 70m2 - 02N. Nội thất: Bàn ghế sofa, tivi, kệ tivi, giường. Tủ quần áo, điều hòa các phòng, nóng lạnh, bếp, tủ bếp, máy giặt, tủ lạnh, lò vi sóng, thiết bị ánh sáng, thiết bị vệ sinh đầy đủ, giàn phơi,... - Gần các trung tâm thương mại, siêu thị lớn: Big C Thăng Long, Big C garden, Metrol, Pico Trường đại học lớn: Đại học sư phạm, đại học ngoại ngữ.. Trường cấp I II III: Đoàn Thị Điểm, Lê Quý Đôn, Lomonoxop.. Khu phức hợp, thương mại dịch vụ: Khu văn phòng, siêu thị, nhà trẻ, phòng khám, ngân hàng,.. Khu cây xanh, công cộng. Khuôn viên vui chơi cho trẻ em. Hệ thống báo cháy tiên tiến, thiết bị chữa cháy hiện đại. - Đội ngũ nhân viên an ninh chuyên tâm duy trì 24/24 tất cả các ngày trong tuần, Camera lắp khắp hành lang tầng hầm. Liên hệ xem nhà miễn phí.          Tìm kiếm theo từ khóa :  Cho thuê căn hộ FLC Complex 36 Phạm Hùng ,  Cho thuê căn hộ gần Big C Thăng Long quận Nam Từ Liêm ,  Cho thuê căn hộ quận Nam Từ Liêm               Hình ảnh  ()   Bản đồ                                                                       Đặc điểm bất động sản         Mã số    13708107       Loại tin rao    Cho thuê căn hộ chung cư       Ngày đăng tin    01/07/2021       Ngày hết hạn    15/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    2       Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tê