{"url": "https://dothi.net/ban-can-ho-chung-cu-khu-do-thi-kim-van-kim-lu-golden-silk/can-ban-can-3pn-full-do-toa-b-vinaconex2-kim-van-kim-lunguyen-xien-gia-2450-trieu-0979121536-pr13712489.htm", "code": "13712489", "title": "Cần bán căn 3PN full đồ tòa B Vinaconex 2 Kim Văn Kim Lũ, Nguyễn Xiển giá 2,45 tỷ/ 0979121536", "description": "Cần bán căn 3PN full đồ tòa B Vinaconex 2 Kim Văn Kim Lũ, Nguyễn Xiển giá 2,45 tỷ/ 0979121536      Khu vực:    Bán căn hộ chung cư tại Khu đô thị Kim Văn - Kim Lũ (Golden Silk)  - Quận Hoàng Mai - Hà Nội     Giá:   2.45 Tỷ  Diện tích:  Không xác định       Thông tin mô tả    Cần bán căn hộ 3PN toà B - 0979.121.536. Thiết kế 3pn + 2wc. Nhà có full nội: 3 tivi, 3 điều hoà, giường, tủ. Sạch đẹp, nhà view đẹp + hướng mát. Chủ nhà thiện chí bán, thủ tục mua bán nhanh giá bao sang tên trọn gói. Pháp lý: Sổ hồng sẵn sàng giao dịch. Tiện ích quanh khu Kim Văn Kim Lũ. 03 hầm để xe ô tô, xe máy rộng rãi, sân chung rộng rãi..., xung quanh rất nhiều các trường học mẫu giáo và cấp 1 - 2 và ĐH. Các loại phí dịch vụ rẻ: Phí quản lý chỉ 3,5k/m2; gửi ô tô chỉ 700k/th, xe máy 70k/th. Đường sá đi lại thuận tiện đi các quận nội thành và các tỉnh. * Giá bán hơn 2.x tỷ. 0979.121.536 em Chinh.          Tìm kiếm theo từ khóa :  Bán căn hộ Khu đô thị Kim Văn - Kim Lũ (Golden Silk) ,  Bán căn hộ tòa B Khu đô thị Kim Văn - Kim Lũ (Golden Silk) ,  Bán căn hộ Quận Hoàng Mai               Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13712489       Loại tin rao    Bán căn hộ chung cư       Ngày đăng tin    05/07/2021       Ngày hết hạn    12/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào           Mặt tiền           Số tầng           Số toilet    2       Nội thất    3 tivi, 3 điều hoà, giường, tủ.             Thông tin liên hệ       Tên liên lạc    Đỗ Việt Chinh       Địa chỉ    Đống Đa - Hà Nội       Điện thoại           Di động    0979121536       Ema