{"url": "https://dothi.net/ban-nha-rieng-duong-nguyen-trai-phuong-11-2/ban-nha-gia-re-hem-714xx-nguyen-trai-68-c4-36-19-chi-6-ty-phuong-11-quan-5-pr13626085.htm", "code": "13626085", "title": "Bán nhà giá rẻ hẻm 714/xx Nguyễn Trãi, 68.4m2 C4 3.6x19m chỉ 6 tỷ Phường 11 Quận 5", "description": "Bán nhà giá rẻ hẻm 714/xx Nguyễn Trãi, 68.4m2 C4 3.6x19m chỉ 6 tỷ Phường 11 Quận 5      Khu vực:    Bán nhà riêng tại Đường Nguyễn Trãi  - Quận 5 - Hồ Chí Minh     Giá:   6 Tỷ  Diện tích:  68.4 m²       Thông tin mô tả    Bán nhà giá rẻ hẻm 714/xx Nguyễn Trãi, 68.4m2 C4 3.6x19m chỉ 6 tỷ Phường 11 Quận 5. Hẻm 714/xx Nguyễn Trãi, nhà diện tích 68,4 m2, nhà xây cấp 4 C4, ngang 3.6m x dài 19m = 68,4m2, giá rất rẻ chỉ 6 tỷ Phường 11 Quận 5. Hẻm ba gác, cách trường học 30m. Chỉ 8m ra mặt tiền Nguyễn Trãi Phường 11 Quận 5. Chủ thở oxi nên bán giá Gò Vấp. Nhỉnh 80 triệu/m2. Vị trí rất đẹp, nằm ngay ngã 3 Nguyễn Trãi & Nguyễn Ấn. Đối diện là trường Mầm Non, chợ ăn khuya vui nhộn nhịp đến 12PM (tối không sợ bị đói). Cách 50m là cửa hàng tiện lợi Family Mart. Cách 300m là Phố Lồng Đèn Lương Nhữ Học nổi tiếng 100 năm. Cách 120m là Phúc Long Coffee & Tea Express. Cách 100m là Trường THCS Mạnh Kiếm Hùng. Cách 150m là Chùa Ông Hội Quán Nghĩa An. Cách 400m là Thế Giới Di Động. Gần trung tâm vui chơi Q5 Đại Thế Giới, bệnh viện trường đại học Y Dược, Parkson Hùng Vương, bưu điện Q5, bệnh viện Chợ Rẫy. Giá bán như thế này thì bao anh em mua đầu tư, giá rẻ bèo. Giấy tờ chuẩn sổ hồng chuẩn bị sang tên chủ nhân mới: Là ai may mắn đây? + Chủ nhà vui vẻ hợp tác hòa đồng. + Vui lòng liên hệ Mr Michael Quân 0913859309/zalo báo trước khoảng 30 để lấy chìa khóa.          Tìm kiếm theo từ khóa :  Bán nhà Quận 5 ,  Bán nhà gần Family Mart Quận 5 ,  Bán nhà gần Trường trung học cơ sở Mạnh Kiếm Quận 5 ,  Bán nhà phường 11 Quận 5 ,  Bán nhà đường Nguyễn Trãi Quận 5 ,  Bán nhà gần chợ ăn khuya Quận 5               Hình ảnh  ()   Bản đồ                                                                            