{"url": "https://dothi.net/ban-can-ho-chung-cu-thap-doanh-nhan-tower/ban-can-ho-goc-2pn-2-vs-thap-doanh-nhan-ha-dong-chi-hon-1-ty-pr13709986.htm", "code": "13709986", "title": "Bán căn hộ góc 2PN, 2 VS Tháp Doanh Nhân, Hà Đông, chỉ hơn 1 tỷ", "description": "Bán căn hộ góc 2PN, 2 VS Tháp Doanh Nhân, Hà Đông, chỉ hơn 1 tỷ      Khu vực:    Bán căn hộ chung cư tại Tháp doanh nhân Tower  - Quận Hà Đông - Hà Nội     Giá:   1.65 Tỷ  Diện tích:  70 m²       Thông tin mô tả    Tôi cần bán căn hộ. + 1 trong 10 căn góc đẹp nhất Tháp Doanh Nhân Hà Đông. + Địa chỉ: Tháp Doanh Nhân, số 1 Thanh Bình, Phường Mỗ Lao, Q. Hà Đông. + Căn hộ có diện tích 70m2, gồm 2 ngủ, 2 vệ Sinh, 1 phòng khách, 1 khu bếp, có ban công tầm nhìn view khắp 4 quận Hà Nội. Các phòng đều có cửa sổ thoáng mát, ánh sáng tự nhiên. + Hướng cửa chính Đông Nam, mang đến nhiều làn gió mát lành, và sự may mắn cho gia chủ. + Về tòa Tháp Doanh Nhân: Là tòa nhà biểu tượng và cao nhất của Hà Đông, gồm 52 tầng trong đó có 5 hầm, 10 thang máy, 48 tầng nổi, 6 tầng Trung tầm thương mại và khách sạn, có bể bơi, khu vui chơi, phòng tập gym... Cho cư dân ở tầng 26, công viên trên tầng thượng 48 cùng với hệ thống quán bar, nhà hàng trên đỉnh tháp, có sân đỗ trực thăng. + Vị trí vàng: Tòa tháp nằm ngày ngã tư, trung tâm Quận Hà Đông, cách Ngã Tư Sở chỉ 10 phút di chuyển xe máy, cạnh Làng Việt Kiểu Châu Âu, gần trung tâm hành chính: Đối diện là thành ủy hn, sở giao thông, bệnh viện, đại học Kiến Trúc, Học Viện Bưu Chính,... + Tiện ích ngoại khu: Cách 5 - 10 ph là đến các bệnh viện lớn như Viện 103, Viện Bỏng Quốc Gia, BV Đa khoa Hà Đông, Trung tâm Thương Mại Big C, MeTro Hà Đông, Aein Mall Nhật Bản. Phí đối diện tòa tháp là vườn Hoa Hà Đông và công viên Nguyễn Trãi tiện cho thể dục thể thao mỗi buổi sáng hoặc chiều tối cho cư dân. + Giá 1,65 tỷ bao gồm nội thất cơ bản: Full thiết bị vệ sinh, phòng tắm, cửa gỗ các phòng, sàn gỗ, trần nhà, đèn âm, Tủ bếp bàn bếp, Tủ rượu sang trọng, quầy bar, full rèm cửa, nóng lạnh, điều hoà. G