{"url": "https://dothi.net/ban-dat-duong-5-xa-xuan-canh-1/dat-bia-lang-thon-van-thuong-o-to-tranh-thanh-khoan-cao-dt-133m2-mt-8m-gia-45-ty-pr13346888.htm", "code": "13346888", "title": "Đất bìa làng thôn Văn Thượng, ô tô tránh, thanh khoản cao, DT 133m2, MT 8m, giá: 4.5 tỷ", "description": "Đất bìa làng thôn Văn Thượng, ô tô tránh, thanh khoản cao, DT 133m2, MT 8m, giá: 4.5 tỷ      Khu vực:    Bán đất tại Đường 5  - Huyện Đông Anh - Hà Nội     Giá:   4.5 Tỷ  Diện tích:  133 m²       Thông tin mô tả    Đất bìa làng thôn Văn Thượng, ô tô tránh, thanh khoản cao. DT 133m2, MT 8m, giá: 4.5 tỷ. - Gia đình cần bán gấp mảnh đất thuộc thôn Văn Thượng, xã Xuân Canh, nằm ở vị trí cực đắc địa, mặt tiền rộng. Gần nhà văn hóa thôn, trường mầm non. Giao thông cực kỳ thuận tiện. Nơi rất hiếm có người bán. - Không khí trong lành quanh năm. An sinh xã hội đỉnh cao với trường học, phòng khám, bể bơi, khu thể thao, câu lạc bộ cộng đồng. - Hàng xóm thân thiện, dân trí cao. Tương lai vị trí đất sẽ rất đẹp và có giá trị lớn. - Đây là lựa chọn đáng được quan tâm và lưu ý, những nhà đầu tư sáng suốt nên bỏ ra vài phút để đến xem xét và nghiên cứu về độ mức độ tiện nghi và lợi nhuận đáng xuống tiền của bất động sản này. - Diện tích: 133m2. - Mặt tiền: 8m. - Sổ đỏ chính chủ, pháp lý sạch, sẵn sàng giao dịch. - Thửa đất vuông vắn, không lỗi phong thủy. - Giá: 4.5 tỷ. Liên hệ: A Trung 0904547086.          Tìm kiếm theo từ khóa :  Bán đất thôn văn thượng xã Xuân Canh huyện Đông Anh ,  Bán đất thôn văn thượng xã Xuân Canh ,  Bán đất xã Xuân Canh huyện Đông Anh ,  Bán đất đường 5 huyện Đông Anh ,  Bán đất huyện Đông Anh               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13346888       Loại tin rao    Bán đất       Ngày đăng tin    09/12/2020       Ngày hết hạn    08/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào    5 m       Mặt tiền    8 m       Số tầng           Số 