{"url": "https://dothi.net/ban-nha-biet-thu-lien-ke-louis-city-hoang-mai/ban-suat-ngoai-giao-gia-re-vao-ten-voi-cdt-louis-hoang-mai-0979890203-pr13121872.htm", "code": "13121872", "title": "Bán suất ngoại giao giá rẻ, vào tên với CĐT Louis Hoàng Mai - 09.7989.0203", "description": "Bán suất ngoại giao giá rẻ, vào tên với CĐT Louis Hoàng Mai - 09.7989.0203      Khu vực:    Bán nhà biệt thự, liền kề tại Louis City Hoàng Mai  - Quận Hoàng Mai - Hà Nội     Giá:   Thỏa thuận  Diện tích:  93 m²       Thông tin mô tả    Dự án liền kề Louis City Hoàng Mai cực kỳ tiềm năng để quý khách mua ở hoặc đầu tư với lợi thế mặt đường Vành Đai 2,5, cách bờ hồ 6km. Tư vấn trung thực, chuyên nghiệp: Mr Tiến 09.7989.0203. - Pháp lý dự án đã đầy đủ: Hợp đồng mua bán, các loại quyết định, giấy phép, biên lai đóng thuế đất, bảo lãnh ngân hàng. - Quy mô dự án: 23 ha. + Liền kề: 681 căn. Diện tích 93 - 100 - 112 - 200m2. + Biệt thự: 72 căn. - Giá từ 74 tr/m2. - Vị trí dự án: 54 đường Tân Mai (Vành Đai 2,5) - Hoàng Mai - Hà Nội. + Đông: Tiếp giáp chợ đầu mối phía Nam (Vinhomes). + Tây: Tiếp giáp đường 40m. + Nam: Tiếp giáp đường 30m - hồ Gamuda Yên Sở. + Bắc: Tiếp giáp mặt đường Tân Mai. - Dịch vụ tiện ích của dự án: + Hệ thống giáo dục liên cấp. + Công viên cây xanh. + Bể bơi bốn mùa. + Hệ thống phòng gym liên hoàn. + Trung tâm thương mại. + Bãi đỗ xe công cộng. - Tiến độ thi công dự án. + Khởi công: 2019. + Hoàn thành: 2022. - Tiến độ hiện tại của dự án. + San lấp mặt bằng. + Cơ sở hạ tầng. + Xây dựng đường nội bộ. + Hệ thống điện nước. + Công viên, cây xanh... Suất ngoại giao - Giá bán tốt nhất thị trường. Tư vấn trung thực, chuyên nghiệp: Mr Tiến 09.7989.0203. Cam kết tư vấn trung thực, chính xác về dự án để quý khách được cung cấp đầy đủ thông tin và vị trí từng căn liền kề, biệt thự. Hỗ trợ khách hàng tối đa đến khi hoàn tất mọi thủ tục pháp lý, nhận nhà và sổ đỏ. Quý khách hàng trước khi quyết định đầu tư hãy gọi để được tư vấn và tham khảo với những ưu đãi tốt nhất. Trân trọng cảm ơn quý khách đã quan tâm dự án!          Tìm kiếm theo từ khóa :  Bán biệt thự Hoàng Mai ,  Bán biệt thự Louis City Hoàng Mai ,  Bán biệt thự gần hồ Gamuda Yên Sở Hoàng Mai               Hình ảnh  ()   Bản đồ                                                                               Đặc điểm bất động sản         Mã số    13121872       Loại tin rao    Bán nhà biệt thự, liền kề (nhà trong dự án quy hoạch)       Ngày đăng tin    19/06/2021       Ngày hết hạn    19/07/2021       Hướng nhà    Đông-Nam       Hướng ban công           Số phòng    6       Đường vào    13.5 m       Mặt tiền    6 m       Số tầng    5       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Mr Tiến       Địa chỉ    Tân Mai - Hoàng Mai - Hà Nội       Điện thoại           Di động    0979890203       Email                 Lưu tin   In tin này", "phone": "0979890203"}
