{"url": "https://dothi.net/ban-nha-rieng-pho-truc-cat-phuong-vinh-niem/ban-nha-4-tang-xay-moi-doc-lap-gan-nga-4-truc-cat-le-chan-hai-phong-pr13701628.htm", "code": "13701628", "title": "Bán nhà 4 tầng xây mới độc lập gần ngã 4 Trực Cát, Lê Chân, Hải Phòng", "description": "Bán nhà 4 tầng xây mới độc lập gần ngã 4 Trực Cát, Lê Chân, Hải Phòng      Khu vực:    Bán nhà riêng tại Phố Trực Cát  - Quận Lê Chân - Hải Phòng     Giá:   2.5 Tỷ  Diện tích:  44 m²       Thông tin mô tả    Bán nhà 4 tầng xây mới độc lập gần ngã 4 Trực Cát, Lê Chân, Hải Phòng. + Diện tích MB: 44m2. + Chiều rộng: 4m. + Hướng: Tây Nam. + Giấy tờ: Sổ hồng chính chủ, Giấy phép, thiết kế xây dựng; Vị trí: - Nằm trên nền đất thổ vững chắc, sạch sẽ, ngõ trước nhà rộng 2m, cách đường Trực Cát 30m, địa điểm gần trường học các cấp từ mầm non, cấp 1, 2, Cấp 3 (Lê Chân), Đại học bán kính vài km, các trung tâm mua sắm (Siêu thị Aeon, Vinmart, Thế giới di động, Điện máy xanh), Ngân Hàng (Agribank, Techcombank... ), bệnh viện VinMec, Cầu Rào 2, chợ, UBND Phường, bệnh viện, dân cư đông đúc, khu phố sầm uất, an ninh khu vực tốt, giao thông thuận tiện sinh hoạt. Thiết kế: - Nhà thiết kế hiện đại, phong thủy tốt rất vượng khí, thông thoáng, tràn ngập ánh sáng tự nhiên, cầu thang rộng mang lại cảm giác thoải mái cho người ở, các phòng thiết kế thông minh mang lại nhiều tiện ích và công năng sử dụng. Nội thất: - Nội thất nhà hiện đại, cao cấp, trần thạch cao giật cấp đa dạng khe sáng, hệ thống chiếu sáng hiện đại, tủ bếp, hệ thống cửa được làm bằng kính chịu lực tốt, gỗ tự nhiên cao cấp, cửa cuốn điều khiển tự động, thiết bị vệ sinh cao cấp. Cấu trúc: Nhà xây 4 tầng độc lập, xây mới. + Tầng 1: Phòng khách, bếp, WC; + Tầng 2,3: 2 phòng ngủ rộng rãi, WC; + Tầng 3: Phòng thờ, sân phơi, ban công. Tiện nghi: Điện nước, truyền hình cáp, internet đầy đủ; Giá bán: 2 tỷ 500 triệu (có thỏa thuận) Hỗ trợ ngân hàng đến 75% ngân hàng. Liên hệ: 08666.39.799 để dẫn qua xem nhà và tư vấn các sp tương tự.          Tìm kiếm theo từ kh