{"url": "https://dothi.net/ban-dat-duong-5-xa-hai-boi/ban-80m2-dat-tai-dinh-cu-hai-boi-dong-anh-truoc-mat-la-thanh-pho-thong-minh-pr12621739.htm", "code": "12621739", "title": "Bán 80m2 đất tái định cư Hải Bối - Đông Anh. Trước mặt là thành phố thông minh", "description": "Bán 80m2 đất tái định cư Hải Bối - Đông Anh. Trước mặt là thành phố thông minh      Khu vực:    Bán đất tại Đường 5  - Huyện Đông Anh - Hà Nội     Giá:   Thỏa thuận  Diện tích:  80 m²       Thông tin mô tả    S = 80m2, (5m x 16m) đường 8m + vỉa hè. Hiện đây là lô đất duy nhất Khu Tái Định Cư đang chào bán, mảnh đất nằm ở vị trí cực đắc địa, nằm cạnh đường QL 5, Trước mặt là vườn hoa, view trung tâm Tài Chính và tòa tháp đôi Phương Trạch 108 tầng. Tương lai vị trí đất sẽ rất sầm uất và có giá trị thương mại lớn. - Đây là cơ hội cho AC nhà đầu tư sở hữu ngay lô đất nằm trong quy hoạch Thành Phố Thông Minh, cách cầu Nhật Tân 1km, tòa tháp đôi tài chính Phương Trạch 300m, quy hoạch hạ tầng ổn định, giao thông thuận tiện. - Sổ đỏ chính chủ, pháp lý sạch, sẵn sàng giao dịch. - Thửa đất vuông như viên gạch, không lỗi phong thủy. - Liên hệ xem bất động sản: 0977.191.861 - 0886.955.999. * Mr. Nam - Chuyên bất động sản thổ cư, nhà phố. Mua Bán - Ký gửi - Uy tín - Tận tâm.          Tìm kiếm theo từ khóa :  Bán đất huyện Đông Anh ,  Bán đất xã Hải Bối huyện Đông Anh ,  Bán đất đường 5 huyện Đông Anh ,  Bán đất gần cầu Nhật Tân huyện Đông Anh               Hình ảnh  ()   Bản đồ                                                                   Đặc điểm bất động sản         Mã số    12621739       Loại tin rao    Bán đất       Ngày đăng tin    06/03/2021       Ngày hết hạn    20/03/2021       Hướng nhà    Đông-Nam       Hướng ban công           Số phòng           Đường vào    12 m       Mặt tiền    5 m       Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Hai Nam       Địa chỉ           Điện thoại           Di động    0977191861       Email     <!-- docume