{"url": "https://dothi.net/ban-dat-duong-3-8-xa-xuan-canh-1/ban-95m-dat-mt-9m-sat-eurowindow-river-park-47-trieu1m-pr13613959.htm", "code": "13613959", "title": "Bán 95m2 đất, MT 9.5m, sát Eurowindow River Park, 47 triệu/1m2", "description": "Bán 95m2 đất, MT 9.5m, sát Eurowindow River Park, 47 triệu/1m2      Khu vực:    Bán đất tại Đường 3  - Huyện Đông Anh - Hà Nội     Giá:   47 Triệu/m²  Diện tích:  95 m²       Thông tin mô tả    Bán 95m2 đất gần UBND xã Đông Hội, Đông Anh, Hà Nội. Sát ngay dự án Eurowindow River Park, mấy chục mét ra khu đất chuẩn bị đấu giá. Từ vị trí đất ra tới dự án, trường học chỉ 1 phút. Hiện dự án đã xong 5 tòa chung cư từ năm 2020, dân cư đông đúc với 2.058 căn hộ chung cư, 65 căn biệt thự liền kề và 137 căn shophouse. Hiện quỹ đất của dự án vẫn còn để xây trường học, chung cư, liền kề. Tương lai khu đất còn tiếp tục tăng giá. Sổ đỏ vuông vắn, mặt tiền tận 9,5m, xe tải vào đất. Giá: 47 triệu/1m2 (có thương lượng). Liên hệ tư vấn và xem nhà đất miễn phí: Nam Hà: 0971.88.59.88 (Call/Zalo/SMS 24/7).          Tìm kiếm theo từ khóa :  Bán đất huyện Đông Anh ,  Bán đất đường 3 huyện Đông Anh ,  Bán đất gần ủy ban nhân dân xã Đông Hội huyện Đông Anh ,  Bán đất xã Xuân Canh huyện Đông Anh               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13613959       Loại tin rao    Bán đất       Ngày đăng tin    15/04/2021       Ngày hết hạn    29/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền    9.5 m       Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Nam Hà       Địa chỉ    Đông Hội, Đông Anh, Hà Nội.       Điện thoại    0971885988       Di động    0971885988       Email     <!-- document.write(\"&#110;&#97;&#109;&#104;&#97;&#48;&#51;&#48;&#49;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi 