{"url": "https://dothi.net/ban-nha-rieng-pho-truc-cat-phuong-vinh-niem/ban-nha-rieng-tai-pho-truc-cat-phuong-vinh-niem-le-chan-hai-phong-pr13609763.htm", "code": "13609763", "title": "Bán nhà riêng tại phố Trực Cát, Phường Vĩnh Niệm, Lê Chân, Hải Phòng", "description": "Bán nhà riêng tại phố Trực Cát, Phường Vĩnh Niệm, Lê Chân, Hải Phòng      Khu vực:    Bán nhà riêng tại Phố Trực Cát  - Quận Lê Chân - Hải Phòng     Giá:   2.5 Tỷ  Diện tích:  50 m²       Thông tin mô tả    Bán nhà xây 4 tầng độc lập, khung cột, tường riêng biệt, thiết kế hiện đại, mặt ngõ rộng nhà khu vực Trực Cát, Thiên Lôi, Vĩnh Niệm, Hải Phòng. Chất lượng được khẳng định 100%. Diện tích: 50m2. Hướng: T4T. Mô tả chi tiết: - Nhà xây 4 tầng, khung cột, tường riêng biệt, thiết kế hiện đại. Mặt ngõ rộng - ôtô vào nhà, không gian thoáng mát, dân cư đông đúc, dân trí cao. - Nằm trên tuyến phố sầm uất khu Thiên Lôi - Lê Chân, mặt ngõ thông thoáng đi ra đường Worldbank, xung quanh bán kính 500m là trường học các cấp 1,2,3 Lê Chân, chợ Vĩnh Niệm, siêu thị Vinmart, Vin Home Cầu Rào 2, Hoàng Huy Mall giao thông thuận tiện đi lại, an ninh tốt. Cấu trúc nhà gồm: - Tầng 1: Phòng khách + bếp + WC. - Tầng 2: 2 phòng ngủ + WC. - Tầng 3: 2 phòng ngủ + WC. - Tầng 4: Phòng thờ + sân phơi + ban công. Pháp lý: Sổ đỏ chính chủ + giấy phép xây dựng. Giá chỉ từ 2 tỷ 500 tr. Liên hệ: 0977030719. Xuân Yên nhà đất thổ cư.          Tìm kiếm theo từ khóa :  Bán nhà quận Lê Chân ,  Bán nhà gần chợ Vĩnh Niệm quận Lê Chân ,  Bán nhà gần siêu thị Vinmart quận Lê Chân ,  Bán nhà phường Vĩnh Niệm quận Lê Chân ,  Bán nhà phố Trực Cát quận Lê Chân               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    13609763       Loại tin rao    Bán nhà riêng       Ngày đăng tin    12/04/2021       Ngày hết hạn    26/04/2021       Hướng nhà    Tây-Nam       Hướng ban công           Số phòng    4       Đường vào           Mặt tiền           Số tầng 