{"url": "https://dothi.net/cho-thue-van-phong-duong-hoang-dieu-46/van-phong-cho-thue-duong-hoang-dieu-dien-tich-100m2-180m2-lh-hotline-0982099920-pr13683993.htm", "code": "13683993", "title": "Văn phòng cho thuê đường Hoàng Diệu, diện tích 100m2, 180m2, LH hotline: 098.20.999.20", "description": "Văn phòng cho thuê đường Hoàng Diệu, diện tích 100m2, 180m2, LH hotline: 098.20.999.20      Khu vực:    Cho thuê văn phòng tại Đường Hoàng Diệu  - Quận Hải Châu - Đà Nẵng     Giá:   Thỏa thuận  Diện tích:  100 m²       Thông tin mô tả    Chúng tôi đang cần cho thuê văn phòng đường Hoàng Diệu, vị trí trung tâm thành phố, đẹp, là nơi đặt trụ sở của nhiều công ty với nhiều lĩnh vực khác nhau. - Diện tích cho thuê đang trống: 100m2, 180m2 và các diện tích lớn nhỏ khác tùy theo nhu cầu của khách thuê. - Giá thuê tham khảo: Chỉ từ 250.000 vnđ/m2/tháng. - Giá này đã bao gồm phí dịch vụ nhưng chưa bao gồm VAT và tiền điện sử dụng (tiền điện được tính theo đồng hồ riêng). - Hình thức thanh toán tham khảo: Cọc 03 tháng và thanh toán 03 tháng/lần. - Tòa nhà được thiết kế chuẩn văn phòng cho thuê. Để biết thêm thông tin và hướng dẫn đi xem văn phòng, vui lòng liên hệ hotline: 098.20.999.20. Truy cập website: https://thuenhanhhon.com để xem thêm nhiều văn phòng cho thuê phù hợp với nhu cầu của quý khách hàng.          Tìm kiếm theo từ khóa :  Cho thuê văn phòng Hải Châu ,  Cho thuê văn phòng Hoàng Diệu Hải Châu               Hình ảnh  ()   Bản đồ                                                       Đặc điểm bất động sản         Mã số    13683993       Loại tin rao    Cho thuê văn phòng       Ngày đăng tin    13/06/2021       Ngày hết hạn    13/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Công Ty TNHH TM & DV Cho Thuê Nhanh Hơn        Địa chỉ    Thanh Khê - Đà Nẵng       Điện thoại           Di động    098209992