{"url": "https://dothi.net/ban-dat-duong-khuong-dinh-phuong-thuong-dinh/chinh-chu-chuyen-nhuong-gap-manh-dat-mat-pho-khuong-dinh-gan-nga-tu-so-gia-hop-li-nhat-moi-thoi-dai-pr13652404.htm", "code": "13652404", "title": "Chính chủ chuyển nhượng gấp mảnh đất mặt phố Khương Đình gần Ngã Tư Sở giá hợp lí nhất mọi thời đại", "description": "Chính chủ chuyển nhượng gấp mảnh đất mặt phố Khương Đình gần Ngã Tư Sở giá hợp lí nhất mọi thời đại      Khu vực:    Bán đất tại Đường Khương Đình  - Quận Thanh Xuân - Hà Nội     Giá:   17.5 Tỷ  Diện tích:  110 m²       Thông tin mô tả    Mảnh đất vàng cho làng Nhà Đất. Đất mặt phố trung tâm quận Thanh Xuân - giá phố giá như mặt ngõ. Mặt phố Khương Đình DT 110m2 MT 3.5m giá 17,5 tỷ. Đất mặt phố tặng nhà cấp 4, Khương Đình lõi của Quận Thanh Xuân. Bán đất mặt phố Khương Đình, khu vực kinh doanh tấp nập, phù hợp mọi hình thức đầu tư, mặt đường có vỉa hè, giao thông thuận lợi, kinh doanh, xây tòa nhà văn phòng, nhà hàng... Đều đẹp. Vị trí: Mặt phố Khương Đình Trung tâm Quận Thanh Xuân, vị trí đẹp nhất phố Khương Đình gần Nguyễn Trãi, Ngã Tư Sở, Royal City. Ô tô tải tránh, Khu vực kinh doanh sầm uất, phù hợp nhiều loại hình kinh doanh. Kết nối giao thông Nguyễn Trãi, Kim Giang, Vũ Tông Phan.. Hiện trạng bán đất tặng nhà cấp 4 kinh doanh tốt. Sổ đỏ pháp lý chuẩn sẵn sàng giao dịch. Kinh doanh đẹp thẳng tắp 2 hàng cây xanh, tiềm năng trong tương lai khi bờ sông được cải tạo và đường Vành đai 2.5 đi qua cách 200m.  Đối diện bên kia đường là chung cư Garden Riverside. Cách chung cư Fivestar 500m.  Gần UBND phường, công an, y tế phường... LH: 084.959.2929 chú Tân Miễn TG, QC.          Tìm kiếm theo từ khóa :  Bán đất quận Thanh Xuân ,  Bán đất phường Thượng Đình quận Thanh Xuân ,  Bán đất đường Khương Đình quận Thanh Xuân ,  Bán đất gần Ngã Tư Sở quận Thanh Xuân               Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13652404       Loại tin rao    Bán đất       Ngày đăng tin