{"url": "https://dothi.net/ban-nha-mat-pho-duong-tran-quy-phuong-4-17/ban-nha-mat-photran-quy-p4-q11-65m2-28-ty-pr13713293.htm", "code": "13713293", "title": "Bán nhà mặt phố Trần Quý, P. 4, Q11, 65m2, 28 tỷ", "description": "Bán nhà mặt phố Trần Quý, P. 4, Q11, 65m2, 28 tỷ      Khu vực:    Bán nhà mặt tiền tại Đường Trần Quý  - Quận 11 - Hồ Chí Minh     Giá:   28 Tỷ  Diện tích:  65 m²       Thông tin mô tả    + Do phải đầu tư thêm nhà máy sản xuất bao bì xuất khẩu, nên anh chị bán căn nhà 5 tầng để nhập khẩu máy móc về để phục vụ cho việc sản xuất, anh/chị cần ra gấp. + Nhà 65 m2, 5 tầng 1 trệt, ngay góc mặt tiền lớn, trung tâm buôn bán kinh doanh sầm uất bật nhất chợ lớn, gần bệnh viện, trường đại học, gần Chợ Lớn, chợ Kim Biên, chợ Hòa Hảo. + Tiện lợi kinh doanh đa ngành nghề, cà phê, kinh doanh phòng cho thuê, kinh doanh khách sạn, khu mua sắm, siêu thị mini, khu trung tâm lớn bật nhất Sài Gòn, thuận tiện cho giao thông các kiểu. + Pháp lý sạch, sổ hồng công chứng ngay. + Giá bán: 28 tỷ (tiếp người thiện chí bớt lộc). + Miễn tiếp trung gian và môi giới. + Liên hệ 0909101469 (anh Quân).          Tìm kiếm theo từ khóa :  Bán nhà mặt phố Quận 11 ,  Bán nhà mặt phố gần chợ lớn Quận 11 ,  Bán nhà mặt phố gần chợ Kim Biên Quận 11 ,  Bán nhà mặt phố gần chợ Hòa Hảo Quận 11 ,  Bán nhà mặt phố đường Trần Quý quận 11               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13713293       Loại tin rao    Bán nhà mặt phố (nhà mặt tiền trên các tuyến phố)       Ngày đăng tin    06/07/2021       Ngày hết hạn    20/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào    12 m       Mặt tiền           Số tầng    6       Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Bán Nhà 5 Tầng, Trần Quý, P.4, Q11, 65M2, 28 Tỷ       Địa chỉ    Trần Quý, 4, Quận 11, Hồ Chí Minh, -Dự án-       Điện thoại    0909101469       Di động    09091