{"url": "https://dothi.net/ban-dat-duong-17-4-phuong-van-phuc-1/ban-gap-dat-dich-vu-van-phuc-ha-dong-dt-50m2-mt-5m-duong-12m-huong-tb-pr13562478.htm", "code": "13562478", "title": "Bán gấp đất dịch vụ Vạn Phúc, Hà Đông DT 50m2, MT 5m, đường 12m, hướng TB", "description": "Bán gấp đất dịch vụ Vạn Phúc, Hà Đông DT 50m2, MT 5m, đường 12m, hướng TB      Khu vực:    Bán đất tại Đường 17  - Quận Hà Đông - Hà Nội     Giá:   Thỏa thuận  Diện tích:  50 m²       Thông tin mô tả    Bán đất dịch vụ Vạn Phúc Hà Đông DT 48m2, mt 4,8m, đường 12m, hướng TB, vị trí đẹp, gần ngã tư Vạn Phúc Hà Đông, giao thông đi lại thuận tiện, sổ đỏ chính chủ, giấy phép xây dựng 6 tầng, gia đình không có nhu cầu ở cần bán gấp giá bán LH 0936.480,475: N07B dt 50m2, mt 5m, đường 12m, hướng ĐN, giá rẻ. N06C, hướng TB, dt 46m2, mt 4,6m, đường 12m, sổ đỏ, giá thỏa thuận. N06B dt 49m2, mt 4,9m, hướng TB, giá rẻ. N010 E, dt 50m2, mt 5m, đường 12m, hướng TB, giá lh hải âu. N07D, hướng ĐN, đường 24m, dt 50m2, mt 4m, giá siêu rẻ. N010E căn góc, dt 50m2, đường 12m và đường 17m, giá rẻ. DT 95m2, mt 9,5m, đường 12m, hướng ĐN, giá bán siêu rẻ. DT 48m2, mt 5,3m, đường 12m, hướng ĐN, giá bán siêu rẻ. Dãy N06B, DT 48m2, mt 4,8m, đường 12m, hướng TB, giá bán siêu rẻ LH 0936.480.475. Quý khách có nhu cầu chuyển đổi mua bán nhà đất xin liên hệ văn phòng bất động sản Hải Âu. Đ/C Số 26 Lê Văn Lương kéo dài(Tố Hữu), Vạn Phúc, Hà Đông, Hà Nội: Tell 0936.480.475.          Tìm kiếm theo từ khóa :  Bán đất đường 17 quận Hà Đông ,  Bán đất phường Vạn Phúc quận Hà Đông ,  Bán đất gần ngã tư Vạn Phúc quận Hà Đông ,  Bán đất quận Hà Đông               Hình ảnh  ()   Bản đồ                                                       Đặc điểm bất động sản         Mã số    13562478       Loại tin rao    Bán đất       Ngày đăng tin    28/06/2021       Ngày hết hạn    12/07/2021       Hướng nhà    Đông-Nam       Hướng ban công           Số phòng           Đường vào    12 m       Mặt tiền    5 m       Số tầng           Số toilet          