{"url": "https://dothi.net/cho-thue-can-ho-chung-cu-d-le-pont-dor-hoang-cau/chinh-chu-cho-thue-can-ho-cao-cap-tai-du-an-dle-pont-dor-tan-hoang-minh-36-hoang-cau-120m2-3pn-gia-16-trieuthang-pr13709082.htm", "code": "13709082", "title": "Chính chủ cho thuê CHCC tại dự án D'.Le Pont D'or, Tân Hoàng Minh, 36 Hoàng Cầu 120m2 3PN 16 tr/th", "description": "Chính chủ cho thuê CHCC tại dự án D'.Le Pont D'or, Tân Hoàng Minh, 36 Hoàng Cầu 120m2 3PN 16 tr/th      Khu vực:    Cho thuê căn hộ chung cư tại D’. Le Pont D’or - Hoàng Cầu  - Quận Đống Đa - Hà Nội     Giá:   16 Triệu/tháng  Diện tích:  120 m²       Thông tin mô tả    Tôi cần cho thuê gấp căn hộ tầng trung tại chung cư D'. Le Pont D'or Tân Hoàng Minh số 36 Hoàng Cầu. Căn hộ có diện tích 120m2, 3PN, 2VS. Căn hộ đã được trang bị đầy đủ nội thất cao cấp bao gồm: Điều hòa 2 chiều Daikin, hệ thống tủ bếp, bếp từ cao cấp, tivi, tủ lạnh, máy giặt, sàn gỗ tự nhiên, sofa nhập khẩu, khách thuê chỉ cần xách vali đến ở. Phù hợp với khách thuê ở gia đình hoặc khách là người nước ngoài. Các tiện ích của dự án: Nằm trong khu vực trung tâm và sầm uất bậc nhất của thành phố giao thông thuận tiện, cạnh hồ Hoàng Cầu, cạnh nhiều trường học, trung tâm giải trí mua sắm, bể bơi bốn mùa, spa & gym, siêu thị, mẫu giáo, Giá thuê là 16triệu/tháng. Khách có nhu cầu thuê LH: Hương 0975357268 (MG). Công ty BĐS Đức Việt (Miễn phí cho khách xem).              Hình ảnh  ()   Bản đồ                                               Đặc điểm bất động sản         Mã số    13709082       Loại tin rao    Cho thuê căn hộ chung cư       Ngày đăng tin    24/06/2021       Ngày hết hạn    24/09/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào           Mặt tiền           Số tầng           Số toilet    2       Nội thất    Điều hòa 2 chiều Daikin hệ thống tủ bếp, bếp từ cao cấp, tivi, tủ lạnh, máy giặt, sàn gỗ tự nhiên, sofa nhập khẩu.             Thông tin liên hệ       Tên liên lạc    Phùng Hương       Địa chỉ    Dự án D’. 