{"url": "https://dothi.net/ban-dat-xa-nam-phuong-tien/gan-view-ho-550m-mat-tien-19m-duong-7m-gia-145-ty-nam-phuong-tien-chuong-my-ha-noi-pr13554867.htm", "code": "13554867", "title": "Gần view hồ 550m2, mặt tiền 19m, đường 7m, giá 1.45 tỷ Nam Phương Tiến, Chương Mỹ, Hà Nội", "description": "Gần view hồ 550m2, mặt tiền 19m, đường 7m, giá 1.45 tỷ Nam Phương Tiến, Chương Mỹ, Hà Nội      Khu vực:   Bán đất tại Xã Nam Phương Tiến  - Huyện Chương Mỹ - Hà Nội     Giá:   1.45 Tỷ  Diện tích:  550 m²       Thông tin mô tả    - Mình cần bán nhanh 550m2 vuông đất ở, mặt tiền 19m, cách mặt hồ lớn 30m, mặt đường bê tông rộng 7m, Nam Phương Tiến Chương Mỹ Hà Nội. - Vị trí đất rất đẹp đứng từ đất có thể nhìn thấy mặt hồ lớn, không khí trong xanh mát lành, môi trường sạch sẽ, thân thiện. Cách đường Hồ Chí Minh 500m, cách Xuân Mai 7km, cách trung tâm Hà Nội 32 km. - Thửa đất vuông vắn, giao thông thuận lợi, rất thích hợp để làm nơi nghỉ dưỡng, và đầu tư sinh lời. - Sổ đỏ đẹp, sang tên trong ngày giá chỉ có 1.45 tỷ. Liên hệ em Thuyên để được xem đất, chu đáo, nhiệt tình dễ tính 0983914598.          Tìm kiếm theo từ khóa :  Bán đất huyện Chương Mỹ ,  Bán đất xã Nam Phương Tiến huyện Chương Mỹ               Hình ảnh  ()   Bản đồ                                                                       Đặc điểm bất động sản         Mã số    13554867       Loại tin rao    Bán đất       Ngày đăng tin    25/02/2021       Ngày hết hạn    25/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào    7 m       Mặt tiền    19 m       Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Thuyên       Địa chỉ    Nam Phương Tiến Chương Mỹ Hà Nội       Điện thoại    0983914598       Di động    0983914598       Email     <!-- document.write(\"&#97;&#110;&#104;&#116;&#104;&#117;&#121;&#101;&#110;&#49;&#57;&#56;&#56;&#52;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bả