{"url": "https://dothi.net/ban-can-ho-chung-cu-chung-cu-bo-tong-tham-muu/can-ban-can-ho-sua-dep-789-my-dinh-90m2-3-phong-ngu-re-nhat-thi-truong-nhu-hinh-anh-cam-ket-pr13544743.htm", "code": "13544743", "title": "Cần bán căn hộ sửa đẹp 789 Mỹ Đình 90m2, 3 phòng ngủ, rẻ nhất thị trường như hình ảnh cam kết", "description": "Cần bán căn hộ sửa đẹp 789 Mỹ Đình 90m2, 3 phòng ngủ, rẻ nhất thị trường như hình ảnh cam kết      Khu vực:    Bán căn hộ chung cư tại Chung cư Bộ Tổng Tham Mưu  - Quận Nam Từ Liêm - Hà Nội     Giá:   2.38 Tỷ  Diện tích:  90 m²       Thông tin mô tả    Cần bán căn hộ góc tầng trung cực đẹp, đẹp nhất tòa nhà, căn hộ được gia chủ sửa sang rất tâm huyết. - Một trong số ít các căn tại chung cư này được cấp sổ đỏ. - Tòa A chung cư 789 Mỹ Đình 2, Nam Từ Liêm, Hà Nội. - Diện tích 90m2 chia thành 3 phòng ngủ và 2 wc và 1 phòng khách, nhà để lại tủ bếp, điều hòa, bình nóng lạnh và toàn bộ nội thất cao cấp. Cửa gỗ tự nhiên, trần cao 3m; phí dịch vụ thấp; Gần trường học các cấp, chợ, bến xe Mỹ Đình... Cửa hướng Nam cực mát mẻ. Hình ảnh thực tế căn hộ, quan trọng các bác phải đến xem cảm nhận (sổ hồng chính chủ). - Giá 26,5 triệu/m2 (2.38 tỷ) - thương lượng cho người thiện chí.          Tìm kiếm theo từ khóa :  Bán căn hộ Nam Từ Liêm ,  Bán căn hộ gần bến xe Mỹ Đình Nam Từ Liêm ,  Bán Chung Cư Bộ Tổng Tham Mưu ,  Bán căn hộ tòa A Chung Cư Bộ Tổng Tham Mưu               Hình ảnh  ()   Bản đồ                                                                           Đặc điểm bất động sản         Mã số    13544743       Loại tin rao    Bán căn hộ chung cư       Ngày đăng tin    01/03/2021       Ngày hết hạn    15/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào           Mặt tiền           Số tầng           Số toilet    2       Nội thất                 Thông tin liên hệ       Tên liên lạc    A Thuận       Địa chỉ    Cầu Giấy - Hà Nội       Điện thoại           Di động    0933339326       Email     <!-- document.write(