{"url": "https://dothi.net/cho-thue-can-ho-chung-cu-d-le-pont-dor-hoang-cau/cho-thue-can-ho-cao-cap-d-le-pont-d-or-tan-hoang-minh-36-hoang-cau-120m2-3pn-gia-17-trieuthang-pr13709076.htm", "code": "13709076", "title": "Cho thuê căn hộ cao cấp D'. Le Pont D'or, Tân Hoàng Minh, 36 Hoàng Cầu 120m2, 3PN, giá 17tr/th", "description": "Cho thuê căn hộ cao cấp D'. Le Pont D'or, Tân Hoàng Minh, 36 Hoàng Cầu 120m2, 3PN, giá 17tr/th      Khu vực:    Cho thuê căn hộ chung cư tại D’. Le Pont D’or - Hoàng Cầu  - Quận Đống Đa - Hà Nội     Giá:   17 Triệu/tháng  Diện tích:  120 m²       Thông tin mô tả    Chính chủ cần cho thuê gấp căn hộ 5* tầng trung tại tổ hợp chung cư Luxury Apartment D'. Le Pont D or do Tân Hoàng Minh làm chủ đầu tư, địa chỉ số 36 Hoàng Cầu, Đống Đa, Hà Nội. Căn hộ có diện tích 120m2 được thiết kế thành 3 phòng ngủ, 2 toilet,.. Căn hộ đã được trang bị đầy đủ nội thất cao cấp, sang trọng và cực kỳ tinh tế bao gồm: Điều hòa hai chiều Daikin, nóng lạnh, hệ thống tủ bếp, bếp từ cao cấp, sàn gỗ tự nhiên,... Phù hợp với khách thuê ở gia đình hoặc khách là người nước ngoài. Các tiện ích của dự án: Nằm trong khu vực trung tâm và sầm uất bậc nhất của thành phố giao thông thuận tiện, cạnh hồ điều hòa Hoàng Cầu, có trường mầm non song ngữ Việt Mỹ, bể bơi 4 mùa rộng, phòng tập gym & Yoga, hệ thống siêu thị Vinmart ở tầng 1,... Giá cho thuê là 17 triệu/tháng. Khách thuê có nhu cầu vui lòng LH: Hương 0975357268 (MTG).              Hình ảnh  ()   Bản đồ                                           Đặc điểm bất động sản         Mã số    13709076       Loại tin rao    Cho thuê căn hộ chung cư       Ngày đăng tin    26/06/2021       Ngày hết hạn    26/09/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào           Mặt tiền           Số tầng           Số toilet    2       Nội thất    Điều hòa hai chiều Daikin, nóng lạnh, hệ thống tủ bếp, bếp từ cao cấp, sàn gỗ tự nhiên,...              Thông tin liên hệ       Tên liên lạc    Phùng Hương      