{"url": "https://dothi.net/ban-can-ho-chung-cu-chung-cu-bo-tong-tham-muu/can-ban-can-ho-rat-re-o-789-my-dinh-165-ty-can-70m2-chia-2-ngu-tang-dep-ve-o-luon-pr13558800.htm", "code": "13558800", "title": "Cần bán căn hộ rất rẻ ở 789 Mỹ Đình 1,65 tỷ căn 69,35m2 chia 2 ngủ, tầng đẹp về ở luôn", "description": "Cần bán căn hộ rất rẻ ở 789 Mỹ Đình 1,65 tỷ căn 69,35m2 chia 2 ngủ, tầng đẹp về ở luôn      Khu vực:    Bán căn hộ chung cư tại Chung cư Bộ Tổng Tham Mưu  - Quận Nam Từ Liêm - Hà Nội     Giá:   1.65 Tỷ  Diện tích:  69.4 m²       Thông tin mô tả    Cần bán tòa chung cư 789 Tháp A - Mỹ Đình 1, Nam Từ Liêm, HN. Thông tin căn hộ như sau: - Tầng trung. - Căn hộ 69,35m2 chia thành 2 phòng ngủ, 2 wc, 1 phòng khách, 2 ngủ đều có ánh sáng tự nhiên, 2 vệ sinh, cửa hướng Nam; ban công hướng Bắc view: Trường Trần Quốc Tuấn, đường Trần Hữu Dực kéo dài, sân bóng đá. - Trong nhà để lại điều hòa, nóng lạnh, một số đồ gỗ nóng lạnh đầy đủ, các thiết bị gắn trên tường. - Gần trường học, chợ, bệnh viện. Đi lại rất tiện. - Hàng xóm thân thiện, an ninh rất tốt, phí dịch vụ rẻ, rất phù hợp cho hộ gia đình an cư lạc nghiệp. - Đã có sổ đỏ. - Giá bán: 1.65 tỷ.          Tìm kiếm theo từ khóa :  Bán Chung Cư Bộ Tổng Tham Mưu ,  Bán căn hộ quận Nam Từ Liêm ,  Bán căn hộ tháp A Chung Cư Bộ Tổng Tham Mưu ,  Bán căn hộ gần trường Trần Quốc Tuấn quận Nam Từ Liêm               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13558800       Loại tin rao    Bán căn hộ chung cư       Ngày đăng tin    01/03/2021       Ngày hết hạn    08/03/2021       Hướng nhà    Nam       Hướng ban công    Bắc       Số phòng    2       Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    A Thuận       Địa chỉ    Cầu Giấy - Hà Nội       Điện thoại           Di động    0933339326       Email     <!-- document.write(\"&#84;&#104;&#117;&#97;&#110;&#116;&#104