{"url": "https://dothi.net/cho-thue-van-phong-duong-hai-phong-phuong-thach-thang/cho-thue-nha-nguyen-can-lam-van-phong-duong-hai-phong-quan-hai-chau-da-nang-pr13510409.htm", "code": "13510409", "title": "Cho thuê nhà nguyên căn làm văn phòng, đường Hải Phòng, quận Hải Châu, Đà Nẵng", "description": "Cho thuê nhà nguyên căn làm văn phòng, đường Hải Phòng, quận Hải Châu, Đà Nẵng      Khu vực:    Cho thuê văn phòng tại Đường Hải Phòng  - Quận Hải Châu - Đà Nẵng     Giá:   25 Triệu/tháng  Diện tích:  100 m²       Thông tin mô tả    Cho thuê nhà nguyên căn làm văn phòng, đường Hải Phòng, Quận Hải Châu, Đà Nẵng (code MPH023). -------------------------------------------------------- Cho thuê nhà nguyên căn 4 tầng (1 tầng lửng) đường Hải Phòng, trống suốt làm văn phòng. - Vị trí: Mặt tiền đường Hải Phòng, Quận Hải Châu, đoạn giữa Ông Ích Khiêm & Nguyễn Thị Minh Khai, phù hợp làm văn phòng công ty, khu vực bệnh viện Đa Khoa Đà Nẵng, bệnh viện C, tập trung nhiều Hiệu thuốc Tây, công ty vật tư thiết bị y tế, tạp hóa,.. Văn phòng công ty,.. - Diện tích: Ngang 5m * dài 20m. - Công năng: 3 tầng, 1 lửng, trống suốt, 3WC. + Tầng 1: Showroom trống suốt. + Tầng lửng: Trống suốt, WC. + Tầng 2: Trống suốt, WC (Hiện tại được ngăn làm 3 phòng, vách ngăn thạch cao có thể dễ dàng dỡ bỏ). + Tầng 3: Trống suốt, WC (Hiện tại được ngăn làm 4 phòng, vách ngăn thạch cao có thể dễ dàng dỡ bỏ). - Nhà được thiết kế cầu thang cuối nhà nên tăng diện tích sử dụng, dễ dàng phân chia vách ngăn phòng làm việc theo ý người sử dụng! - Nhà được thiết kế theo phong cách hiện đại, giếng trời tăng phần ánh sáng và thoáng khí cho cả ngôi nhà. ----------------------------------------------- Công ty TNHH KPaint Solutions (KProperty). * Add: K26/09 H06 Nguyễn Văn Huyên, P. Khuê Trung, Q. Hải Châu, Tp. Đà Nẵng. * KProperty - Đơn vị tư vấn & tìm kiếm BDS cho thuê theo yêu cầu (Văn phòng, nhà nguyên căn mặt phố, mặt bằng kinh doanh, khách sạn, tòa căn hộ.. ).          Tìm kiếm theo từ khóa :  Cho thuê văn phòng đường