{"url": "https://dothi.net/ban-nha-rieng-pho-le-van-phan-phuong-tan-quy-2/nha-ban-gap-duong-le-van-phantan-phu-50m2-lo-goc-hxtchi-co-41ty-pr13711384.htm", "code": "13711384", "title": "Nhà bán gấp đường Lê Văn Phan - Tân Phú DT thực 50m2 lô góc HXT, chỉ có 4,1 tỷ", "description": "Nhà bán gấp đường Lê Văn Phan - Tân Phú DT thực 50m2 lô góc HXT, chỉ có 4,1 tỷ      Khu vực:    Bán nhà riêng tại Phố Lê Văn Phan  - Quận Tân Phú - Hồ Chí Minh     Giá:   4.1 Tỷ  Diện tích:  47 m²       Thông tin mô tả    \"Cô - Vi đeo đuổi, chủ mệt mỏi quyết bán rẻ căn nhà đường Lê Văn Phan. + DTCN: 47m2, 2T, 1 trệt 1 lầu, 3PN - 2WC, DTSD: 94m2. + Nhà ngay lô góc, HXT 6m đậu trước công, vẫn xây thêm 2 tầng, trông sẽ đẳng cấp và giá trị tăng lên nhiều. + Hẻm thông sạch rộng lớn, an ninh tuyệt đối, dân trí cao - Nhà cao tầng. + Hạ tầng giao thông cực tôt, kết nối nhiều tuyến đường Vườn Lài - Lê Văn Phan - chợ vải Phú Thọ Hoà, luôn hoạt động ngày đêm. + Nhà sạch vào ở ngay, thuận tiện vừa ở vừa kinh doanh, hay cho thuê làm spa - Nail - Tóc, cửa hàng vải + Phụ liệu may mặc. + Sổ A4, công chứng ngay, sổ tại nhà tới nhà xem sổ. + Chỉ 4,1 tỷ mà được: Nhà lô góc - Hẻm tải vào ra - Dễ gì có nhà. + KHÁCH THÍCH MÀ CHỊU NHÍCH - THÌ CHỦ TRÍCH LỘC LIỀN. - LH xem nhà: ZALO 0868 388 798 A. Sơn sẽ tư vấn thêm, cùng hỗ trợ pháp lý hoàn toàn miễn phí. Nguồn Nhà 100 Căn, Khách Báo Thông Tin Em Rinh Nhà Tới. \".          Tìm kiếm theo từ khóa :  Bán nhà quận Tân Phú ,  Bán nhà gần chợ vải quận Tân Phú ,  Bán nhà phường Tân Quý quận Tân Phú ,  Bán nhà phố Lê Văn Phan quận Tân Phú               Hình ảnh  ()   Bản đồ                                                                       Đặc điểm bất động sản         Mã số    13711384       Loại tin rao    Bán nhà riêng       Ngày đăng tin    06/07/2021       Ngày hết hạn    20/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    6 m       Mặt tiền    3 m       Số tầng    2       Số toilet           Nội thất               