{"url": "https://dothi.net/ban-nha-rieng-duong-nguyen-van-troi-phuong-12-9/toi-chinh-chu-ban-nha-hem-xe-hoi-vip-95-nguyen-van-troi-phuong-12-trung-tam-quan-phu-nhuan-pr13536570.htm", "code": "13536570", "title": "Tôi chính chủ bán nhà hẻm xe hơi vip 95 Nguyễn Văn Trỗi, Phường 12, trung tâm quận Phú Nhuận", "description": "Tôi chính chủ bán nhà hẻm xe hơi vip 95 Nguyễn Văn Trỗi, Phường 12, trung tâm quận Phú Nhuận      Khu vực:    Bán nhà riêng tại Đường Nguyễn Văn Trỗi  - Quận Phú Nhuận - Hồ Chí Minh     Giá:   10.2 Tỷ  Diện tích:  44.8 m²       Thông tin mô tả    Nhà chính chủ hẻm vip 95 Nguyễn Văn Trỗi, P. 12, Phú Nhuận. - Giá: 10,2 tỷ (thương lượng) - 44.8m2. - Diện tích đất: 44,8m2, DTXD: 148,7m2, vuông vức trước sau như một. - Sổ hồng chính chủ, công chứng trong ngày. - Tiếp khách thiện chí, xin miễn môi giới. - Nhà 4 tầng BTCT kiên cố, trệt, 2 lầu, sân thượng. 4 phòng ngủ, 4 wc. 2 giếng trời, thông thoáng và ánh sáng tự nhiên cho tất cả các phòng. - Vị trí đắc địa: Sân bay, ga xe lửa, trường học, bệnh viện, ubnd quận, trung tâm giải trí ăn uống... Trong vòng 3 nốt nhạc. Khu dân cư trí thức, an ninh yên tĩnh, hàng xóm thân thiện, tuyệt vời cho gia đình an cư lạc nghiệp. Thực tế đẹp hơn hình chụp. Cám ơn đã xem tin. Quý khách hàng quan tâm hãy gọi ngay 0932071792 Tùng Phong.              Hình ảnh  ()   Bản đồ                           Đặc điểm bất động sản         Mã số    13536570       Loại tin rao    Bán nhà riêng       Ngày đăng tin    10/12/2020       Ngày hết hạn    10/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào           Mặt tiền           Số tầng    3       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Tùng Phong       Địa chỉ    Đường Nguyễn Văn Trỗi, phường 12, Phú Nhuận, Hồ Chí Minh       Điện thoại    0932071792       Di động    0932071792       Email     <!-- document.write(\"&#115;&#97;&#105;&#103;&#111;&#110;&#99;&#101;&#110;&#116;&#101;&#114;&#114;&#101;&#97;&