{"url": "https://dothi.net/ban-dat-phuong-thoi-hoa/toi-can-ban-gap-nha-tro-thu-nhap-17trthang-va-lo-dat-gia-re-950-trieu-pr13581778.htm", "code": "13581778", "title": "Tôi cần bán gấp lô đất giá rẻ 950 triệu/nền", "description": "Tôi cần bán gấp lô đất giá rẻ 950 triệu/nền      Khu vực:   Bán đất tại Phường Thới Hòa  - Thị xã Bến Cát - Bình Dương     Giá:   950 Triệu  Diện tích:  180 m²       Thông tin mô tả    Cần tiền tôi cần bán gấp 360m2 ngay khu công nghiệp. Miếng đất vuông vắn 360m2 (12x30m), tôi đã tách làm 2 sổ Mỗi sổ 180m2 (6x30m). Giá bán: 950 triệu (bao sang tên). Do cần tiền nên có thể thương lượng cho anh chị mua nhanh, mọi chi phí sang tên tôi chịu hết. - Liên hệ: 0903 995 824 gặp Phước Thịnh.          Tìm kiếm theo từ khóa :  Bán đất thị xã Bến Cát ,  Bán đất phường Thới Hòa thị xã Bến Cát               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13581778       Loại tin rao    Bán đất       Ngày đăng tin    19/03/2021       Ngày hết hạn    02/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Phước Thịnh       Địa chỉ           Điện thoại           Di động    0903995824       Email                 Lưu tin   In tin này", "phone": "0903995824"}
{"url": "https://dothi.net/ban-dat-duong-tu-hoang-phuong-phuong-canh/ban-dat-phan-lo-tai-duong-tu-hoang-phuong-phuong-canh-nam-tu-liem-ha-noi-gia-70-trieum2-pr13477135.htm", "code": "13477135", "title": "Bán đất phân lô tại đường Tu Hoàng, Phường Phương Canh, Nam Từ Liêm, Hà Nội giá 70 triệu/m2", "description": "Bán đất phân lô tại đường Tu Hoàng, Phường Phương Canh, Nam Từ Liêm, Hà Nội giá 70 triệu/m2      Khu vực:    Bán đất tại Đường Tu Hoàng  - Quận Nam Từ Liêm - Hà Nội     Giá:   70 Triệu/m²  Diện tích:  40 m²       Thông tin mô tả    Bán đất tái định cư mở rộng Xuân Phương gần chợ Nhổn, đường Tu Hoàng, phường Phương Canh, Quận Nam Từ Liêm, Hà Nội. Diện tích 40m2 đến 80m sổ đỏ chính chủ, đất phân lô đường 12m cả vỉa hè. Đất cách chợ Nhổn, phố kinh doanh Nhổn và đường 32 khoảng 150m, cách đại học công nghiệp 500m. Chạy ra Mỹ Đình theo đường Trần Hữu Dực kéo dài mới mở (nay là đường Trịnh Văn Bô) qua cầu vượt TASCO gần 3km. Khu tái định cư này cũng nằm sát đường 70 đã mở rộng 40m 2 làn đường nên chạy ra Đại Lộ Thăng Long, chạy đi Sơn Tây Ba Vì, di chuyển vào phố bằng xe buýt, tàu điện trên cao rất thuận tiện.  Về cơ sở hạ tầng thì đã đầy đủ điện, đường, đèn đường, nước sạch, Trường mầm non vừa khánh thành, trường liên cấp 1,2,3 quốc tế đang xây dựng.  Vậy nên đây là khu vực rất đẹp và đáng sống.  Giá bán dao động từ 60 đến 80 tr/m2 tùy theo diện tích và vị trí.  Quốc Dương 0904915075. 0973010281.  (Miễn trung gian môi giới).  Nhận ký gửi nhà đất và hỗ trợ vay ngân hàng cho khách mua.  Trân trọng kính mời!          Tìm kiếm theo từ khóa :  Bán đất Nam Từ Liêm ,  Bán đất Phương Canh Nam Từ Liêm ,  Bán đất Tu Hoàng Nam Từ Liêm ,  Bán đất gần chợ Nhổn Nam Từ Liêm ,  Bán đất gần Đại Học Công Nghiệp Nam Từ Liêm ,  Bán đất gần trường liên cấp 1.2.3 Nam Từ Liêm               Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13477135       Loại tin rao    Bán đất       Ngày đăng tin    01/07/2021       Ngày hế