{"url": "https://dothi.net/ban-nha-rieng-duong-doc-lap-phuong-phu-tho-hoa/hem-xe-tai-co-gara-o-to-nha-2-tang-dtsd-140m2-gia-chi-64-ty-pr13656705.htm", "code": "13656705", "title": "Hẻm xe tải có gara ô tô nhà 2 tầng, DTSD 140m2 giá chỉ 6.4 tỷ", "description": "Hẻm xe tải có gara ô tô nhà 2 tầng, DTSD 140m2 giá chỉ 6.4 tỷ      Khu vực:    Bán nhà riêng tại Đường Độc Lập  - Quận Tân Phú - Hồ Chí Minh     Giá:   6.4 Tỷ  Diện tích:  72 m²       Thông tin mô tả    + Chỉ 20m tới mặt tiền đường Độc Lập 10m. + Diện tích SD khủng 140m2. + Giá rẻ nhất thị trường chưa tới 80tr/m2. + 3 phòng ngủ rộng, Khu vực để xe ô tô, Phòng khách và bếp. + Hẻm rộng thênh thang, An ninh tuyệt đối. + Dể dàng kết nối với các cung đường Phú Thọ Hòa, Lũy Bán Bích, Thoại Ngọc Hầu. + Khu đường rộng thênh thang, hiếm kẹt xe. + Sổ hồng vuông đẹp, hoàn công đầy đủ.          Tìm kiếm theo từ khóa :  Bán nhà Tân Phú ,  Bán nhà Phú Thọ Hòa Tân Phú ,  Bán nhà Độc Lập Tân Phú ,  Bán nhà hẻm xe tải Độc Lập               Hình ảnh  ()   Bản đồ                                                           Đặc điểm bất động sản         Mã số    13656705       Loại tin rao    Bán nhà riêng       Ngày đăng tin    09/06/2021       Ngày hết hạn    23/06/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    5 m       Mặt tiền    4.2 m       Số tầng    2       Số toilet    2       Nội thất                 Thông tin liên hệ       Tên liên lạc    Phạm Thị Xuân       Địa chỉ    Tân Bình - Hồ Chí Minh       Điện thoại           Di động    0918002023       Email     <!-- document.write(\"&#120;&#117;&#97;&#110;&#112;&#104;&#97;&#109;&#100;&#112;&#110;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0918002023"}
{"url": "https://dothi.net/ban-nha-rieng-duong-dau-vu-phuong-van-dau/ban-nha-3-tang-khung-cot-chac-chan-dau-vu-kien-an-hai-phong-pr13694610.htm", "code": "13694610", "title": "Bán nhà 3 tầng, khung cột chắc chắn Đẩu Vũ, Kiến An, Hải Phòng", "description": "Bán nhà 3 tầng, khung cột chắc chắn Đẩu Vũ, Kiến An, Hải Phòng      Khu vực:    Bán nhà riêng tại Đường Đẩu Vũ  - Quận Kiến An - Hải Phòng     Giá:   1.25 Tỷ  Diện tích:  45 m²       Thông tin mô tả    Bán nhà 3 tầng, khung cột chắc chắn Đẩu Vũ, Kiến An, Hải Phòng. + Diện tích: 45 m2. + Chiều rộng: 5.7 m. + Hướng: Đông Nam. + Giấy tờ: Sổ hồng chính chủ. Vị trí: Nằm trên nền đất thổ vững chắc, sạch sẽ, ngõ thực tế 2,5m thẳng tắp cách đường Đẩu Vũ 60 m đất đẹp sạch sẽ k lỗi phong thủy, địa điểm gần trường học các cấp, các trung tâm mua sắm, ngân hàng rất gần chợ, UBND Phường, Bệnh viện, dân cư đông đúc, khu phố sầm uất, an ninh khu vực tốt, giao thông thuận tiện thông ra Nguyễn Lương Bằng, Trần Nhân Tông, ngã 5 Kiến An, Đồ Sơn, Kiến Thụy. Kết cấu: Móng đc làm rất chắc chắn kiên cố, nhà xây khung cột chắc chắn, vật liệu xây uy tín chất lượng, nội thất trong nhà, thiết bị vệ sinh cao cấp hiện đại, nội thất nhà bếp trang bị chính hãng, cửa cuốn, kính cường lưc cao cấp (do chính tay chủ nhà thiết kế và thi công với kinh nghiệm trên 10 năm). Cấu trúc: Nhà được thiết kế 3 tầng xây mới độc lập có sân cổng. + Tầng 1: Phòng khách, bếp, WC. + Tầng 2: 2 phòng ngủ rộng rãi, WC. + Tầng 3: Phòng thờ, phòng ngủ, sân phơi. - Tiện nghi: Điện nước, truyền hình cáp, internet đầy đủ. Giá bán: 1 tỷ 250 triệu (có thỏa thuận). Nhà đang hoàn thiện 80% (Ảnh mẫu sau khi hoàn thiện). (Có hỗ trợ ngân hàng đến 75%, thủ tục nhanh chóng, giải ngân nhanh). Liên hệ: 08666.39.799 để dẫn qua xem nhà và tham khảo 1 số sản phẩm khác.          Tìm kiếm theo từ khóa :  Bán nhà quận Kiến An ,  Bán nhà đường Đẩu Vũ quận Kiến An ,  Bán nhà gần ngã 5 Kiến An quận Kiến An ,  Bán nhà phường Văn Đẩu quận Kiến An               Hình ảnh  ()   Bản đồ              