{"url": "https://dothi.net/ban-nha-rieng-pho-doc-ngu-phuong-ngoc-khanh/chinh-chu-ban-nha-rieng-325m2-ngo-33-doc-ngu-ba-dinh-pr13469188.htm", "code": "13469188", "title": "Chính chủ bán nhà riêng 32.5m2 ngõ 33 Đốc Ngữ - Ba Đình", "description": "Chính chủ bán nhà riêng 32.5m2 ngõ 33 Đốc Ngữ - Ba Đình      Khu vực:    Bán nhà riêng tại Phố Đốc Ngữ  - Quận Ba Đình - Hà Nội     Giá:   4.3 Tỷ  Diện tích:  32.5 m²       Thông tin mô tả    Chính chủ bán nhà riêng 32.5m2 ngõ 33 Đốc Ngữ - Ba Đình, nhà hướng Đông Nam, diện tích 32.5m2, xây 4.5 tầng mặt tiền 3.5m. Nhà ngõ 33 Đốc Ngữ xây 4.5 tầng khung bê tông chắc chắn, cầu thang giữa nhà nên mỗi tầng được chia thành 2 buồng. Chủ mới mua về phủ 1 lớp áo mới là long lanh như hoa hậu. Nhà ngõ 33 Đốc Ngữ bố trí từ tầng 2 - 4 thiết kế xây dựng các phòng theo kiểu lệch có nhằm tạo cho các phòng đều có gió và không nhìn thẳng sang nhau. Đường trước nhà xe máy và xe ba bánh tránh nhau thoải mái. Oto đỗ cách nhà 30m. - Tầng 1: Để xe - phòng khách - WC. - Tầng 2 & 3: Mỗi tầng 2 phòng ngủ - WC. - Tầng 4: Phòng thờ - phòng ăn. - Tầng tum: Sân phơi - bể nước. Nhà ngõ 33 Đốc Ngữ nằm trong khu vực trung tâm giao thông của quận Ba Đình, an ninh tốt, dân trí cao rất thuận lợi trong cuộc sống và công việc. 20p ra sân bay. 3p đến bệnh viện. 5p đến các trường trong khu vực. Nhà ngõ 33 Đốc Ngữ có sổ đỏ chính chủ. Giá bán 4,3 tỷ. LH: 0989.03.53.83.          Tìm kiếm theo từ khóa :  Bán nhà quận Ba Đình ,  Bán nhà phường Ngọc Khánh quận Ba Đình ,  Bán nhà ngõ 33 phố Đốc Ngữ ,  Bán nhà phố Đốc Ngữ quận Ba Đình               Hình ảnh  ()   Bản đồ                                                                           Đặc điểm bất động sản         Mã số    13469188       Loại tin rao    Bán nhà riêng       Ngày đăng tin    05/07/2021       Ngày hết hạn    19/07/2021       Hướng nhà    Đông-Nam       Hướng ban công           Số phòng    4       Đường vào    3 m       Mặt tiền    3.5 m       Số tầng    5       Số toilet    3       Nội thất        