{"url": "https://dothi.net/ban-nha-rieng-duong-tan-huong-phuong-tan-quy-2/ban-nha-hxh-1-doi-chu-lau-doi-chua-qua-dau-tu-gan-duong-tan-huong-tan-phu-pr13588276.htm", "code": "13588276", "title": "Bán nhà HXH 1 đời chủ lâu đời, chưa qua đầu tư gần đường Tân Hương, Tân Phú", "description": "Bán nhà HXH 1 đời chủ lâu đời, chưa qua đầu tư gần đường Tân Hương, Tân Phú      Khu vực:    Bán nhà riêng tại Đường Tân Hương  - Quận Tân Phú - Hồ Chí Minh     Giá:   3.5 Tỷ  Diện tích:  45 m²       Thông tin mô tả    Môi giới bất động sản chuyên nghiệp khu vực Tân Phú, phân 3 tỷ - 6 tỷ. Tư vấn và xem nhà miễn phí. SĐT và Zalo: 0988107978. Website: phosaigon.vn Bán nhà HXH một đời chủ, chưa qua đầu tư gần đường Tân Hương, Tân Qúy, Quận Tân Phú. Nhà 1 đời chủ lâu năm, chưa qua đầu tư, sơn sửa lại đẹp lung linh, giá hẻm xe hơi 6m rẻ nhất Quận Tân PHú, Kết cấu 1 trệt 1 lầu, 1 sân thượng, 45m2, hẻm xe hơi, giá chỉ 3 tỷ 5, gần chợ Tân Hương, hẻm thông tứ phía, khu dân trí, an ninh, yên tĩnh, hàng xóm thân thiện.          Tìm kiếm theo từ khóa :  Bán nhà quận Tân Phú ,  Bán nhà gần chợ Tân Hương quận Tân Phú ,  Bán nhà hxh 1 đường Tân Hương ,  Bán nhà phường Tân Quý quận Tân Phú ,  Bán nhà đường Tân Hương quận Tân Phú               Hình ảnh  ()   Bản đồ                                                           Đặc điểm bất động sản         Mã số    13588276       Loại tin rao    Bán nhà riêng       Ngày đăng tin    25/03/2021       Ngày hết hạn    08/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    6 m       Mặt tiền    3.8 m       Số tầng    2       Số toilet    2       Nội thất                 Thông tin liên hệ       Tên liên lạc    Bán Nhà HXH Gần Đường Tân Hương , Tân Qúy , Quận Tân Phú , Giá Hơn 3 Tỷ.       Địa chỉ    Tân Hương, Tân Quý, Tân Phú, Hồ Chí Minh, -Dự án-       Điện thoại           Di động    0988107978       Email     <!-- document.write(\"&#108;&#117;&#99;&#104;&#97;&#109;&#99;&#104;&#105;&#49;&#52;&#49;&#50;&#64;&#103;&#10