{"url": "https://dothi.net/cho-thue-nha-tro-phong-tro-duong-lac-long-quan-phuong-buoi/phong-tro-full-do-tai-lac-long-quan-tay-ho-pr13666518.htm", "code": "13666518", "title": "Phòng trọ full đồ tại Lạc Long Quân, Tây Hồ", "description": "Phòng trọ full đồ tại Lạc Long Quân, Tây Hồ      Khu vực:    Cho thuê nhà trọ, phòng trọ tại Đường Lạc Long Quân  - Quận Tây Hồ - Hà Nội     Giá:   2.7 Triệu/tháng  Diện tích:  Không xác định       Thông tin mô tả    Phòng trọ full đồ giá rẻ tại Hồ Tây. - Địa chỉ: 58 ngõ 259 Trích Sài, Tây Hồ, Hn. (Hoặc ngõ 282 Lạc Long Quân. - Nội thất: Giường, tủ quần áo, điều hoà, nóng lạnh, bàn trang điểm, máy giặt chung, bếp nấu ăn... - Phòng tầng 3, 10 bước chân ra hồ, view đẹp, thoáng mát, có chỗ để xe. Gần các đường Văn Cao, Thụy Khuê, Trích Sài, Nguyễn Đình Thi, Lạc Long Quân, Võng Thị... - Giá 2tr7/th. Vệ sinh chung với 1 bạn nữ phòng đối diện, nhà vệ sinh có người dọn dẹp free hàng tuần nên rất sạch sẽ. - Giờ giấc tự do, không chung chủ. Lh chính chủ. Phòng như ảnh.          Tìm kiếm theo từ khóa :  Cho thuê phòng trọ đường Lạc Long Quân quận Tây Hồ ,  Cho thuê phòng trọ quận Tây Hồ ,  Cho thuê phòng trọ phường Bưởi quận Tây Hồ ,  Cho thuê phòng trọ gần Hồ Tây quận Tây Hồ ,  Cho thuê phòng trọ ngõ 282 đường Lạc Long Quân               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13666518       Loại tin rao    Cho thuê nhà trọ, phòng trọ       Ngày đăng tin    20/06/2021       Ngày hết hạn    04/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Xuân Hiệp       Địa chỉ           Điện thoại           Di động    0354329898       Email     <!-- document.write(\"&#120;&#117;&#97;&#110;&#104;&#105;&#101;&#112;&#46;&#98;&#100;&#115;&#57;&#49;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;