{"url": "https://dothi.net/cho-thue-cua-hang-ki-ot-d-le-roi-soleil-quang-an/cho-thue-mat-bang-thuong-mai-du-an-d-le-roi-soleil-quang-an-tay-ho-lh-0986510510-pr11398272.htm", "code": "11398272", "title": "Cho thuê mặt bằng thương mại dự án D'. Le Roi Soleil Quảng An, Tây Hồ. LH 0986510510", "description": "Cho thuê mặt bằng thương mại dự án D'. Le Roi Soleil Quảng An, Tây Hồ. LH 0986510510      Khu vực:    Cho thuê cửa hàng, ki ốt tại D’. Le Roi Soleil - Quảng An  - Quận Tây Hồ - Hà Nội     Giá:   250 Nghìn/m²/tháng  Diện tích:  250 m²       Thông tin mô tả    Cho thuê mặt bằng kinh doanh, thương mại dự án D'. Le Roi Soleil Quảng An, Tây Hồ.  Hotline CĐT: 0986.510.510.  Ưu tiên các ngành hàng Kinh doanh thương mại: F&B, siêu thị, cửa hàng tiện ích, giáo dục, nội thất, TT giải trí, gym, spa clinic, bể bơi.  Giá thuê: Từ 250 nghìn/m2/tháng (trực tiếp từ CĐT Tân Hoàng Minh) phụ thuộc vào vị trí và diện tích thuê.  Diện tích: Từ 50 m2 - 3000 m2 từ tầng hầm B2 đến tầng 9 (cắt linh hoạt).  * Tên dự án: Tổ hợp căn hộ chung cư & trung tâm thương mại D Le Roi Soliel.  - Vị trí: Nằm trên ngã ba Đặng Thai Mai và Xuân Diệu - ngay sát Hồ Tây, nhìn ra Sông Hồng, 30 phút đến sân bay quốc tế Nội Bài.    * Chi tiết tòa nhà:    - Tổng diện tích đất: 10.000 m2.    - Mật độ xây dựng: 44%.    - Tổng số 498 căn hộ.    - 2 tòa tháp căn hộ 25 tầng sang trọng và tòa tháp dịch vụ 8 tầng tiện ích chuẩn 5*.    - 5,5 tầng hầm để xe tiêu chuẩn.    - Dự án đang đi vào hoàn thiện mặt ngoài. Dự kiến khai trương TTTM T10/2018.    - Hệ thống thang máy, thang cuốn hiện đại, tốc độ cao.    - Điều hòa trung tâm.    - Hệ thống kính 2 lớp thân thiện với môi trường, tiết kiệm năng lượng.    - Máy phát điện dự phòng đảm bảo nguồn điện ổn định 24/24 cho toàn bộ tòa nhà.    - Hệ thống PCCC đạt tiêu chuẩn quốc tế.    - Hệ thống quản lý tòa nhà IBMS.    * Cộng đồng cư dân:    - Cộng đồng cư dân đẳng cấp: Các chính khách trong và ngoài nước, giới thượng lưu, các nhà ngoại giao, doanh nhân, Việt Kiều..    - Nằm trong khu vực tập trung nhiều trung tâm tài chính, thương mại, ngân hàng, dịch vụ quốc tế..    - Đây là khu vực có giá cho thuê cao nhất và công suất thuê cao nhất Hà Nội.    * Quý khách có nhu cầu thuê xin vui lòng liên hệ:    Phòng cho thuê chủ đầu tư Tân Hoàng Minh: 0986.510.510.    Tầng 2, 24 Quang Trung, Hoàn Kiếm, Hà Nội.    Trân trọng cảm ơn vì đã xem tin!          Tìm kiếm theo từ khóa :  Cho thuê cửa hàng quận Tây Hồ ,  Cho thuê cửa hàng gần Sông Hồng quận Tây Hồ ,  Cho thuê cửa hàng gần trung tâm thương mại D Le Roi quận Tây Hồ ,  Cho thuê cửa hàng gần Hồ Tây quận Tây Hồ               Hình ảnh  ()   Bản đồ                                                           Đặc điểm bất động sản         Mã số    11398272       Loại tin rao    Cho thuê cửa hàng, ki ốt       Ngày đăng tin    17/04/2021       Ngày hết hạn    01/05/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Phạm Văn Dũng       Địa chỉ    Thanh Xuân - Hà Nội       Điện thoại    0986510510       Di động    0986510510       Email     <!-- document.write(\"&#100;&#117;&#110;&#103;&#46;&#100;&#120;&#109;&#98;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0986510510"}
{"url": "https://dothi.net/cho-thue-van-phong-duong-tran-hung-dao-49/van-phong-cho-thue-duong-tran-hung-dao-dien-tich-58m2-115m2-lh-hotline-0982099920-pr13077602.htm", "code": "13077602", "title": "Văn phòng cho thuê đường Trần Hưng Đạo, diện tích 58m2, 115m2, LH hotline: 098.20.999.20", "description": "Văn phòng cho thuê đường Trần Hưng Đạo, diện tích 58m2, 115m2, LH hotline: 098.20.999.20      Khu vực:    Cho thuê văn phòng tại Đường Trần Hưng Đạo  - Quận Sơn Trà - Đà Nẵng     Giá:   Thỏa thuận  Diện tích:  58 m²       Thông tin mô tả    Chúng tôi đang cần cho thuê văn phòng đường Trần Hưng Đạo, vị trí trung tâm thành phố, đẹp, là nơi đặt trụ sở của nhiều công ty với nhiều lĩnh vực khác nhau. Rất thích hợp với các công ty chuyên về logistics và thủy hải sản.    - Diện tích cho thuê đang trống: 58m2, 115m2  - Giá thuê tham khảo: Chỉ từ 230.000 VNĐ/m2/tháng  - Giá trên đã bao gồm phí dịch vụ nhưng chưa bao gồm VAT + tiền điện sử dụng (tiền điện được tính theo đồng hồ riêng)  - Hình thức thanh toán tham khảo: Cọc 03 tháng và thanh toán 03 tháng/lần  - Tòa nhà được thiết kế chuẩn văn phòng cho thuê    Để biết thêm thông tin và hướng dẫn đi xem văn phòng, vui lòng liên hệ hotline: 098.20.999.20    Truy cập website: https://thuenhanhhon.com để xem thêm nhiều văn phòng cho thuê phù hợp với nhu cầu của quý khách hàng.          Tìm kiếm theo từ khóa :  Cho thuê văn phòng Sơn Trà ,  Cho thuê văn phòng Trần Hưng Đạo Sơn Trà               Hình ảnh  ()   Bản đồ                                                                   Đặc điểm bất động sản         Mã số    13077602       Loại tin rao    Cho thuê văn phòng       Ngày đăng tin    29/06/2021       Ngày hết hạn    29/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Công Ty TNHH TM & DV Cho Thuê Nhanh Hơn        Địa chỉ    Thanh Khê - Đà Nẵng       Điện