{"url": "https://dothi.net/ban-dat-duong-vo-van-kiet-phuong-phuoc-my/dat-duong-vo-van-kiet-dien-tich-lon-dat-o-do-thi-xay-cao-tang-khach-san-can-ho-rat-dep-pr13535395.htm", "code": "13535395", "title": "Đất đường Võ Văn Kiệt, Diện tích lớn, đất ở đô thị, xây cao tầng, khách sạn, Căn Hộ rất đẹp.", "description": "Đất đường Võ Văn Kiệt, Diện tích lớn, đất ở đô thị, xây cao tầng, khách sạn, Căn Hộ rất đẹp.      Khu vực:    Bán đất tại Đường Võ Văn Kiệt  - Quận Sơn Trà - Đà Nẵng     Giá:   200 Triệu/m²  Diện tích:  2013.5 m²       Thông tin mô tả    Vị trí đất vàng 3 mặt tiền đường Võ Văn Kiệt, Phường Phước Mỹ, Quận Sơn Trà, TP. Đà Nẵng. - Diện tích: 2013,5m2. Ngang 35m. Hướng Đông Nam. Đường Võ Văn Kiệt, 2 làn đường rộng 15m, lề 6m. - Mặt tiền đường Võ Văn kiệt, 1 trong những con đường đẹp nhất Đà Nẵng. Trục đường chính từ Sân bay ra thẳng biển, khi đi ngang qua Cầu Rồng (1 trong những cây cầu đẹp nhất Đà Nẵng). - Vị trí siêu đẹp, cách bãi tắm số 1 Phạm Văn Đồng 200m, ngay sát công viên Biển Đông Đà Nẵng. - Khu tập trung kinh doanh rất nhiều khách sạn, căn hộ condotel và nhà hàng cao cấp nhất Đà Nẵng. - Công viên Biển Đông là sân khấu ngoài trời, nơi thường xuyên tổ chức những ngày hội và các hoạt động Văn hóa du lịch biển lớn nhất Đà Nẵng, - Điểm đến cuối để khách du lịch ngắm biển đêm, thưởng thức hải sản biển Đà Nẵng và cũng là nơi chào đón những tia nắng bình minh đầu tiên mỗi sớm mai trên bãi biển đẹp nhất hành tinh. - Đất có giá trị sinh lợi rất cao, có thể kinh doanh khách sạn, nhà hàng, dịch vụ du lịch... - Là đất ở tại đô thị, được phép xây cao tầng, có sổ đỏ chính chủ, thủ tục mua bán nhanh, bán đến công chứng. Xây dựng và kinh doanh được ngay. Liên hệ: 0935.707.998 (Zalo, Viber) hoặc 0914.72.60.69để biết thêm thông tin và xem đất. Trân trọng!              Hình ảnh  ()   Bản đồ                                               Đặc điểm bất động sản         Mã số    13535395       Loại tin rao    Bán đất       Ngày đăng tin    01/12/2020       Ngày hết hạn    01/0