{"url": "https://dothi.net/ban-nha-rieng-duong-nguyen-duc-canh-phuong-tuong-mai/nha-mat-ngo-o-to-pho-nguyen-duc-canh-qhm-5-tang-122-ty-pr13652411.htm", "code": "13652411", "title": "Nhà mặt ngõ ô tô, phố Nguyễn Đức Cảnh (Q. HM), 5 tầng, 12.2 tỷ", "description": "Nhà mặt ngõ ô tô, phố Nguyễn Đức Cảnh (Q. HM), 5 tầng, 12.2 tỷ      Khu vực:    Bán nhà riêng tại Đường Nguyễn Đức Cảnh  - Quận Hoàng Mai - Hà Nội     Giá:   12.2 Tỷ  Diện tích:  81 m²       Thông tin mô tả    Nhà mặt ngõ ô tô, phố Nguyễn Đức Cảnh (quận Hoàng Mai), diện tích 81m2 x 5 tầng, mặt tiền 4.4m, giá 12,2 tỷ VNĐ. + Vị trí: Rất đẹp, khu vực sầm uất, dân cư đông đúc, an ninh tốt, thuận tiện kinh doanh. + Từ nhà, vài chục bước chân là Công viên Hoàng Văn Thụ, đường Lương Khánh Thiện; cũng rất gần đường Trương Định (thuộc trục hướng tâm: Trương Định Bạch Mai phố Huế - Hàng Bài hồ Hoàn Kiếm). Rất gần các ĐH lớn: ĐH Kinh tế quốc dân, ĐH Xây dựng, ĐH Bách khoa Ở hướng khác, rất gần Hồ điều hòa Đền Lừ, đường đôi Tân Mai mới mở; 5 - 7 phút xe ô tô là KĐT Times City, bệnh viện quốc tế Vinmec, cầu Vĩnh Tuy vượt sông Hồng. + Nhà xây 5 tầng, còn rất mới, chủ đang kinh doanh, khách mua có thể tiếp tục kinh doanh ngay: - Tầng 1: Quán café, quầy bar, bếp, WC. - Tầng 2: Có 1 phòng café (hoặc phòng khách), 1 phòng ngủ, WC. - Tầng 3: Phòng thờ rộng, 1 phòng ngủ, WC. - Tầng 4: Có 1 phòng ngủ, 1 phòng rộng (chưa sử dụng), WC. - Tầng 5 và nóc tầng 5: Dự tính làm cafe rooftop (hoặc karaoke), WC. + Sổ đỏ chính chủ, nở hậu, sẵn sàng giao dịch. + Liên hệ (Để xem nhà và gặp trực tiếp chủ nhà): Mr Oánh Chu, 0903200922 (miễn thêm trung gian).          Tìm kiếm theo từ khóa :  Bán nhà gần đại học Kinh Tế Quốc Dân quận Hoàng Mai ,  Bán nhà đường Nguyễn Đức Cảnh quận Hoàng Mai ,  Bán nhà phường Tương Mai quận Hoàng Mai ,  Bán nhà quận Hoàng Mai ,  Bán nhà gần Hồ Hoàn Kiếm quận Hoàng Mai ,  Bán nhà gần công viên Hoàng Văn Thụ quận Hoàng Mai               Hình ảnh  ()   Bản đồ                                                        