{"url": "https://dothi.net/ban-nha-rieng-duong-nguyen-chinh-phuong-tan-mai-2/-ban-nha-dep-nguyen-chinh-dt35m2x5t-mt33m-gia-25-ty3-gac-tranh-pr13554781.htm", "code": "13554781", "title": "(Bán nhà đẹp) Nguyễn Chính, DT 35m2x5T, MT 3.3m giá 2.5 tỷ. (3 gác tránh)", "description": "(Bán nhà đẹp) Nguyễn Chính, DT 35m2x5T, MT 3.3m giá 2.5 tỷ. (3 gác tránh)      Khu vực:    Bán nhà riêng tại Đường Nguyễn Chính  - Quận Hoàng Mai - Hà Nội     Giá:   2.5 Tỷ  Diện tích:  35 m²       Thông tin mô tả    Vị trí nhà siêu đẹp, cách ô tô 30m, 3 gác tránh. Khu dân trí cao. Nhà đẹp, mới, thoáng mát, chủ xây để ở vô cùng tâm huyết chắc chắn. Mỗi tầng gồm 2 phòng ngủ. Đầy đủ công năng, ban công, ánh sang tràn ngập. Sổ đỏ nở hậu, sẵn sang giao dịch. Chủ thiện chí bán, có thương lượng. Miễn phí 100% với khách mua, về dẫn đi xem nhà và kể cả giao dịch thành công, bên mua không mất phí, được tư vấn hỗ trợ. Pháp lý, hợp đồng, sổ đỏ 24/24h. (Lưu ý: Khách chủ tự thương lượng giá).          Tìm kiếm theo từ khóa :  Bán nhà quận Hoàng Mai ,  Bán nhà đường Nguyễn Chính quận Hoàng Mai ,  Bán nhà phường Tân Mai quận Hoàng Mai               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13554781       Loại tin rao    Bán nhà riêng       Ngày đăng tin    25/02/2021       Ngày hết hạn    25/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng    5       Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Vũ Minh Hiếu       Địa chỉ           Điện thoại           Di động    0345613888       Email     <!-- document.write(\"&#104;&#105;&#101;&#117;&#48;&#56;&#54;&#56;&#56;&#54;&#55;&#56;&#57;&#56;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0345613888"}
