{"url": "https://dothi.net/ban-nha-rieng-duong-vu-trong-phung-5/vu-trong-phung-thanh-xuan-47m-6-tang-o-to-tranh-tranh-106-ty-pr13525796.htm", "code": "13525796", "title": "Bán nhà Vũ Trọng Phụng, Thanh Xuân 47m2 x 6 tầng ô tô tránh tránh 10.6 tỷ", "description": "Bán nhà Vũ Trọng Phụng, Thanh Xuân 47m2 x 6 tầng ô tô tránh tránh 10.6 tỷ      Khu vực:    Bán nhà riêng tại Đường Vũ Trọng Phụng  - Quận Thanh Xuân - Hà Nội     Giá:   10.6 Tỷ  Diện tích:  47 m²       Thông tin mô tả    Bán nhà Vũ Trọng Phụng, Thanh Xuân 47m2 x 6 tầng ô tô tránh tránh 10.6 tỷ. - Nhà nằm tại vị trí đắc địa, trung tâm quận Thanh Xuân. - Ô tô tránh, vỉa hè hai bên. - Hiện chủ đang kinh doanh nhà nghỉ doanh thu 60 triệu/tháng. - Nhà thiết kế hiện đại, xây chắc chắn, nội thất đẹp. - Hiện 8 phòng ngủ, vệ sinh, đầy đủ công năng và thiết bị gắn tường. - Sổ đỏ đẹp, vuông vắn. - Tầng 1: Gara ô tô (kinh doanh), lễ tân, vệ sinh. - Tầng 2,3,4,5: Mỗi tầng 2 phòng vệ sinh. Tổng 8 phòng. - Tầng 6 tum: Phòng ngủ cho người làm việc, sân phơi.              Hình ảnh  ()   Bản đồ                                               Đặc điểm bất động sản         Mã số    13525796       Loại tin rao    Bán nhà riêng       Ngày đăng tin    04/12/2020       Ngày hết hạn    04/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    8       Đường vào           Mặt tiền    4.6 m       Số tầng    6       Số toilet    8       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Văn Hưng        Địa chỉ    Đường Vũ Trọng Phụng, Thanh Xuân, Hà Nội       Điện thoại    0984296345       Di động    0984296345       Email     <!-- document.write(\"&#84;&#117;&#97;&#110;&#104;&#117;&#110;&#103;&#56;&#56;&#104;&#116;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0984296345"}
