{"url": "https://dothi.net/ban-nha-rieng-pho-quan-nhan-phuong-nhan-chinh/nha-quan-nhan-royal-city-ngo-rong-dep-37m2-4pn-gia-37-ty-huong-dong-nam-pr13622742.htm", "code": "13622742", "title": "Nhà Quan Nhân, Royal City ngõ rộng đẹp, 37m2 - 4PN - Giá 3.7 tỷ. Hướng Đông Nam", "description": "Nhà Quan Nhân, Royal City ngõ rộng đẹp, 37m2 - 4PN - Giá 3.7 tỷ. Hướng Đông Nam      Khu vực:    Bán nhà riêng tại Phố Quan Nhân  - Quận Thanh Xuân - Hà Nội     Giá:   3.7 Tỷ  Diện tích:  37 m²       Thông tin mô tả    - Nhà ngay trung tâm Hà Nội, phố Quan Nhân, gần ngay Royal City, Ngã Tư Sở. - Nhà trong ngõ nhưng gần đường ô tô, ngõ trước nhà ba gác phi ầm ầm. - Quan Nhân là khu phố vip, đi đâu cũng thuận tiện như ra ngã Tư Sở, Trung Hòa Nhân Chính, đường Vành Đai 3, vào khu trung tâm như Nguyễn Chí Thanh, Huỳnh Thúc Kháng cũng chỉ mất 5 phút. - Xung Quanh nhà đầy đủ tiện ích như chợ dân sinh, chợ đầu mối, siêu thị Vinmart.. Hệ thống trường học từ cấp 1 đến cấp 3, các trường Song Ngư, quốc tế nổi tiếng tại Hà Nội. - Thiết kế nhà hiện đại. - Diện tích trên sổ là 37m2. Mặt tiền 3.4m. - Tầng 1: Chỗ để xe + phòng khách + bếp + vệ sinh. - Tầng 2: 2 phòng ngủ + phòng VS. - Tầng 3: 2 phòng ngủ + phòng VS. - Tầng 4: Phòng thờ + sân phơi + vườn. - Sổ đỏ chính chủ thuận tiện giao dịch. Chủ nhà chào giá 3.7 tỷ (Có thương lượng) (nhà là ảnh thật, ngõ thật). - Trăm nghe không bằng một thấy khuyến khích anh/chị đi xem nhà. - Gọi hay inbox 24/24h để được tư vấn và xem nhà miễn phí. (Hỗ trợ zalo, viber, facebook). - SĐT 0865277984. - Miễn các bạn trung gian.          Tìm kiếm theo từ khóa :  Bán nhà Thanh Xuân ,  Bán nhà Nhân Chính Thanh Xuân ,  Bán nhà Quan Nhân Thanh Xuân ,  Bán nhà gần siêu thị Vinmart Thanh Xuân ,  Bán nhà gần chợ đầu mối Thanh Xuân               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    13622742       Loại tin rao    Bán nhà riêng       Ngày đăng tin    14/06/2021       Ng