{"url": "https://dothi.net/ban-nha-rieng-pho-quan-nhan-phuong-nhan-chinh/gap-quan-nhan-thanh-xuan-38m2-x-5t-315-ty-ngo-oto-lo-goc-0966979305-pr13615452.htm", "code": "13615452", "title": "Gấp! Quan Nhân, Thanh Xuân, 38m2 x 5T, 3.15 tỷ ngõ ôtô lô góc 0966979305", "description": "Gấp! Quan Nhân, Thanh Xuân, 38m2 x 5T, 3.15 tỷ ngõ ôtô lô góc 0966979305      Khu vực:    Bán nhà riêng tại Phố Quan Nhân  - Quận Thanh Xuân - Hà Nội     Giá:   3.15 Tỷ  Diện tích:  38 m²       Thông tin mô tả    Do thăng tiến trong công việc, được lên quản lý tại khu vực khác, nên có nhu cầu bán gấp. Lâm 096979305. Mô tả: - Căn nhà ngõ Quan Nhân rất rất có lộc, chỉ tầm 10 - 15m ra phố. An ninh thì cực tốt, taxi rất dễ tiếp cận, ra vào thoải mái. - Thiết kế mỗi tầng làm hẳn 1 phòng ngủ rộng, tổng cộng có tới 3 phòng ngủ với đầy đủ mọi công năng sử dụng. - Diện tích rộng tận 38m2 với mặt tiền lên tới 5.5m và cao tận 5 tầng. Bao gồm: + Tầng 1: Phòng khách khang trang. Bếp rộng thoáng. Vệ sinh. + Tầng 2 + 3 + 4: Mỗi tầng 1 phòng ngủ rộng, sáng thoáng. Vệ sinh. + Tầng 5: Phòng kho (có thể làm ngủ nhỏ). Phòng thờ. Sân phơi. - Sổ đỏ pháp lý đầy đủ, sẵn sàng giao dịch. - Giá 3.15 tỷ có thương lượng cho khách thiện chí. - Liên hệ Lâm 0966979305 (có zalo).          Tìm kiếm theo từ khóa :  Bán nhà Quận Thanh Xuân ,  Bán nhà phường Nhân Chính quận Thanh Xuân ,  Bán nhà phố Quan Nhân quận Thanh Xuân               Hình ảnh  ()   Bản đồ                                                       Đặc điểm bất động sản         Mã số    13615452       Loại tin rao    Bán nhà riêng       Ngày đăng tin    16/04/2021       Ngày hết hạn    30/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    5 m       Mặt tiền    5.5 m       Số tầng    5       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Đức Lâm       Địa chỉ    Quan Nhân, Nhân Chính, Thanh Xuân, Hà Nội       Điện thoại    0966979305       Di động    0966979305       Email  