{"url": "https://dothi.net/ban-nha-rieng-duong-thong-nhat-phuong-thanh-xuan/nha-dep-o-ngay-dt-60m2-duong-8m-cach-cho-200m-dan-cu-van-minh-pr13699491.htm", "code": "13699491", "title": "Nhà đẹp ở ngay, DT 60m2, đường 12m. Cách chợ 200m, dân cư văn minh", "description": "Nhà đẹp ở ngay, DT 60m2, đường 12m. Cách chợ 200m, dân cư văn minh      Khu vực:    Bán nhà riêng tại Đường Thống Nhất  - Quận 12 - Hồ Chí Minh     Giá:   4.9 Tỷ  Diện tích:  60 m²       Thông tin mô tả    Vị trí thuận lợi: Thống Nhất - Tô Ngọc Vân thuận tiện di chuyển trung tâm. - Nhà được thiết kế rất tâm huyết với đầy đủ công năng trong nhà. - Kết cấu: 1 trệt 3 lầu, 4 phòng ngủ, 5wc, 1 phòng bếp, 2 phòng khách, phòng thờ, sân phơi, giếng trời, cây xanh thoáng mát xung quanh... 4 Phòng ngủ lớn có toilet trong phòng tạo không gian cá nhân riêng cho mỗi thành viên trong gia đình. - Diện tích SD: 250m2. - Đường trước nhà rộng 12m, ô tô ra vào thoải mái. - Nhà mới phong thủy tốt, thích hợp gia đình định cư hoặc cho thuê. Nhà gần Khu vực gần công an phường an ninh tốt, đông dân cư, dân trí cao, liền kề nhà phố, biệt thự sang trọng. Gần các trường mầm non, cấp 1, 2, 3. Trường chuẩn quốc gia các cấp, chung cư, siêu thị, nhà thờ, bar, thẩm mỹ viện sapa, phòng khám đa khoa... - Pháp lý sổ hồng riêng sang tên ngay. - Giá: 4,9 tỷ/căn ngân hàng hỗ trợ 70%. - Bớt lộc cho khách hàng thanh toán nhanh. Nếu anh, chị cần thêm thông tin có thể nhắn tin, để lại câu hỏi, liên hệ ngay: 0933.33.86.55 Hoàng.              Hình ảnh  ()   Bản đồ                           Đặc điểm bất động sản         Mã số    13699491       Loại tin rao    Bán nhà riêng       Ngày đăng tin    18/06/2021       Ngày hết hạn    18/09/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào    12 m       Mặt tiền           Số tầng    4       Số toilet    5       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyenhuyhoang       Địa chỉ    Đường Thống Nhất, phường Thạnh Xuân, Quận 12, Hồ Chí Minh