{"url": "https://dothi.net/ban-nha-rieng-pho-pham-huy-thong-phuong-ngoc-khanh/ban-nha-pham-huy-thong-ba-dinh-50m-6-tang-76-ty-pr13602481.htm", "code": "13602481", "title": "Bán nhà Phạm Huy Thông Ba Đình 50m2, 6 tầng, 7,6 tỷ", "description": "Bán nhà Phạm Huy Thông Ba Đình 50m2, 6 tầng, 7,6 tỷ      Khu vực:    Bán nhà riêng tại Phố Phạm Huy Thông  - Quận Ba Đình - Hà Nội     Giá:   7.6 Tỷ  Diện tích:  50 m²       Thông tin mô tả    - Nhà dân tự xây được khoảng vài năm, còn rất mới, Khung cột rất chắc chắn. 2 mặt thoáng vĩnh viễn. Có ô chờ lắp thang máy. - Mặt ngõ thông, 2 ô tô tránh nhau, chạy vòng quanh, cách mặt phố Phạm Huy Thông khoảng 50m. - Vị trí trung tâm, đông dân cư. Phù hợp khách mua để ở, cho thuê kết hợp KD spa, VP. - Trước đây chủ cho thuê 25 triệu/tháng để làm spa. + Tầng 1: Để xe ô tô, phòng khách bếp WC. + Tầng 2: 1 phòng + P xông hơi, WC. + Tầng 3,4: mỗi tầng 2 ngủ + WC. + Tầng 5: Phòng thờ + ban công. + Tầng 6: Sân thượng làm tiểu cảnh. Sổ vuông đẹp giá 7.6 tỷ (có thương lượng). Liên hệ xem nhà 24/24: 0977 514 508.          Tìm kiếm theo từ khóa :  Bán nhà phường Ngọc Khánh quận Ba Đình ,  Bán nhà phố Phạm Huy Thông quận Ba Đình ,  Bán nhà quận Ba Đình               Hình ảnh  ()   Bản đồ                                                           Đặc điểm bất động sản         Mã số    13602481       Loại tin rao    Bán nhà riêng       Ngày đăng tin    06/04/2021       Ngày hết hạn    20/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    5       Đường vào    6 m       Mặt tiền    4 m       Số tầng    6       Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Mrs Tú       Địa chỉ    Phạm Huy Thông - Ngọc Khánh - Ba Đình       Điện thoại    0977514508       Di động    0977514508       Email     <!-- document.write(\"&#99;&#104;&#97;&#117;&#116;&#104;&#105;&#116;&#117;&#48;&#55;&#49;&#57;&#56;&#51;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo v