{"url": "https://dothi.net/ban-nha-rieng-pho-pham-huy-thong-phuong-ngoc-khanh/-ban-nha-dep-o-ngay-view-ho-ngoc-khanh-ba-dinh-lo-goc-gia-68-ty-co-tl-0903292458-pr13702532.htm", "code": "13702532", "title": "Bán nhà đẹp ở ngay, view hồ Ngọc Khánh, Ba Đình, lô góc. Giá 6,8 tỷ (có TL) 0903.292.458", "description": "Bán nhà đẹp ở ngay, view hồ Ngọc Khánh, Ba Đình, lô góc. Giá 6,8 tỷ (có TL) 0903.292.458      Khu vực:    Bán nhà riêng tại Phố Phạm Huy Thông  - Quận Ba Đình - Hà Nội     Giá:   6.8 Tỷ  Diện tích:  48 m²       Thông tin mô tả    Cần bán nhà 5 tầng phố Phan Huy Thông, Ba Đình, vị trí đẹp. Lý tưởng, view hồ Ngọc Khánh, cách 1 nhà ra mặt đường, khu an ninh tốt, dân trí cao, hàng xóm thân thiện, thành đạt. Nhà có thể vừa ở, vừa kinh doanh, nằm trong phố Phan Huy Thông, không gian yên tĩnh, trong lành, nơi giao thoa giữa 3 quận Ba Đình, Đống Đa, Cầu Giấy, tiếp giáp các tuyến phố đông vui, sầm uất: Nguyễn Chí Thanh, Kim Mã, Đào Tấn, Liếu Giai, Cầu Giấy... Xung quanh gần nhiều trường học có danh tiếng, TTTM Lotte, Metropolis, chợ truyền thống, siêu thị, bãi gửi ô tô... Nhà thiết kế 5 tầng, chủ nhà xây để ở rất cẩn thận, chắc chắn, hiện trạng còn rất mới. Nội thất hiện đại, phong cách Âu Châu, thiết bị đều nhập ngoại của các hãng nổi tiếng, Nhà đẹp, to rộng, rất thích hợp với gia đình đông người 2,3 thế hệ cùng sinh sống. Môi trường sống gần Hồ thoáng mát, hàng ngày ra Hồ thể dục, lên tầng thượng xem bắn pháo hoa, cuộc sống vô cùng thú vị. Pháp lý ngôi nhà chuẩn, sổ đỏ cất két, sẵn sàng giao dịch ngay. - Tầng 1: Phòng khách, bếp, phòng ăn, WC. - Tầng 2: Thông phòng + WC. - Tầng 3,4: Mỗi tầng 2 phòng ngủ khép kín. - Tầng 5: Phòng thờ, sân phơi. Giá bán ngôi nhà: 6.8 tỷ (có thương lượng). Thông tin liên hệ: Mr Hòa, chuyên gia Nhà Phố. ĐT(24/24): 0903.292.458(miễn TG, MG).          Tìm kiếm theo từ khóa :  Bán nhà phường Ngọc Khánh quận Ba Đình ,  Bán nhà gần hồ Ngọc Khánh quận Ba Đình ,  Bán nhà phố Phạm Huy Thông quận Ba Đình ,  Bán nhà gần Trung tâm thương mại Lotte quận Ba Đình ,  Bán nhà quận Ba Đình               Hình ảnh  ()   Bản đồ                                                                   Đặc điểm bất động sản         Mã số    13702532       Loại tin rao    Bán nhà riêng       Ngày đăng tin    28/06/2021       Ngày hết hạn    12/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào    3 m       Mặt tiền    8 m       Số tầng    5       Số toilet    6       Nội thất                 Thông tin liên hệ       Tên liên lạc    Mr  Hòa       Địa chỉ    Giảng Võ.       Điện thoại    0903292458       Di động    0903292458       Email     <!-- document.write(\"&#104;&#111;&#97;&#113;&#117;&#97;&#110;&#103;&#118;&#117;&#49;&#57;&#55;&#50;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0903292458"}
{"url": "https://dothi.net/ban-nha-rieng-pho-mai-dich-phuong-mai-dich/ban-gap-nha-rieng-chinh-chu-3-tang-o-pho-mai-dich-o-to-vao-nha-75m2-gia-62-ty-co-thuong-luong-pr13660458.htm", "code": "13660458", "title": "Bán gấp nhà riêng chính chủ 3 tầng ở phố Mai Dịch, ô tô vào nhà, 75m2. Giá 6.2 tỷ có thương lượng", "description": "Bán gấp nhà riêng chính chủ 3 tầng ở phố Mai Dịch, ô tô vào nhà, 75m2. Giá 6.2 tỷ có thương lượng      Khu vực:    Bán nhà riêng tại Phố Mai Dịch  - Quận Cầu Giấy - Hà Nội     Giá:   6.2 Tỷ  Diện tích:  75 m²       Thông tin mô tả    Gia đình cần bán nhà riêng tại Phường Mai Dịch, Cầu Giấy, Hà Nội. - Thiết kế 3 tầng kiên cố, trước có để khoảng sân có mái che để ô tô. - Ngõ trước nhà 4m, ô tô để vào nhà thoải mái. - Diện tích sử dụng 75m2, diện tích sổ 65m2, gia đình ở lâu năm. Căn nhà được nhà nước phân, không có tranh chấp, hàng xóm văn minh, hòa thuận. - Sổ đỏ chính chủ. - Giá bán 6.2 tỷ có thương lượng. Liên hệ trực tiếp chị Thảo: 0964754393.          Tìm kiếm theo từ khóa :  Bán nhà quận Cầu Giấy ,  Bán nhà phố Mai Dịch quận Cầu Giấy ,  Bán nhà phường Mai Dịch quận Cầu Giấy               Hình ảnh  ()   Bản đồ                                                           Đặc điểm bất động sản         Mã số    13660458       Loại tin rao    Bán nhà riêng       Ngày đăng tin    01/07/2021       Ngày hết hạn    15/07/2021       Hướng nhà    Tây-Nam       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Trần Phương Thảo       Địa chỉ           Điện thoại           Di động    0964754393       Email     <!-- document.write(\"&#116;&#104;&#97;&#111;&#102;&#105;&#110;&#110;&#104;&#97;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0964754393"}
{"url": "https://dothi.net/ban-nha-rieng-pho-thai-thinh-phuong-trung-liet/ban-nha-rieng-tai-duong-thai-thinh-phuong-trung-liet-dong-da-ha-noi-dien-tich-45m2-gia-6450-t-pr13700229.htm", "code": "13700229", "title": "Bán nhà riêng tại đường Thái Thịnh, Phường Trung Liệt, Đống Đa, Hà Nội diện tích 45m2 giá 6.45 tỷ", "description": "Bán nhà riêng tại đường Thái Thịnh, Phường Trung Liệt, Đống Đa, Hà Nội diện tích 45m2 giá 6.45 tỷ      Khu vực:    Bán nhà riêng tại Phố Thái Thịnh  - Quận Đống Đa - Hà Nội     Giá:   6.45 Tỷ  Diện tích:  45 m²       Thông tin mô tả    Bán nhà phố Thái Thịnh - Đống Đa. + Diện tích: 45m2, nhà xây 5 tầng, mặt tiền rộng 4m. + Cách mặt phố Thái Thịnh chỉ 20m, cách ĐH Thuỷ Lợi chỉ 200m, cách bãi gửi xe chỉ 30m, trước nhà rộng 3m, an ninh tốt, dân trí cao. + Nhà gia chủ tự xây để ở nên, khung cột chắc chắn, cửa gỗ Lim, cầu thang gỗ Lim Nguyên Khối, nội thất đẹp, sang trọng. + Gia đình công chức ở giữ gìn sạch sẽ, cẩn thận. + Nhà thoáng trước thoáng sau, các phòng thông gió sáng thoáng, đầy đủ công năng, khách mua về ở ngay. + Sổ nở hậu, giao dịch ngay. + Giá bán 6,45 tỷ, trả giá trực tiếp với chủ nhà. Lh: 0869010880. Mr Hùng Anh tư vấn 24/24.          Tìm kiếm theo từ khóa :  Bán nhà phường Trung Liệt quận Đống Đa ,  Bán nhà phố Thái Thịnh quận Đống Đa ,  Bán nhà Quận Đống Đa               Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13700229       Loại tin rao    Bán nhà riêng       Ngày đăng tin    25/06/2021       Ngày hết hạn    09/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào    3 m       Mặt tiền    4 m       Số tầng    5       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Hùng Anh       Địa chỉ           Điện thoại           Di động    0869010880       Email     <!-- document.write(\"&#72;&#117;&#110;&#103;&#97;&#110;&#104;&#49;&#57;&#56;&#48;&#46;&#104;&#110;&#64;&#103;&#109;&#97;