{"url": "https://dothi.net/ban-nha-rieng-khu-dan-cu-vinh-loc-a/ban-nha-2-lau-so-hong-rieng-o-binh-chanh-pr13635723.htm", "code": "13635723", "title": "Bán nhà 2 lầu sổ hồng riêng ở Bình Chánh", "description": "Bán nhà 2 lầu sổ hồng riêng ở Bình Chánh      Khu vực:    Bán nhà riêng tại Khu Dân Cư Vĩnh Lộc A  - Huyện Bình Chánh - Hồ Chí Minh     Giá:   Thỏa thuận  Diện tích:  80 m²       Thông tin mô tả    Bán nhà hoàn thiện 1 trệt, 2 lầu nhà phố liền kề. Thiết kế nhà 1 trệt, 2 lầu, phòng khách, bếp, 4 PN, 3WC, sân trước và sân sau rộng 5m, đường 10m giao thông đi lại thuận tiện. Diện tích: 60m - 80m2 (có tất cả các hướng). Hệ thống điện, nước đầy đủ cung cấp đến cho từng hộ gia đình sử dụng. Tiện ích: Ngay khu dân cư đông đúc, gần chợ, bệnh viện, trường học, siêu thị... Sổ hồng riêng từng căn, công chứng và nhận ngay nhà (không phát sinh thêm chi phí nào khác). Nộp trước 50%, Công ty hỗ trợ khách trả chậm trong 12 tháng không lãi suất. Liên hệ sớm để được giá tốt nhất: Kim Ngân 0906.982.809. Khách đi xem nhà có xe 7 chỗ của công ty đưa đón tận nơi.          Tìm kiếm theo từ khóa :  Bán nhà huyện Bình Chánh ,  Bán nhà xã Vĩnh Lộc A huyện Bình Chánh ,  Bán nhà đường Hương lộ 80 huyện Bình Chánh               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    13635723       Loại tin rao    Bán nhà riêng       Ngày đăng tin    05/05/2021       Ngày hết hạn    19/05/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào    10 m       Mặt tiền    5 m       Số tầng    3       Số toilet    3       Nội thất                 Thông tin liên hệ       Tên liên lạc    Maiphuong       Địa chỉ           Điện thoại    0906982809       Di động    0904715352       Email     <!-- document.write(\"&#100;&#105;&#110;&#104;&#104;&#97;&#109;&#97;&#105;&#112;&#104;&#117;&#111;&#110;&#103;&#49;&#52;&#48;&#51;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); /