{"url": "https://dothi.net/ban-nha-rieng-duong-nguyen-van-dau-phuong-11-7/biet-thu-mini-dt88m2-nguyen-van-dau-pr13582369.htm", "code": "13582369", "title": "Biệt thự mini DT 88m2 Nguyễn Văn Đậu", "description": "Biệt thự mini DT 88m2 Nguyễn Văn Đậu      Khu vực:    Bán nhà riêng tại Đường Nguyễn Văn Đậu  - Quận Bình Thạnh - Hồ Chí Minh     Giá:   5.4 Tỷ  Diện tích:  88 m²       Thông tin mô tả    Cần tiền làm ăn, bán biệt thự 3 lầu + ST tuyệt đẹp cao cấp, hẻm xe hơi 5m Nguyễn Văn Đậu P11 Bình Thạnh - Diện tích: 8m x 11m, DT sàn xây dựng 260m2. - Biệt thự xây dựng cao cấp, thiết kế tuyệt đẹp, sang trọng, cấu trúc: Sân trước (để xe hơi + xe máy) + 2 lầu + sân thượng, gồm: Phòng khách + bếp + 3 phòng ngủ + 4WC (có bồn tắm) + phòng thờ + phòng làm việc, nội thất cao cấp, đầy đủ tiện nghi: Bàn ghế gỗ, giường tủ gỗ, máy nước nóng NLMT, bồn tắm kiếng, thiết kế theo phong cách hiện đại. Vào ở ngay không phải sửa chữa.  - Hẻm rộng 5m xe hơi vào tận nhà, thuận tiện vừa ở vừa mở Văn phòng công ty, hay kinh doanh buôn bán online... - Trung tâm Bình Thạnh, bán kính 300m đủ mọi dịch vụ: Nhà hàng, khách sạn, ngân hàng: ACB, BIDV, Eximbank, Sacombank. Đi sân bay chỉ 10 phút xe máy, giáp Q1. Tân Bình, Thủ Đức Gò Vấp. - Giá 5,4 tỷ bao sang tên công chứng (Thương lượng nhẹ) - Liên hệ trước xem thực tế nhà.          Tìm kiếm theo từ khóa :  Bán nhà đường Nguyễn Văn Đậu quận Bình Thạnh ,  Bán nhà phường 11 quận Bình Thạnh ,  Bán nhà hẻm xe hơi đường Nguyễn Văn Đậu ,  Bán nhà Quận Bình Thạnh               Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13582369       Loại tin rao    Bán nhà riêng       Ngày đăng tin    19/03/2021       Ngày hết hạn    02/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    5 m       Mặt tiền    8 m       Số tầng    3       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Chí Thanh       Địa chỉ    Q. thủ Đức