{"url": "https://dothi.net/ban-nha-rieng-duong-nguyen-van-dau-phuong-6-13/nha-1tret-2lau-35x8m-3pn2wc-45ngvan-dau-p6-bt-pr13502027.htm", "code": "13502027", "title": "Nhà 1 trệt 2 lầu 3,5x8m 3PN - 2WC 45 Nguyễn Văn Đậu, P6, BT", "description": "Nhà 1 trệt 2 lầu 3,5x8m 3PN - 2WC 45 Nguyễn Văn Đậu, P6, BT      Khu vực:    Bán nhà riêng tại Đường Nguyễn Văn Đậu  - Quận Bình Thạnh - Hồ Chí Minh     Giá:   3.5 Tỷ  Diện tích:  28 m²       Thông tin mô tả    Cần bán gấp nhà mới đón tết 2021 đẹp như hình hẻm 45 Nguyễn Văn Đậu, P6, Bình Thạnh (hẻm 35 Nguyễn Văn Đậu vào gần nhà). Diện tích: 3,5x8m, nhà 1 trệt + 2 lầu (BTLT), nhà có 3 phòng ngủ & 2 toilet. Nhà đầy đủ nội thất: Có 4 máy lạnh, cửa chống cháy Korea, bồn cầu nguyên khối, cầu thang tay vịn câm xe, bếp Mallorca, sàn gỗ bao đẹp,... Nội thất 1 đổi 1 trong vòng 12 tháng, rất xịn sò.. Vị trí: Ngay phòng công chứng số 6, Phan Đăng Lưu sát bên, coffee Highlands, trường mầm non bên cạnh.          Tìm kiếm theo từ khóa :  Bán nhà đường Nguyễn Văn Đậu quận Bình Thạnh ,  Bán nhà phường 6 quận Bình Thạnh ,  Bán nhà hẻm 45 đường Nguyễn Văn Đậu ,  Bán nhà Quận Bình Thạnh               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13502027       Loại tin rao    Bán nhà riêng       Ngày đăng tin    05/01/2021       Ngày hết hạn    19/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    5 m       Mặt tiền    3.5 m       Số tầng    3       Số toilet    2       Nội thất                 Thông tin liên hệ       Tên liên lạc    Pham Thi Thoa       Địa chỉ    Hồ Chí Minh       Điện thoại    0813308841       Di động    0813308841       Email     <!-- document.write(\"&#116;&#104;&#111;&#97;&#112;&#104;&#97;&#109;&#49;&#53;&#48;&#49;&#49;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In ti