{"url": "https://dothi.net/ban-nha-rieng-pho-thai-thinh-phuong-nga-tu-so/nha-dep-5-tang-thang-may-gara-30m2-lo-goc-pho-thai-thinh-o-kinh-doanh-sieu-dinh-4-ty-pr13496477.htm", "code": "13496477", "title": "Nhà đẹp - 5 tầng thang máy, gara - 30m2 lô góc phố Thái Thịnh - ở + kinh doanh siêu đỉnh - 4 tỷ", "description": "Nhà đẹp - 5 tầng thang máy, gara - 30m2 lô góc phố Thái Thịnh - ở + kinh doanh siêu đỉnh - 4 tỷ      Khu vực:    Bán nhà riêng tại Phố Thái Thịnh  - Quận Đống Đa - Hà Nội     Giá:   4 Tỷ  Diện tích:  30 m²       Thông tin mô tả    Bán nhà mới đẹp mặt ngõ Thái Thịnh, Đống Đa. Diện tích 30m2, 5 tầng, mặt tiền 4m, giá 4 tỷ. - Chủ làm ăn phát đạt, bán để mua nhà mặt phố to hơn. - Sổ đỏ phân lô. Sẵn sàng giao dịch ngay. - Nhà mới về ở luôn, không cần sửa chữa. - Thiết kế hiện đại, mỗi tầng 1 phòng ngủ khép kín. Cầu thang máy và bộ cuối nhà. - Ngõ ô tô đi lại, ô tô đỗ cổng ngày đêm. Giao thông thuận tiện, thông sang Tây Sơn, Thịnh Quang, Láng, Yên Lãng, Thái Hà... - Xung quanh nhiều tiện nghi, bệnh viện, trường học, công viên...          Tìm kiếm theo từ khóa :  Bán nhà phố Thái Thịnh quận Đống Đa ,  Bán nhà phường Ngã Tư Sở quận Đống Đa ,  Bán nhà Quận Đống Đa               Hình ảnh  ()   Bản đồ                                                                   Đặc điểm bất động sản         Mã số    13496477       Loại tin rao    Bán nhà riêng       Ngày đăng tin    29/12/2020       Ngày hết hạn    12/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    4.5 m       Mặt tiền    4 m       Số tầng    4       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Hoàng Mạnh Cường       Địa chỉ    số 7 ngõ 55 đường Thanh Liệt, Thanh Trì, Hà Nội       Điện thoại    0966800717       Di động    0966800717       Email     <!-- document.write(\"&#109;&#97;&#110;&#104;&#99;&#117;&#111;&#110;&#103;&#50;&#48;&#50;&#104;&#111;&#97;&#110;&#103;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109