{"url": "https://dothi.net/cho-thue-can-ho-chung-cu-indochina-plaza-hanoi/cho-thue-cc-indochina-plaza-241-xuan-thuy-can-201m2-4-phong-ngu-du-do-cuc-dep-lh-0978009240-pr13699400.htm", "code": "13699400", "title": "Cho thuê CC Indochina Plaza 241 Xuân Thủy, căn 201m2, 4 phòng ngủ, đủ đồ cực đẹp. Lh 0978009240", "description": "Cho thuê CC Indochina Plaza 241 Xuân Thủy, căn 201m2, 4 phòng ngủ, đủ đồ cực đẹp. Lh 0978009240      Khu vực:    Cho thuê căn hộ chung cư tại Indochina Plaza Hanoi  - Quận Cầu Giấy - Hà Nội     Giá:   Thỏa thuận  Diện tích:  201 m²       Thông tin mô tả    Cần cho thuê căn hộ chung cư Indochina Plaza 241 Xuân Thủy. Indochina Plaza có đầy đủ tiện ích như trung tâm thương mại, bể bơi, nhà hàng, quán ăn... Căn hộ tầng cao, diện tích 201m2, 4 phòng ngủ, 3 vệ sinh, ban công rất thoáng mát. Là căn góc đẹp nhất tòa. Nội thất 100%, nhập khẩu đồng bộ. Sofa da cỡ lớn, tủ lạnh 6 cánh, tivi, máy giặt lồng ngang, bàn ghế, giường tủ đặt làm bằng gỗ cao cấp. Thiết bị nhà bếp cao cấp... Khách thuê chỉ cần dọn đồ cá nhân vào ở luôn. Giá thuê có thể thỏa thuận trực tiếp với chủ nhà. Lh: 0978009240 (không mất bất kỳ khoản phí môi giới nào).              Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13699400       Loại tin rao    Cho thuê căn hộ chung cư       Ngày đăng tin    09/06/2021       Ngày hết hạn    09/09/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào           Mặt tiền           Số tầng           Số toilet    3       Nội thất    đủ đồ cực đẹp             Thông tin liên hệ       Tên liên lạc    Chu Van Biên       Địa chỉ    Dự án Indochina Plaza Hanoi, đường Xuân Thủy, phường Dịch Vọng Hậu, Cầu Giấy, Hà Nội       Điện thoại    0978009240       Di động    0978009240       Email                 Lưu tin   In tin này", "phone": "0978009240"}
{"url": "https://dothi.net/ban-nha-rieng-pho-thai-thinh-phuong-thinh-quang/ban-nha-thai-thinh-72-met-vuong-4-tang-gia-nhinh-4-ty-o-to-gan-pr13507035.htm", "code": "13507035", "title": "Bán nhà Thái Thịnh 72 mét vuông, 4 tầng, giá nhỉnh 4 tỷ, ô tô gần", "description": "Bán nhà Thái Thịnh 72 mét vuông, 4 tầng, giá nhỉnh 4 tỷ, ô tô gần      Khu vực:    Bán nhà riêng tại Phố Thái Thịnh  - Quận Đống Đa - Hà Nội     Giá:   4 Tỷ  Diện tích:  72 m²       Thông tin mô tả    Bán nhà Thái Thịnh 72 mét vuông, 4 tầng, giá nhỉnh 4 tỷ, ô tô gần. Nhà thuộc khu vực trung tâm Đống Đa, thông tứ tung, Thái Hà, Chùa Bộc, Tây Sơn, Nguyễn Lương Bằng, Ngã Tư Sở, Trường Chinh, Nguyễn Trãi, Đường Láng, Trường Đại Học Thủy Lợi, Trường Học Viện Ngân Hàng, Trường Đại Học Công Đoàn, gò Đống Đa. OTO cách nhà 10m. Nhà có 4 hướng thông gió và hứng khí trời, cực kỳ vượng. Trước nhà là khoảng sân để xe và vẽ tiểu cảnh rất đẹp. - Tầng 1 thiết kế Phòng khách + bếp + phòng ăn. - Tầng 2 + 3 mỗi tầng 2 phòng ngủ, phòng nào cũng có cửa sổ hướng gió và khí trời rất thoáng mát. - Tầng 4 phòng thờ + sân phơi. Sổ đỏ chính chủ. LH: 0942796799. Không tiếp trung gian.          Tìm kiếm theo từ khóa :  Bán nhà gần trường đại học Công Đoàn quận Đống Đa ,  Bán nhà Quận Đống Đa ,  Bán nhà phường Thịnh Quang quận Đống Đa ,  Bán nhà phố Thái Thịnh quận Đống Đa ,  Bán nhà gần trường Học Viện Ngân Hàng quận Đống Đa ,  Bán nhà gần trường đại học Thủy Lợi quận Đống Đa               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13507035       Loại tin rao    Bán nhà riêng       Ngày đăng tin    09/01/2021       Ngày hết hạn    23/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào    4 m       Mặt tiền    4 m       Số tầng    4       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Trần Khắc Thành       Địa chỉ    Đống Đa, Hà Nội       Điện thoại    0942796799       Di 