{"url": "https://dothi.net/ban-nha-rieng-duong-lam-son-phuong-6-13/biet-thu-lam-son-bt-400m2-4-tang-ngang-khung-7m-chuan-dang-cap-dai-giachi-265-ty-so-huu-ngay-pr13432950.htm", "code": "13432950", "title": "BT Lam Sơn - Bình Thạnh 400m2, 4T, ngang khủng 7m, chuẩn đẳng cấp đại gia,chỉ 26.5 tỷ sở hữu ngay", "description": "BT Lam Sơn - Bình Thạnh 400m2, 4T, ngang khủng 7m, chuẩn đẳng cấp đại gia,chỉ 26.5 tỷ sở hữu ngay      Khu vực:    Bán nhà riêng tại Đường Lam Sơn  - Quận Bình Thạnh - Hồ Chí Minh     Giá:   26 Tỷ  Diện tích:  170 m²       Thông tin mô tả    Gia chủ cần tiền giải quyết công việc, cần bán nhanh căn biệt phủ: Diện tích khủng, ngang 7m, không gian xanh. Hẻm 6m, khu nhà hàng khách sạn, sát mặt tiền. Nhà đã lên top tạp chí nhà đẹp Việt Nam, do kiến trúc sư SDA Sanuki Daisuke (Người Nhật thiết kế). Kiến trúc: Biệt thự 4 tầng, 3 phòng ngủ. Thiết kế chủ đạo nghỉ dưỡng cao cấp. Ý tưởng muốn gần gũi thiên nhiên yên bình. Sổ hồng nở hậu, pháp lý chuẩn, công chứng ngay. Nói tóm lại căn biệt phủ này thể hiện đẳng cấp cho gia chủ nào sẽ sở hữu nó. Không chê vào đâu được. Liên hệ SĐT để em Tâm sắp xếp cho quý anh chị xem nhà, gia chủ bán kính nên hàng chỉ mình em có. Giá cả sẽ làm việc trực tiếp cùng chính chủ.          Tìm kiếm theo từ khóa :  Bán nhà Quận Bình Thạnh ,  Bán nhà đường Lam Sơn quận Bình Thạnh ,  Bán nhà phường 6 quận Bình Thạnh               Hình ảnh  ()   Bản đồ                                                                   Đặc điểm bất động sản         Mã số    13432950       Loại tin rao    Bán nhà riêng       Ngày đăng tin    05/01/2021       Ngày hết hạn    21/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    6 m       Mặt tiền    7 m       Số tầng    4       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Đỗ Thành Tâm       Địa chỉ    Lam Sơn, Phường 6, BÌnh Thạnh        Điện thoại    0888789431       Di động    0888789431       Email     <!-- document.write