{"url": "https://dothi.net/ban-nha-rieng-duong-lac-long-quan-7/ban-nha-moi-xay-nghia-do-lac-long-quan-o-to-do-cua-kinh-doanh-nho-365-ty-pr13672435.htm", "code": "13672435", "title": "Bán nhà mới xây Nghĩa Đô - Lạc Long Quân, ô tô đỗ cửa, kinh doanh nhỏ. 3.65 tỷ", "description": "Bán nhà mới xây Nghĩa Đô - Lạc Long Quân, ô tô đỗ cửa, kinh doanh nhỏ. 3.65 tỷ      Khu vực:    Bán nhà riêng tại Đường Lạc Long Quân  - Quận Cầu Giấy - Hà Nội     Giá:   3.65 Tỷ  Diện tích:  30 m²       Thông tin mô tả    Thông tin thổ cư: + Nhà đẹp như mơ, vừa hoàn thiện, tại ngõ 175 Lạc Long Quân, cách mặt phố 25m, cách Hồ Tây 50m, cách chợ Nghĩa Đô 80m, cách đường Võ Chí Công 200m. + Khu vực đông dân, an sinh tốt, giao thông thuận tiện. Gần chợ Nghĩa Đô, chợ Bưởi. Có nhiều trường mầm non và 2 trường cấp 1,2,3. + Diện tích 30m2, xây 5 tầng. Mặt tiền 4.5 mét, nhà thiết kế gara, ô tô 4 chỗ vào được, thuộc khu vip gần Hồ Tây. + Nhà đáp ứng tối thiểu 3 buồng ngủ, 3 nhà vệ sinh. Phòng nào cũng có cửa sổ lấy sáng, cuối nhà có khe thoáng. + Chủ nhà xây rất cẩn thận, thiết kế hiện đại. Nội thất mới đẹp. Sàn gỗ tự nhiên đẹp và san. Thiết bị vệ sinh cao cấp. + Khách mua để ở hoặc cho thuê đều rất tốt, vị trí đẹp gần Hồ Tây nhiều khách nước ngoài thuê. Những căn nhà mới này là cực hiếm. + Giá: 3.65 tỷ. + Chi tiết xin liên hệ: Anh Trí - Nhà thật thổ cư - 0989 693 676. Trợ giúp mua bán đất phía Tây - Nhà dân xây / Hà Nội.              Hình ảnh  ()   Bản đồ                           Đặc điểm bất động sản         Mã số    13672435       Loại tin rao    Bán nhà riêng       Ngày đăng tin    29/05/2021       Ngày hết hạn    29/08/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    2.5 m       Mặt tiền    4.5 m       Số tầng    5       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Văn Trí       Địa chỉ    Ngõ 175, Đường Lạc Long Quân, Cầu Giấy, Hà Nội       Điện thoại    0989693676       Di động    0989693676       Emai