{"url": "https://dothi.net/ban-nha-rieng-duong-ha-ly-phuong-ha-ly/ban-nha-2-tang-ngo-ha-ly-cuc-dep-dien-tich-36m-gia-16-ty-hot-hot-hot-pr13698983.htm", "code": "13698983", "title": "Bán nhà 2 tầng ngõ Hạ Lý cực đẹp, diện tích 36.6m2, giá 1,6 tỷ", "description": "Bán nhà 2 tầng ngõ Hạ Lý cực đẹp, diện tích 36.6m2, giá 1,6 tỷ      Khu vực:    Bán nhà riêng tại Đường Hạ Lý  - Quận Hồng Bàng - Hải Phòng     Giá:   1.6 Tỷ  Diện tích:  36 m²       Thông tin mô tả    Chủ chuyển nhà mới nên cần bán lại căn nhà cũ cực đẹp trong ngõ Hạ Lý. Nhà thiết kế 2 tầng đầy đủ công năng, tối ưu hóa diện tích và được trang trí cực kì bắt mắt... Diện tích 36,6m2, mặt tiền 5m 2 tầng hướng Nam. Ngõ nông 1,5m xe máy đi lại thoải mái. Nhà thiết kế 2 phòng ngủ - phòng khách bếp 2 vệ sinh sân phơi. Đặc biệt từ nhà đi bộ ra phố Thế Lữ chỉ 100m, hàng ngày có thể đi bộ tập thể dục, ngắm view sông, thiên nga. Không gian sống cực kì lý tưởng cho gia đình nhỏ - vợ chồng công chức công nhân. Giá chỉ 1,6 tỷ vô cùng hợp lý cho căn nhà trung tâm khi giá đất và nguyên vật liệu đang tăng cao. Sản phẩm vô cùng hiếm trong phân khúc nhà phố. Quý khách hàng nên quyết đoán cân nhắc thời điểm này.. Duy Dũng chuyên tư vấn BĐS Hồng Bàng. Zalo/SĐT: 0989401199.              Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13698983       Loại tin rao    Bán nhà riêng       Ngày đăng tin    04/06/2021       Ngày hết hạn    04/09/2021       Hướng nhà    Nam       Hướng ban công           Số phòng    2       Đường vào    1.5 m       Mặt tiền    5 m       Số tầng    2       Số toilet    2       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Duy Dũng       Địa chỉ    Đường Hạ Lý, phường Hạ Lý, Hồng Bàng, Hải Phòng       Điện thoại    0989401199       Di động    0989401199       Email     <!-- document.write(\"&#100;&#117;&#121;&#100;&#117;&#110;&#103;&#98;&#100;&#115;&#56;&#52;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\");