{"url": "https://dothi.net/ban-nha-rieng-duong-lien-tinh-5-phuong-7-6/ban-gap-nha-gan-ben-xe-q8-duong-lien-tinh-5-pr13491456.htm", "code": "13491456", "title": "Bán gấp nhà gần bến xe Q8, đường Liên Tỉnh 5", "description": "Bán gấp nhà gần bến xe Q8, đường Liên Tỉnh 5      Khu vực:    Bán nhà riêng tại Đường Liên Tỉnh 5  - Quận 8 - Hồ Chí Minh     Giá:   Thỏa thuận  Diện tích:  51 m²       Thông tin mô tả    Chủ cần vốn xoay gấp trước tết. Nhà 1 trệt 1 lửng. Vị trí: Đường Liên Tỉnh 5, Phường 5, Quận 8 (Gần ngay bến xe Quận 8). Hẻm ba gác, dân cư đông, an ninh, hàng xóm thân thiện, lịch sự. Kết cấu: 1 trệt 1 lửng, 2 phòng ngủ, 1toilet, phòng. Khách rộng, diện tích lớn. Diện tích: 51m2. Pháp lý: Sổ hồng riêng, sang tên nhanh, xây dựng sửa chữa tự do. Thanh toán 850 triệu cho một căn nhà 51m2, quá hời cho anh/chị/em có nhu cầu ở ngay hoặc sửa lại đầu tư. Nếu có thể, anh/chị vui lòng gọi cho em, em ít check tin nhắn.          Tìm kiếm theo từ khóa :  Bán nhà Quận 8 ,  Bán nhà phường 7 Quận 8 ,  Bán nhà đường Liên Tỉnh 5 quận 8 ,  Bán nhà gần bến xe Quận 8 quận 8               Hình ảnh  ()   Bản đồ                                                                           Đặc điểm bất động sản         Mã số    13491456       Loại tin rao    Bán nhà riêng       Ngày đăng tin    25/12/2020       Ngày hết hạn    08/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    2       Đường vào    2.5 m       Mặt tiền    2.5 m       Số tầng    2       Số toilet    1       Nội thất                 Thông tin liên hệ       Tên liên lạc    Lực Tấn       Địa chỉ    12 C1, Phường 13, quận Tân Bình, Hồ Chí Minh       Điện thoại    0946061493       Di động    0946061493       Email     <!-- document.write(\"&#112;&#104;&#97;&#110;&#116;&#97;&#110;&#108;&#117;&#99;&#48;&#52;&#48;&#53;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   I