{"url": "https://dothi.net/ban-nha-rieng-duong-tuu-liet-xa-tam-hiep-6/ban-gap-nha-1-tang-ngo-21-tuu-liet-thanh-tri-65m2-mt-6m-o-to-tranh-kd-pr13545946.htm", "code": "13545946", "title": "Bán gấp nhà 1 tầng ngõ 21 Tựu Liệt, Thanh Trì 65m2 MT 6m ô tô tránh KD", "description": "Bán gấp nhà 1 tầng ngõ 21 Tựu Liệt, Thanh Trì 65m2 MT 6m ô tô tránh KD      Khu vực:    Bán nhà riêng tại Đường Tựu Liệt  - Huyện Thanh Trì - Hà Nội     Giá:   3.9 Tỷ  Diện tích:  65 m²       Thông tin mô tả    + Nhà nằm mặt ngõ ô tô tránh kinh doanh tốt như mở phòng khám, hiệu thuốc, tạp hóa, hàng ăn sáng sổ đỏ riêng chính chủ 65m2 mặt tiền 6m, ở ngõ 21 Tựu Liệt gần KĐT Tây Nam Linh Đàm, Ngọc Hồi. + Nhà thích hợp đầu tư giữ tiền hoặc mua xây nhà trọ, chung cư mini, kho xưởng, văn phòng tiềm năng khu vực sáng giá. + Khách thiện trí, có nhu cầu liên hệ Hướng nhà đất số điện thoại 0961.000.863 0945031718 hoặc kết bạn Zalo, để được tư vấn về nhà đất và dẫn xem nhà miễn phí.              Hình ảnh  ()   Bản đồ                               Đặc điểm bất động sản         Mã số    13545946       Loại tin rao    Bán nhà riêng       Ngày đăng tin    04/12/2020       Ngày hết hạn    04/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Vũ Đình Hướng       Địa chỉ    Ngõ 21, Đường Tựu Liệt, xã Tam Hiệp, Thanh Trì, Hà Nội       Điện thoại    0961000863       Di động    0961000863       Email     <!-- document.write(\"&#118;&#117;&#100;&#105;&#110;&#104;&#104;&#117;&#111;&#110;&#103;&#110;&#100;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0961000863"}
{"url": "https://dothi.net/ban-nha-rieng-duong-yen-xa-xa-tan-trieu/ccmn-yen-xa-sieu-to-khong-lo-166-pkk-2-thang-may-750kg-doanh-thu-650-trieuthang-775-ty-pr13704207.htm", "code": "13704207", "title": "CCMN Yên Xá siêu to khổng lồ - 166 PKK - 2 thang máy 750kg - Doanh thu 650 triệu/tháng - 79 tỷ", "description": "CCMN Yên Xá siêu to khổng lồ - 166 PKK - 2 thang máy 750kg - Doanh thu 650 triệu/tháng - 79 tỷ      Bán nhà riêng  - Huyện Thanh Trì - Hà Nội     Giá:   79 Tỷ  Diện tích:  310 m²       Thông tin mô tả    CCMN siêu to khổng lồ - Siêu đẳng cấp - Tiện ích trọn gói phòng gym - bể bơi 0982.468.422. I. Thông số cơ bản. 1. Diện tích: 310m2 trên sổ, xây dựng từ tầng 2 là 350m2. 2. Lô góc: Mặt chính 6.6m - Mặt bên 37m. 3. Khu vực: Yên Xá, Tân Triều, Thanh Trì. 4. Xây dựng 12 tầng, tổng số 166 phòng khép kín có gác xép. 5. Đầy đủ bản vẽ thiết kế, thi công. Giấy phép xây dựng. Giấy chứng nhận an toàn PCCC. 6. 115 phòng đơn, 51 phòng đôi (1 khách - 1 ngủ). Tất cả các phòng đều thoáng, có chỗ nấu ăn phơi đồ riêng, được trang bị đầy đủ trang thiết bị: Điều hòa, nóng lạnh, giường, tủ quần áo, máy giặt, tủ lạnh, bàn làm việc, bàn bếp, bếp từ, tủ bếp, hút mùi, 7. Thang máy: 2 thang máy to loại 750 kg. 8. Giá bán: 79 tỷ có thương lượng. Giá đã bao gồm toàn bộ các loại thuế phí. II. Mô tả chi tiết. + Khu vực Yên Xá gần khu liền kề Tổng cục V. Đường trước mặt rộng 6m, ô tô dừng tránh và vào nhà thoải mái 24/24h. + . Nhà xây dựng hoàn thiện đẹp mới 100%. Các phòng đều có gác xép rộng, setup đủ đồ (Điều hòa, nóng lạnh, giường, tủ quần áo, máy giặt, tủ lạnh, bàn làm việc, bàn bếp, bếp từ, tủ bếp, hút mùi, ). + Sổ đẹp, không thóp hậu, không lỗi phong thuỷ, không đường đâm, không ngõ cụt, không cạnh mương cống thối. + Toà nhà to đẹp nhất khu vực, có đủ bản thiết kế và giấy phép xây dựng, hệ thống pccc đạt tiêu chuẩn. + Có thiết kế luôn phòng Gym và bể bơi dịch vụ ngay trong tòa nhà. + Khu dân trí cao an ninh tốt, đường bàn cờ ngõ thông rất tiện lợi... Ai mua đầu tư hoặc giữ tiền đều rất tốt vì tỷ suất lợi nhuận cao hơn gửi ngân hàng mà vẫn sinh lời hàng năm do bđs tăng giá. Đảm bảo là kênh giữ tiền an toàn nhất. III. Tính toán chi tiết. 1. Giá đất hiện tại: Giá 80 - 85 triệu/m2: 310m2 tương đương: 26 tỷ. 2. Giá nhà xây dựng: Giá xây dựng 8.5 triệu/m xây dựng (do giá thép tăng 40% so với giữa 2020 và rất nhiều vlxd tăng 10 - 20%). - Diện tích sàn: 350m2 * 11 tầng = 3850m2 sàn. - Tổng xây dựng: 3850m2 * 8.5 triệu = 32.7 tỷ. 3. Thang máy Việt Nhật loại 750kg giá khoảng 1.1 tỷ (550 triệu/thang). 4. Lắp đặt nội thất bàn giao full điều hoà, nóng lạnh, máy giặt 7,5kg, tủ lạnh 200lit, gác xép, tủ quần áo, bàn bếp, tủ bếp, bếp từ, hút mùi, sofa,... Full nội thất trị giá khoảng: 5 tỷ. 5. Tiền lãi ngân hàng: Thời gian thi công, bán 1 - 2 năm: 5 tỷ/năm (7%/năm). Cộng cả nhà, đất, nội thất, ngân hàng: Khoảng 70 tỷ. Hiện tại, đã ký cho thuê thầu lại cả toà giá 460 triệu/tháng. + Điều khoản: Đóng 3 tháng cọc 1 tháng. + Thời hạn thuê: 5 năm, 3 năm tăng giá 1 lần (10%). + Có thể cho thuê luôn theo hợp đồng trên thời hạn 5 - 10 năm. Hoặc nếu tự vận hành thì lợi nhuận chắc chắn tầm 650/1 tháng. Liên hệ: 0982.468.422 gặp anh Đức.          Tìm kiếm theo từ khóa :  Bán nhà Thanh Trì ,  Bán nhà Tân Triều Thanh Trì ,  Bán nhà Yên Xá Thanh Trì               Hình ảnh  ()   Bản đồ                                                                               Đặc điểm bất động sản         Mã số    13704207       Loại tin rao    Bán nhà riêng       Ngày đăng tin    29/06/2021       Ngày hết hạn    14/07/2021       Hướng nhà    Đông-Bắc       Hướng ban công           Số phòng           Đường vào    6 m       Mặt tiền    6.6 m       Số tầng    12       Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Lương Quang Đức       Địa chỉ    Văn Quán, Hà Đông, Hà Nội       Điện thoại    0963378699       Di động    0982468422       Email     <!-- document.write(\"&#115;&#101;&#114;&#105;&#118;&#105;&#101;&#116;&#46;&#101;&#115;&#116;&#64;&#103;&#1