{"url": "https://dothi.net/ban-nha-mat-pho-duong-tran-duy-hung-phuong-trung-hoa-4/ban-toa-nha-can-ho-dich-vu-3-sao-pho-tran-duy-hung-cau-giay-dt-184m2-mt-13m-gia-78-ty-pr13536294.htm", "code": "13536294", "title": "Bán tòa nhà căn hộ dịch vụ 3 sao phố Trần Duy Hưng - Cầu Giấy, DT 184m2, MT 13m. Giá 78 tỷ", "description": "Bán tòa nhà căn hộ dịch vụ 3 sao phố Trần Duy Hưng - Cầu Giấy, DT 184m2, MT 13m. Giá 78 tỷ      Khu vực:    Bán nhà mặt phố tại Đường Trần Duy Hưng  - Quận Cầu Giấy - Hà Nội     Giá:   78 Tỷ  Diện tích:  184 m²       Thông tin mô tả    Tôi cần bán tòa nhà 23 căn hộ dịch vụ cho người nước ngoài khu phố Trần Duy Hưng - Cầu Giấy - Hà Nội. Tòa nhà vừa mới hoàn thành tháng 5/2020, hiện tại đang có Hđ thuê dài hạn 190 triệu/tháng. Dt 184m2, mặt tiền 13m, trước nhà là vườn hoa đường thông hè thoáng, vị trí có 1 0 2 tại khu vực Trung Hòa, Tòa nhà thiết kế 7 tầng nổi 1 tum 1 hầm bao gồm 23 phòng căn hộ hạng sang khép kín cho khách nước ngoài thuê(chủ yếu là khách cơ quan nhà nước). Vị trí tòa nhà nằm ngay bên trung tâm hội nghị quốc gia, keangnam, cách phố Trần Duy Hưng sầm uất vài bước chân, Toàn bộ giấy tờ pháp lí đầy đủ, hệ thống PCCC đầy đủ theo tiêu chuẩn thành phố cấp. Sổ đỏ chính chủ. Giá bán 78 tỷ kèm theo HD thuê(bao phí sang tên). LH; Quang Trưởng; 0912.129.926 - 0912.729.926. Trên 20 năm kinh nghiệm, cty chúng tôi chuyên cung cấp các sản phẩm tòa nhà văn phòng - khách sạn mặt phố, ngõ lớn.... Nhận tư vấn thiết kế và thi công theo yêu cầu của khách hàng.              Hình ảnh  ()   Bản đồ                           Đặc điểm bất động sản         Mã số    13536294       Loại tin rao    Bán nhà mặt phố (nhà mặt tiền trên các tuyến phố)       Ngày đăng tin    30/01/2021       Ngày hết hạn    30/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền    13 m       Số tầng    7       Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Anhtuan       Địa chỉ    Đường T