{"url": "https://dothi.net/ban-nha-mat-pho-duong-vu-pham-ham-phuong-trung-hoa-4/ban-nha-phan-lo-vu-pham-ham-nguyen-khang-cau-giay-60m2-5-tang-o-to-7-cho-vao-nha-gia-139-ty-pr13679625.htm", "code": "13679625", "title": "Bán nhà phân lô Vũ Phạm Hàm, Nguyễn Khang, Cầu Giấy 60m2, 5 tầng, ô tô 7 chỗ vào nhà giá 13.9 tỷ", "description": "Bán nhà phân lô Vũ Phạm Hàm, Nguyễn Khang, Cầu Giấy 60m2, 5 tầng, ô tô 7 chỗ vào nhà giá 13.9 tỷ      Khu vực:    Bán nhà mặt phố tại Đường Vũ Phạm Hàm  - Quận Cầu Giấy - Hà Nội     Giá:   13.9 Tỷ  Diện tích:  60 m²       Thông tin mô tả    Bán nhà phân lô Vũ Phạm Hàm, Nguyễn Khang, Trung Hòa, Cầu Giấy diện tích 60m2 xây 5 tầng, thiết kế tầng 2 phòng, mặt tiền 4.5m, nở hậu. Đường trước nhà ô tô chạy vòng quanh, ô tô 24 chỗ đỗ cửa, xe 7 chỗ vào nhà, mặt phố kinh doanh cực tốt. Lô góc 2 mặt đường ô tô. Thiết kế hiện đại, đẳng cấp: - Tầng 1: Thông phòng làm mặt bằng kinh doanh hoặc làm gara ô tô. - Tầng 2: Phòng khách + nhà bếp + VS + ban công. - Tầng 3,4 mỗi tầng 2 phòng ngủ + VS và ban công. - Tầng 5: Phòng thờ + sân phơi. - Tầng mái chống nóng. Vị trí: Nhà nằm mặt phố Nguyễn Khang, cách 20m là ra phố Vũ Phạm Hàm vị trí kinh doanh đắc địa, đường thông tứ phía giao thông đi lại thuận tiện. Kinh doanh nhiều mặt hàng: Spa, phòng khám, thời trang. Nội thất: Hiện đại đẳng cấp, gia đình đã lắp đặt toàn bộ nội thất khách mua chỉ việc về ở mà không phải mua sắm gì thêm. Sổ đỏ chính chủ, giao dịch ngay giá 13.9 tỷ (có thương lượng) liên hệ anh Kiên 0973581686 (miễn QC).          Tìm kiếm theo từ khóa :  Bán nhà mặt phố quận Cầu Giấy ,  Bán nhà mặt phố đường Vũ Phạm Hàm quận Cầu Giấy               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    13679625       Loại tin rao    Bán nhà mặt phố (nhà mặt tiền trên các tuyến phố)       Ngày đăng tin    08/06/2021       Ngày hết hạn    22/06/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng   