{"url": "https://dothi.net/ban-nha-mat-pho-duong-tran-duy-hung-phuong-trung-hoa-4/ban-nha-mat-pho-tran-duy-hung-cau-giay-64-m2-mat-tien-5m-gia-257-ty-pr12753952.htm", "code": "12753952", "title": "Bán nhà mặt phố Trần Duy Hưng, Cầu Giấy 64 m2, mặt tiền 5m, giá: 25.7 tỷ", "description": "Bán nhà mặt phố Trần Duy Hưng, Cầu Giấy 64 m2, mặt tiền 5m, giá: 25.7 tỷ      Khu vực:    Bán nhà mặt phố tại Đường Trần Duy Hưng  - Quận Cầu Giấy - Hà Nội     Giá:   25.7 Tỷ  Diện tích:  64 m²       Thông tin mô tả    Bán nhà mặt phố Trần Duy Hưng, Cầu Giấy 64 m2, mặt tiền 5m, giá: 25.7 tỷ. - Nhà nằm ở vị trí vàng cách ngã tư Nguyễn Khang và Trần Duy Hưng 30 m, với mặt phố vỉa hè rộng 6m, cạnh là mặt ngõ gần 4m, ngõ đằng sau gần 3m. - Nhà xây 4 tầng rất chắc chắn trên diện tích 64 m2, mặt tiền rộng 5m. - Thiết kế tầng 1 đang cho thuê mặt trước, đằng sau bếp rộng, có cửa nách và lối đi lên tầng bên trong. - Tầng 2,3 mỗi tầng 2 phòng lớn, 1 phòng nhỏ kèm theo vệ sinh. - Tầng 4 có 1 phòng ngủ, 1 phòng thờ và sân. - Với lợi thế ngay cạnh ngã tư bên phải hướng đi ra ngoài thành phố, là lô góc với mặt tiền và vỉa hè thoáng rộng nên kinh doanh gì cũng rất thuận lợi. - Sổ đỏ chính chủ pháp lý rõ ràng, đất đẹp vuông vắn, giá: 25.7 tỷ.          Tìm kiếm theo từ khóa :  Bán nhà mặt phố gần ngã tư bên quận Cầu Giấy ,  Bán nhà mặt phố quận Cầu Giấy ,  Bán nhà mặt phố đường Trần Duy Hưng quận Cầu Giấy ,  Bán nhà mặt phố gần ngã tư Nguyễn Khang quận Cầu Giấy               Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    12753952       Loại tin rao    Bán nhà mặt phố (nhà mặt tiền trên các tuyến phố)       Ngày đăng tin    07/02/2021       Ngày hết hạn    21/02/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    5       Đường vào    12 m       Mặt tiền    5 m       Số tầng    4       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Công Ngọc       Địa chỉ           Điện tho