{"url": "https://dothi.net/ban-nha-mat-pho-duong-hoang-ngan-phuong-trung-hoa-4/can-tien-ban-gap-mp-hoang-nganle-van-luong-trung-hoacau-giaydt65m7t-thang-may-gia-162-pr13576825.htm", "code": "13576825", "title": "Cần tiền bán gấp MP Hoàng Ngân - Lê Văn Lương Trung Hòa - Cầu Giấy - 65m2*7T, thang máy. 16.2 tỷ", "description": "Cần tiền bán gấp MP Hoàng Ngân - Lê Văn Lương Trung Hòa - Cầu Giấy - 65m2*7T, thang máy. 16.2 tỷ      Khu vực:    Bán nhà mặt phố tại Đường Hoàng Ngân  - Quận Cầu Giấy - Hà Nội     Giá:   16.2 Tỷ  Diện tích:  65 m²       Thông tin mô tả    Bán nhà mặt phố giá phân lô. Chính chủ bán nhà mặt Phố Hoàng Ngân - Trung Hòa - Cầu Giấy. Diện tích 65m2 xây 7 tầng thang máy, full nội thất chỉ việc xách vali về ở. Rất thuận tiện cho kinh doanh, cho thuê văn phòng, spa, phòng khám thiết kế siêu đẹp. Nội thất đẹp như biệt thự cao cấp. Phong thủy rất tốt, công năng sử dụng hợp lý: - Tầng 1,2,3: Thiết kế thông phòng. - Tầng 4: Phòng ngủ, phòng để quần áo, nhà vs vip có xông hơi, xông khô. - Tầng 5: Thiết kế 2 phòng ngủ, Phòng VS lớn. - Tầng 6: Thiết phòng bếp, phòng khách để thông rất rộng và thoáng. - Tầng 7: Thiết phòng thờ, sân phơi. + Nội thất: Full nội thất. Nội thất sang trọng như biệt thự cao cấp, thiết bị điện Panasonic, của cuốn Bossdoor, bình nóng lạnh, điều hòa toàn hàng xịn. Nội thất trong nhà là hàng nhập. + Vị trí: Nhà nằm ở vị trí đắc địa giao của 3 phố, Kinh doanh sầm uất giáp trường học, chợ, giao thông thuận tiện, hạ tầng đồng bộ. Sổ đỏ chính chủ, pháp lý đầy đủ, mua bán nhanh gọn. Giá bán 16.2 tỷ (có thương lượng, bao phí sang tên). Liên hệ: Anh Thiệp 0968148961 (miễn trung gian). + Quá rẻ quá hợp lý. Vậy còn chờ gì nữa mà không nhấc máy lên gọi để dc đi xem nhà miễn phí ngay hôm nay!          Tìm kiếm theo từ khóa :  Bán nhà mặt phố quận Cầu Giấy ,  Bán nhà mặt phố đường Hoàng Ngân quận Cầu Giấy               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản       