{"url": "https://dothi.net/ban-nha-mat-pho-duong-tran-duy-hung-7/ban-toa-nha-mat-pho-tran-duy-hung-105m2-7-tang-thang-may-44-ty-0961450400-pr13523648.htm", "code": "13523648", "title": "Bán tòa nhà mặt phố Trần Duy Hưng, 105m2, 7 tầng thang máy, 44 tỷ. 0961450400", "description": "Bán tòa nhà mặt phố Trần Duy Hưng, 105m2, 7 tầng thang máy, 44 tỷ. 0961450400      Khu vực:    Bán nhà mặt phố tại Đường Trần Duy Hưng  - Quận Cầu Giấy - Hà Nội     Giá:   44 Tỷ  Diện tích:  105 m²       Thông tin mô tả    Mặt phố lớn - kinh doanh - 7 tầng thang máy - hiệu suất cho thuê cao. + Nhà thiết kế đẹp, chủ đang cho thuê làm karaoke gồm 7 tầng, mỗi tầng 2 phòng, có thang máy trong đó có 1 tầng hầm. Bên ngoài chủ làm cầu thang bộ thoát hiểm với đặc thù kinh doanh phòng hát. + Vị trí mặt phố, giao thông đi lại đông đúc, kinh doanh vô cùng sầm uất, đường rộng, khu phố thuận tiện làm trụ sở công ty, ngân hàng, văn phòng trưng bày, phòng giao dịch, karaoke. + Địa điểm ngay, gần Nguyễn Chí Thanh, trung tâm Hội Nghị Quốc Gia, tòa Charmvit, Grand Plaza, Keangnam,... + Sổ đẹp, chủ nhiệt tình và luôn sẵn sàng đàm phán, giao dịch khi khách thích. + Với diện tích 105m2, 7 tầng thang máy hiện đại, giá chỉ 44 tỷ. Quý khách có nhu cầu vui lòng liên hệ Mr Hải 0946805108 để biết thêm chi tiết. + Chuyên nhà phố kinh doanh hiệu suất cao khu vực Trần Duy Hưng, Hoàng Đạo Thúy, Nguyễn Chí Thanh, Hoàng Ngân, Nguyễn Thị Định.              Hình ảnh  ()   Bản đồ                                       Đặc điểm bất động sản         Mã số    13523648       Loại tin rao    Bán nhà mặt phố (nhà mặt tiền trên các tuyến phố)       Ngày đăng tin    04/12/2020       Ngày hết hạn    04/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền    8 m       Số tầng    7       Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Phạm Văn Hải       Địa chỉ    Đường Trần Duy Hưng, Cầu Giấy, Hà Nội       Điện thoại    0987866900       Di đ