{"url": "https://dothi.net/ban-nha-mat-pho-duong-hoang-ngan-phuong-trung-hoa-4/giam-gia-ban-nhanh-mat-pho-hoang-ngan-le-van-luong-trung-hoa-dt-65m2-7t-thang-may-gia-162-ty-pr13451510.htm", "code": "13451510", "title": "Giảm giá bán nhanh mặt phố Hoàng Ngân - Lê Văn Lương Trung Hòa DT 65m2 * 7T thang máy. Giá 16.2 tỷ", "description": "Giảm giá bán nhanh mặt phố Hoàng Ngân - Lê Văn Lương Trung Hòa DT 65m2 * 7T thang máy. Giá 16.2 tỷ      Khu vực:    Bán nhà mặt phố tại Đường Hoàng Ngân  - Quận Cầu Giấy - Hà Nội     Giá:   16.2 Tỷ  Diện tích:  65 m²       Thông tin mô tả    Giảm giá sập sàn bán nhanh trong tuần nhà mặt phố giá rẻ như như nhà phân lô siêu đẹp phố Hoàng Ngân - Trung Hòa - Cầu Giấy. Diện tích 65m2 xây 7 tầng thang máy, full nội thất chỉ việc xách vali về ở. Rất thuận tiện cho kinh doanh, cho thuê văn phòng, spa, phòng khám thiết kế siêu đẹp. Nội thất đẹp như biệt thự cao cấp. Phong thủy rất tốt, công năng sử dụng hợp lý: - Tầng 1,2,3: Thiết kế thông phòng. - Tầng 4: Phòng ngủ, phòng để quần áo, nhà vs vip có xông hơi, xông khô. - Tầng 5: Thiết kế 2 phòng ngủ, phòng vs lớn. - Tầng 6: Thiết phòng bếp, phòng khách để thông rất rộng và thoáng. - Tầng 7: Thiết phòng thờ, sân phơi. + Nội thất: Full nội thất. Nội thất sang trọng như biệt thự cao cấp, thiết bị điện Panasonic, cửa cuốn Bossdoor, bình nóng lạnh, điều hòa toàn hàng xịn. Nội thất trong nhà là hàng nhập. + Vị trí: Nhà nằm ở vị trí đắc địa giao của 3 phố, Kinh doanh sầm uất giáp trường học, chợ, giao thông thuận tiện, hạ tầng đồng bộ. Sổ đỏ chính chủ, pháp lý đầy đủ, mua bán nhanh gọn. Giá bán 16.2 tỷ (có thương lượng, bao phí sang tên). Liên hệ: Anh Thiệp 0968148961 (miễn trung gian). + Quá rẻ quá hợp lý. Vậy còn chờ gì nữa mà không nhấc máy lên gọi để dc đi xem nhà miễn phí ngay hôm nay!          Tìm kiếm theo từ khóa :  Bán nhà mặt phố quận Cầu Giấy ,  Bán nhà mặt phố đường Hoàng Ngân quận Cầu Giấy               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    13451510       Loại tin rao    Bán nhà mặt phố (nhà mặt tiền trên các tuyến phố)       Ngày đăng tin    14/01/2021       Ngày hết hạn    28/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    3       Đường vào    10 m       Mặt tiền    4.5 m       Số tầng    7       Số toilet    6       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Trịnh Thiệp       Địa chỉ    Cầu giấy - HN       Điện thoại    0968148961       Di động    0968148961       Email     <!-- document.write(\"&#116;&#104;&#105;&#101;&#112;&#120;&#57;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0968148961"}
{"url": "https://dothi.net/ban-nha-rieng-duong-bo-de-phuong-bo-de/nha-bo-de-long-bien-thang-may-len-xuong-khong-moi-chan-hien-dai-o-to-tranh-dien-tich-khung-pr13451798.htm", "code": "13451798", "title": "Nhà Bồ Đề, Long Biên, thang máy lên xuống không mỏi chân, hiện đại, ô tô tránh, diện tích khủng", "description": "Nhà Bồ Đề, Long Biên, thang máy lên xuống không mỏi chân, hiện đại, ô tô tránh, diện tích khủng      Khu vực:    Bán nhà riêng tại Đường Bồ Đề  - Quận Long Biên - Hà Nội     Giá:   8.6 Tỷ  Diện tích:  87 m²       Thông tin mô tả    - Vị trí nhà nằm giữa hai hồ Lâm Du và Bồ Đề. Siêu phẩm nhà siêu đẹp, phân lô, ô tô tránh nhau thoải mái. Từ nhà ra phố Ái Mộ, Hoàng Như Tiếp, Hồng Tiến, Nguyễn Văn Cừ, Nguyễn Sơn cực gần. - Nhà có thang máy, để ở hay làm văn phòng thì đều phù hợp và trên cả tuyệt vời. Gara ô tô cực rộng, không lo thiếu diện tích để xe. - Nhà mới cứng 5 tầng đẹp long lanh, cầu thang giữa, thang máy Mitsubishi cực xịn và bền. + Tầng 1: Gara + Bếp + Phòng ăn + WC. + Tầng 2: Phòng khách + Phòng ngủ. + Tầng 3, 4: Mỗi tầng 2 phòng ngủ + WC khép kín. + Tầng 5: 1 phòng rộng + sân phơi. - Tiện ích bạt ngàn: Giao thông đi lại thuận tiện, chỉ vài bước ra mặt phố Hồng Tiến, lên cầu Chương Dương chỉ mất 1 phút, lên cầu Long Biên chỉ 2 phút và 5 phút để đến trung tâm quận Hoàn Kiếm, xung quanh đầy đủ tiện ích chợ dân sinh, bệnh viện, trường học các cấp từ mầm non, đến các trung tâm thương mại, siêu thị lớn như AEON Mall Long Biên, BigC Long Biên, Mipec Long Biên cực gần. - Khu dân cư dân trí cao, an ninh cực tốt, xứng đáng an sinh, an dưỡng lâu dài. - Diện tích 87m2/sàn. Mặt tiền rộng 4.5m. - Sổ đỏ chính chủ, sẵn sàng giao dịch ngay trong ngày. Giấy tờ pháp lý rõ ràng. - Giá: 8.6 tỷ. Miễn môi giới và trung gian..! Liên hệ: Mr. Phúc: 07.74.71.72.73. (Tư vấn pháp lý, xem nhà hoàn toàn miễn phí).          Tìm kiếm theo từ khóa :  Bán nhà gần cầu Chương Dương quận Long Biên ,  Bán nhà phường Bồ Đề quận Long Biên ,  Bán nhà đường Bồ Đề quận Long Biên ,  Bán nhà quận Long Biên ,  Bán nhà gần Aeon Mall quận Long Biên ,  Bán nhà gần cầu Long Biên quận Long Biên               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13451798       Loại tin rao    Bán nhà riêng       Ngày đăng tin    29/12/2020       Ngày hết hạn    12/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    5       Đường vào    6 m       Mặt tiền    4.5 m       Số tầng    5       Số toilet    3       Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Hữu Phúc       Địa chỉ           Điện thoại           Di động    0774717273       Email     <!-- document.write(\"&#110;&#103;&#117;&#121;&#101;&#110;&#104;&#117;&#117;&#112;&#104;&#117;&#99;&#49;&#48;&#48;&#50;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0774717273"}
