{"url": "https://dothi.net/ban-nha-rieng-duong-huynh-tan-phat-phuong-tan-thuan-tay-1/nha-that-gan-mat-tien-huynh-tan-phat-kinh-doanh-hxh-110m2-gia-chi-775-ty-0932828672-pr13527729.htm", "code": "13527729", "title": "Nhà thật gần mặt tiền Huỳnh Tấn Phát, kinh doanh, HXH, 110m2, giá chỉ 7.75 tỷ. 0932828672", "description": "Nhà thật gần mặt tiền Huỳnh Tấn Phát, kinh doanh, HXH, 110m2, giá chỉ 7.75 tỷ. 0932828672      Khu vực:    Bán nhà riêng tại Đường Huỳnh Tấn Phát  - Quận 7 - Hồ Chí Minh     Giá:   7.75 Tỷ  Diện tích:  110 m²       Thông tin mô tả    Nhà thật gần mặt tiền Huỳnh Tấn Phát, kinh doanh, HXH, 110m2, giá chỉ 7.75 tỷ. 0932828672. + Nhà diện tích lớn 110m2, ở thì xây theo phong cách tân cổ điển, kinh doanh xây văn phòng hay dịch vụ nhà trọ đa tiện nghi cho cán bộ công nhân, sinh viên tại khu chế xuất Tân Thuận đang rất hot. + Vị trí một bước là ra ngay mặt tiền đường Huỳnh Tấn Phát, qua cầu Tân Thuận là đến Nguyễn Tất Thành Quận 4, Quận 1, Bùi Văn Ba, Nguyễn Văn Linh, Trần Xuận Soạn, Phú Mỹ Hưng, tập trung các cơ sở kinh doanh, sầm uất. + Trước nhà đường hẻm 5m, sạch sẽ, an ninh. + Kinh doanh lợi nhuận cao, nở hậu tiền vô như nước Giá chỉ 7.75 tỷ (TL). + Alo cho em Thủy 0932828672 xem ngay tết rồi.              Hình ảnh  ()   Bản đồ                               Đặc điểm bất động sản         Mã số    13527729       Loại tin rao    Bán nhà riêng       Ngày đăng tin    17/12/2020       Ngày hết hạn    17/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào    5 m       Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Lương Thị Thanh Thủy       Địa chỉ    Đường Huỳnh Tấn Phát, phường Tân Thuận Tây, Quận 7, Hồ Chí Minh       Điện thoại    0824334635       Di động    0824334635       Email     <!-- document.write(\"&#108;&#117;&#111;&#110;&#103;&#116;&#104;&#105;&#116;&#104;&#97;&#110;&#104;&#116;&#104;&#117;&#121;&#49;&#57;&#57;&#48;&#64;&#103;&#109;