{"url": "https://dothi.net/ban-nha-rieng-duong-huynh-tan-phat-phuong-tan-thuan-tay-1/chinh-chu-ban-gap-nha-vuot-tet-hxh-duong-huynh-tan-phat-quan-7-100m2-0932828672-pr13527728.htm", "code": "13527728", "title": "Chính chủ bán gấp nhà vượt tết, HXH đường Huỳnh Tấn Phát Quận 7, 100m2. 0932828672", "description": "Chính chủ bán gấp nhà vượt tết, HXH đường Huỳnh Tấn Phát Quận 7, 100m2. 0932828672      Khu vực:    Bán nhà riêng tại Đường Huỳnh Tấn Phát  - Quận 7 - Hồ Chí Minh     Giá:   7.8 Tỷ  Diện tích:  100 m²       Thông tin mô tả    Chính chủ bán gấp nhà vượt Tết, HXH đường Huỳnh Tấn Phát Quận 7, 100m2. 0932828672. + Vị trí đẹp, một bước là qua ngay Quận 4, giáp Quận 1 phồn vinh, nằm trên đầu đường Huỳnh Tấn Phát cầu Tân Thuận, Khu Chế Xuất Tân Thuận, đi đâu cũng tiện. + Hẻm trước nhà 5m, cách mặt tiền chỉ 30 giây, an ninh, dân trí. + Nhà 100m2, các thông số đầy tài lộc, ở hay kinh doanh thì không cần phải bàn, xây mới làm căn hộ dịch vụ, hay công ty, vì gần khu chế xuất lượng lớn nhân viên muốn tìm nơi ở yên tĩnh, dân trí để ngủ nghỉ. + Nhà đang có 3 phòng cho bà con thuê tổng 15tr. + Không quy hoạch, không lộ giới. + Giá chỉ 7.8 tỷ còn thương lượng sâu. Alo cho em Thủy cháu chủ nhà 0932828672, xem nhà luôn ah.              Hình ảnh  ()   Bản đồ                               Đặc điểm bất động sản         Mã số    13527728       Loại tin rao    Bán nhà riêng       Ngày đăng tin    14/12/2020       Ngày hết hạn    14/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào    5 m       Mặt tiền    5 m       Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Lương Thị Thanh Thủy       Địa chỉ    Đường Huỳnh Tấn Phát, phường Tân Thuận Tây, Quận 7, Hồ Chí Minh       Điện thoại    0824334635       Di động    0824334635       Email     <!-- document.write(\"&#108;&#117;&#111;&#110;&#103;&#116;&#104;&#105;&#116;&#104;&#97;&#110;&#104;&#116;&#104;&#117;&#121;&#49;&#57;&#57;&#48;&#64;&#103