{"url": "https://dothi.net/ban-dat-duong-kim-giang-xa-thanh-liet/dat-kim-giang-thanh-liet-48m2-55-mt-28-ty-pr13569266.htm", "code": "13569266", "title": "Đất Kim Giang, Thanh Liệt, 48m2, 5.5m MT, 2.8 tỷ", "description": "Đất Kim Giang, Thanh Liệt, 48m2, 5.5m MT, 2.8 tỷ      Khu vực:    Bán đất tại Đường Kim Giang  - Huyện Thanh Trì - Hà Nội     Giá:   2.8 Tỷ  Diện tích:  48 m²       Thông tin mô tả    Ngõ ô tô thông rộng đẹp - khu dân trí cao - ô tô 4 chỗ chui nhà - vip nhất thanh trì. Mô tả: - Vị trí chỉ cách mặt đường Kim Giang chừng 50m, ngõ rộng taxi tránh. Đường trước nhà thoáng sạch nông, 4 chỗ vào nhà. Ngõ 816 thông đường Thanh Liệt, gần trung tâm huấn luyện thể thao Bộ Công an - khu vực đang phát triển cực mạnh chính là Siêu dự án The Manor Central Park. Bên kia sông là khu đô thị Linh Đàm sầm uất. - Vị trí cực kỳ đắc địa bởi nằm tại trung tâm hàng chục khu đô thị và dự án lớn, thừa hưởng vô vàn tiện ích. - Nhà hiện trạng 1 tầng đang cho thuê với tổng diện tích gần 50m2, điện nước sẵn có. Xung quanh hàng xóm đều khá giả, nhà cửa khang trang tuyệt đẹp. Mặt tiền rộng 5,5m hứa hẹn một ngôi nhà 5 - 6 tầng hoành tráng, khách mua sẽ mãn nguyện với vị trí và tầm tài chính hơn 2 tỷ. Nay mai khi được lên quận Thanh Trì thì giá trị ngôi nhà tăng gấp bội phần. - Sổ đỏ chính chủ, pháp lý chuẩn, giá cả hợp lý so với khu vực. - LH Trần Phúc: 0926.860.643/ 0365.279.683 để được tư vấn và xem nhà miễn phí.          Tìm kiếm theo từ khóa :  Bán đất xã Thanh Liệt huyện Thanh Trì ,  Bán đất huyện Thanh Trì ,  Bán đất đường Kim Giang huyện Thanh Trì ,  Bán đất ngõ 816 đường Kim Giang               Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13569266       Loại tin rao    Bán đất       Ngày đăng tin    09/03/2021       Ngày hết hạn    23/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào    4 m       Mặt tiền    5.5 m       Số tầng           Số toilet           Nội thất   