{"url": "https://dothi.net/ban-nha-rieng-pho-lac-trung-phuong-vinh-tuy/ban-nha-lac-trung-o-to-tranh-50m2-6-tang-nhinh-8ty-pr13647893.htm", "code": "13647893", "title": "Bán nhà Lạc Trung - ô tô tránh - 50m2 - 6 tầng - nhỉnh 8tỷ", "description": "Bán nhà Lạc Trung - ô tô tránh - 50m2 - 6 tầng - nhỉnh 8tỷ      Khu vực:    Bán nhà riêng tại Phố Lạc Trung  - Quận Hai Bà Trưng - Hà Nội     Giá:   8.2 Tỷ  Diện tích:  50 m²       Thông tin mô tả    Bán gấp nhà phân lô vip Hai Bà Trưng - 2 thoáng - 50m2 - 6 tầng - nhỉnh 8tỷ. Gia chủ cần bán gấp nhà phố Lạc Trung. Vị trí thuộc khu Vip phân lô cán bộ riêng biệt khu toàn cán bộ Bộ công thương. - Trước nhà ngõ rộng 7 chỗ tránh nhau vô tư, cách tổ hợp thương mại Time City chỉ 200m, xe máy bốc đầu 5p lên phố Huế, 10p đến hồ Gươm, trường học các cấp, bệnh viện, công viên xung quanh khu vực chẳng thiếu thứ gì. - Nhà thiết kế từ tầng 2 phòng tổng 8 phòng ngủ. - Tầng 1 Gara ô tô, nhà ăn. - Chủ mới mua làm văn phòng hoặc cho thuê dòng đều tuyệt vời.          Tìm kiếm theo từ khóa :  Bán nhà phố Lạc Trung quận Hai Bà Trưng ,  Bán nhà phường Vĩnh Tuy quận Hai Bà Trưng ,  Bán nhà quận Hai Bà Trưng               Hình ảnh  ()   Bản đồ                                                                           Đặc điểm bất động sản         Mã số    13647893       Loại tin rao    Bán nhà riêng       Ngày đăng tin    28/06/2021       Ngày hết hạn    12/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    8       Đường vào    8 m       Mặt tiền    4.5 m       Số tầng    6       Số toilet    6       Nội thất                 Thông tin liên hệ       Tên liên lạc    Ngân Thổ Cư       Địa chỉ    Hai Bà Trưng - Hà Nội       Điện thoại    0812383898       Di động    0812383898       Email     <!-- document.write(\"&#107;&#117;&#122;&#52;&#105;&#108;&#117;&#118;&#57;&#120;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.