{"url": "https://dothi.net/ban-nha-mat-pho-pho-thai-ha-phuong-trung-liet/hiem-mat-tien-lon-kd-dinh-ban-nha-mat-pho-thai-ha-7-tang-134m2-mt-65m-gia-543-ty-pr13654808.htm", "code": "13654808", "title": "Hiếm, mặt tiền lớn KD đỉnh, bán nhà mặt phố Thái Hà 7 tầng, 134m2, MT 6.5m, giá 54,3 tỷ", "description": "Hiếm, mặt tiền lớn KD đỉnh, bán nhà mặt phố Thái Hà 7 tầng, 134m2, MT 6.5m, giá 54,3 tỷ      Khu vực:    Bán nhà mặt phố tại Phố Thái Hà  - Quận Đống Đa - Hà Nội     Giá:   54.3 Tỷ  Diện tích:  134 m²       Thông tin mô tả    + Vị trí đẹp mặt phố Thái Hà, phố kinh doanh hot nhất Q. Đống Đa, đủ mọi loại ngành nghề và dịch vụ và rất hiếm nhà bán do nhu cầu thuê mặt bằng, tòa nhà kinh doanh nhà hàng và VP trụ sở công ty luôn cao:    + Nhà 7 tầng DT 134m2, mặt tiền 6.5m, xây dựng rất chắc chắn đầy đủ giấy phép XD và PCCC.    + Thiết kế: 1 hầm để + 1 tần lửng.    + Tầng 2 đến 6 thông sàn vp + vs, có thể chia phòng tùy vào mục đích sử dụng.    + Trang bị hệ thống thang máy nhập khẩu, điều hòa âm trần. Phù hợp làm vp cty hoăc cho thuê vp hoặc nhà hàng.    + Hiện tại đang có đơn vị ngân hàng thuê lâu dài làm vp với giá cực tốt.    + Sổ đỏ vuông vắn, không lỗi phong thủy, pháp lý đầy đủ, chủ nhà thiện chí mến khách, giao dịch ngay.    + Giá bán 54.3 tỷ có thương lượng - Liên hệ: Trần Hưng 0931572953.          Tìm kiếm theo từ khóa :  Bán nhà mặt phố Đống Đa ,  Bán nhà mặt phố Thái Hà Đống Đa               Hình ảnh  ()   Bản đồ                                                       Đặc điểm bất động sản         Mã số    13654808       Loại tin rao    Bán nhà mặt phố (nhà mặt tiền trên các tuyến phố)       Ngày đăng tin    16/06/2021       Ngày hết hạn    16/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    6       Đường vào    30 m       Mặt tiền    6.5 m       Số tầng    7       Số toilet    6       Nội thất                 Thông tin liên hệ       Tên liên lạc    Trần Hưng       Địa chỉ           Điện thoại           Di động    0931572953       Emai