{"url": "https://dothi.net/ban-dat-nen-du-an-duong-nguyen-ai-quoc-phuong-buu-long/ket-tien-ban-gap-lo-dat-buu-long-ngay-song-ngu-lac-hong-va-can-nha-dep-gia-tot-pr13499297.htm", "code": "13499297", "title": "Kẹt tiền bán gấp lô đất Bửu Long ngay song ngữ Lạc Hồng. Và căn nhà đẹp giá tốt", "description": "Kẹt tiền bán gấp lô đất Bửu Long ngay song ngữ Lạc Hồng. Và căn nhà đẹp giá tốt      Khu vực:    Bán đất nền dự án tại Đường Nguyễn Ái Quốc  - Thành phố Biên Hòa - Đồng Nai     Giá:   3.2 Tỷ  Diện tích:  125.3 m²       Thông tin mô tả    - Còn lô đất KDC Bửu Long bên khu song ngữ Lạc Hồng. Giá quá tốt so với xung quanh. - Sổ sẵn công chứng luôn, 125,3 m2. - Diện tích 4.5 x 28m. - Hướng Nam. - Mặt đường đối diện trường song ngữ Lạc Hồng đi vào, gần ngay nhà hàng hải sản Phú Quý. - Có trước vỉa hè sau lối thoát hiểm. - Đất vuông vức tiện ích xung quanh đầy đủ một nơi đáng sống trong TP Biên Hòa. - Cần bán gấp. - Giá bán chỉ 3 tỷ 2. - Sổ hồng sẵn sang tên thuế phí đã đóng đầy đủ. - LH:. Gặp Lâm làm việc.          Tìm kiếm theo từ khóa :  Bán đất nền thành phố Biên Hòa ,  Bán đất nền phường Bửu Long thành phố Biên Hòa ,  Bán đất nền đường Nguyễn Ái Quốc thành phố Biên Hòa ,  Bán đất nền gần khu Song Ngữ Lạc Hồng thành phố Biên Hòa               Hình ảnh  ()   Bản đồ                                                                                   Đặc điểm bất động sản         Mã số    13499297       Loại tin rao    Bán đất nền dự án (đất trong dự án quy hoạch)       Ngày đăng tin    02/01/2021       Ngày hết hạn    16/01/2021       Hướng nhà    Nam       Hướng ban công           Số phòng           Đường vào    8 m       Mặt tiền    4.5 m       Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Dauvanlam       Địa chỉ           Điện thoại           Di động    0376660689       Email     <!-- document.write(\"&#76;&#97;&#109;&#46;&#116;&#105;&#115;&#117;&#110;&#104;&#117;&#109;&#111;&#64;&#103;&#109;&#97;&#105;&#108;&#46;