{"url": "https://dothi.net/ban-dat-nen-du-an-pho-nam-cao-phuong-phuoc-tan/khu-do-thi-nam-long-dong-nai-waterfront-spring-pr13467805.htm", "code": "13467805", "title": "Khu đô thị Nam Long Đồng Nai - WaterFront Spring", "description": "Khu đô thị Nam Long Đồng Nai - WaterFront Spring      Khu vực:    Bán đất nền dự án tại Phố Nam Cao  - Thành phố Biên Hòa - Đồng Nai     Giá:   3.5 Tỷ  Diện tích:  100 m²       Thông tin mô tả    Chủ đầu tư Nam Long ra mắt sản phẩm mới. Liền kề Aqua City, đợt 1 sẽ mở bán 300 sản phẩm. https://www.home-vn.com/dat-nen-biet-thu/nam-long-dong-nai WaterFront cách Quận 9 sông Đồng Nai, nằm trên trục đường Nam Cao kết nối lên cao tốc Long Thành - Dầu Giây. Liền kề AquaCity (Novaland), gần sân golf Long Thành. Vị trí đẹp nhất khu vực. Giá cả hợp lý.          Tìm kiếm theo từ khóa :  Bán đất nền Khu Đô Thị Nam Long ,  Bán đất nền thành phố Biên Hòa ,  Bán đất nền gần sông Đồng Nai thành phố Biên Hòa               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13467805       Loại tin rao    Bán đất nền dự án (đất trong dự án quy hoạch)       Ngày đăng tin    22/12/2020       Ngày hết hạn    21/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào    24 m       Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Nguyễn Nhân Hiếu       Địa chỉ           Điện thoại           Di động    0902548348       Email     <!-- document.write(\"&#104;&#105;&#101;&#117;&#110;&#103;&#117;&#121;&#101;&#110;&#46;&#105;&#115;&#117;&#122;&#117;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0902548348"}
