{"url": "https://dothi.net/ban-nha-mat-pho-duong-nguyen-thai-hoc-phuong-van-mieu/ban-nha-mat-pho-nguyen-thai-hocvia-hekd95m-x-7-tangmt20mlo-goc475-ty-pr13532125.htm", "code": "13532125", "title": "Bán nhà mặt phố Nguyễn Thái Học, vỉa hè - KD - 95m2 x 7 Tầng, MT: 20m, lô góc, 47.5 tỷ", "description": "Bán nhà mặt phố Nguyễn Thái Học, vỉa hè - KD - 95m2 x 7 Tầng, MT: 20m, lô góc, 47.5 tỷ      Khu vực:    Bán nhà mặt phố tại Đường Nguyễn Thái Học  - Quận Đống Đa - Hà Nội     Giá:   47.5 Tỷ  Diện tích:  95 m²       Thông tin mô tả    Bán nhà mặt phố Nguyễn Thái Học - Vỉa hè rộng, Lô góc, Kinh doanh đa dịch vụ, nội thất sịn sò. Diện tích: 95m2 x 7 tầng. Mặt tiền: 20m. Gía: 47.5 tỷ. Mô tả: - Nhà lô góc, vỉa hè rộng. - Nhà 6 tầng 1 tum: + Tầng 1 - 3 là không gian cho thuê 100 triệu/tháng. + Tầng 4,5,6: Tầng riêng chủ ở. - Hệ điều hòa từ tầng 1 ~3 riêng biệt loại Dakin âm trần, Từ tầng 4~6 là Điều hòa Dakin rạng bán tổng. - Thang máy và đường ra vào cho tầng 2 ~6 là riêng biệt, cuối nhà. - Toàn bộ thiết bị vệ sinh là hàng nhập khẩu 1 hãng Dealim bath, Smarlet (có nghĩa là tự động hoàn toàn) đường điện hiện đại, hệ thống máy phát điện dự phòng tự động khởi động khi mất điện. - Sổ đỏ pháp lý rõ ràng. - Liên hệ: Hoa Xinh Xinh.          Tìm kiếm theo từ khóa :  Bán nhà mặt phố đường Nguyễn Thái Học quận Đống Đa ,  Bán nhà mặt phố quận Đống Đa               Hình ảnh  ()   Bản đồ                                                           Đặc điểm bất động sản         Mã số    13532125       Loại tin rao    Bán nhà mặt phố (nhà mặt tiền trên các tuyến phố)       Ngày đăng tin    04/02/2021       Ngày hết hạn    18/02/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Bán Nhà Mỗ Lao-2 Mặt Tiền-Ô Tô-KD-50M2 X 7Taangf-MT:6M-8.2Tỷ       Địa chỉ    Hà Đông, Hà Nội, -Dự án-       Điện thoại    0966148588       Di động  