{"url": "https://dothi.net/ban-dat-duong-hoang-dao-thanh-phuong-kim-giang-1/ban-gap-100m2-dat-thanh-xuan-mat-tien-88m-o-to-tranh-kinh-doanh-vp-chi-68-ty-pr13508902.htm", "code": "13508902", "title": "Bán gấp 100m2 đất Thanh Xuân mặt tiền 8.8m ô tô tránh kinh doanh VP chỉ 6.8 tỷ", "description": "Bán gấp 100m2 đất Thanh Xuân mặt tiền 8.8m ô tô tránh kinh doanh VP chỉ 6.8 tỷ      Khu vực:    Bán đất tại Đường Hoàng Đạo Thành  - Quận Thanh Xuân - Hà Nội     Giá:   6.8 Tỷ  Diện tích:  100 m²       Thông tin mô tả    Bán trước tết - diện tích rộng mặt tiền khủng ô tô tránh - kinh doanh văn phòng đỉnh. - Mảnh đất hiếm diện tích 100m2 mặt tiền khủng 8.8m nằm ở vị trí trung tâm quận Thanh Xuân được quy hoạch ổn định, kết nối với vành đai 3 (Nguyễn Xiễn), Kim Giang, Khương Đình, Vũ Tông Phan. - Ngõ trước nhà ô tô tránh, vài bước chân ra phố, xung quanh rất phát triển gồm các chung cư cao cấp và các KĐT lớn: Kim Văn, Kim Lũ, Linh Đàm, KĐT The Manor Central Park. Gần cụm trường chuẩn quốc gia mầm non, tiểu học, THCS Kim Giang. Chợ, TTTM vây kín. Khu dân trí cao, anh sinh đỉnh, tập trung các loại hình kinh doanh đa dạng, tiện ích đầy đủ, rất phù hợp xây tòa nhà vừa kinh doanh văn phòng và kết hợp để ở rất lý tưởng. - Sổ đỏ pháp lý chuẩn sẵn sàng giao dịch. - Giá đầu tư hấp dẫn chỉ 6.8 tỷ (thương lượng trực tiếp chủ nhà) nhanh tay nhấc máy liên hệ em Cường: 0965541989 tư vấn, xem nhà, hỗ trợ pháp lý từ A - Z hoàn toàn miễn phí.          Tìm kiếm theo từ khóa :  Bán đất đường Hoàng Đạo Thành quận Thanh Xuân ,  Bán đất quận Thanh Xuân ,  Bán đất gần trung học cơ sở Kim Giang quận Thanh Xuân ,  Bán đất phường Kim Giang quận Thanh Xuân               Hình ảnh  ()   Bản đồ                                                               Đặc điểm bất động sản         Mã số    13508902       Loại tin rao    Bán đất       Ngày đăng tin    11/01/2021       Ngày hết hạn    25/01/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền       