{"url": "https://dothi.net/ban-dat-duong-huu-hoa-xa-huu-hoa/ban-gap-manh-dat-40m2-lo-goc-30m-ra-mat-duong-huu-hoa-cau-to-dai-thanh-pr13545942.htm", "code": "13545942", "title": "Bán gấp mảnh đất 40m2 lô góc 30m ra mặt đường Hữu Hòa, Cầu Tó, Đại Thanh", "description": "Bán gấp mảnh đất 40m2 lô góc 30m ra mặt đường Hữu Hòa, Cầu Tó, Đại Thanh      Khu vực:    Bán đất tại Đường Hữu Hòa  - Huyện Thanh Trì - Hà Nội     Giá:   1.7 Tỷ  Diện tích:  40 m²       Thông tin mô tả    + Cần bán nhanh mảnh đất lô góc ở trục đường Hữu Hòa, Hữu Lê ngay chân cầu Hữu Hòa diện tích 40m2 lô góc, ngõ thẳng tắp 2.5m, cách mặt đường Hữu Hòa 30m ngõ thẳng tắp. + Sổ đỏ riêng chính chủ, đang cần bán gấp, nhà thích hợp với khách mua đầu tư giữ tiền, vợ chồng trẻ mua để ở, vị trí đẹp miễn chê, chủ bán đi cực tiếc nhưng đành ngậm ngùi. + Vị trí gần Cầu Tó, đường 70, KĐT Đại Thanh thông lên KĐT Xa La, Mậu Lương. + Khách thiện trí, có nhu cầu liên hệ Hướng nhà đất số điện thoại 0961.000.863 0945031718 hoặc kết bạn Zalo, để được tư vấn về nhà đất và dẫn xem nhà miễn phí.              Hình ảnh  ()   Bản đồ                               Đặc điểm bất động sản         Mã số    13545942       Loại tin rao    Bán đất       Ngày đăng tin    04/12/2020       Ngày hết hạn    04/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Vũ Đình Hướng       Địa chỉ    Đường Hữu Hòa, xã Hữu Hòa, Thanh Trì, Hà Nội       Điện thoại    0961000863       Di động    0961000863       Email     <!-- document.write(\"&#118;&#117;&#100;&#105;&#110;&#104;&#104;&#117;&#111;&#110;&#103;&#110;&#100;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0961000863"}
{"url": "https://dothi.net/ban-dat-nen-du-an-bien-hoa-city/cdt-hung-thinh-mo-ban-du-an-bien-hoa-new-city-giai-doan-2-gia-goc-14-trm2-hotline-0943557567-pr13560892.htm", "code": "13560892", "title": "CĐT Hưng Thịnh mở bán dự án Biên Hòa New City giai đoạn 2 gía gốc 14 tr/m2. Hotline: 0943557567", "description": "CĐT Hưng Thịnh mở bán dự án Biên Hòa New City giai đoạn 2 gía gốc 14 tr/m2. Hotline: 0943557567      Khu vực:    Bán đất nền dự án tại Biên Hòa City  - Thành phố Biên Hòa - Đồng Nai     Giá:   Thỏa thuận  Diện tích:  250 m²       Thông tin mô tả    CĐT Hưng Thịnh mở bán dự án Biên Hòa New City giai đoạn 2 100/nền biệt thự. - Pháp lý rõ ràng 1/500. - Hạ tầng hoàn thiện. - Loại hình sản phẩm đất nền + sổ đỏ + sân golf. - Giá gốc chủ đầu tư. * Vị trí vàng với tâm điểm kết nối hạ tầng đang được quy hoạch chiến lược như: - Cao tốc Biên Hoà BRVT. - Đường Liên Vùng 4; Vành Đai 3 và đặc biệt là triển khai giai đoạn 1 của sân bay Quốc tế Long Thành. Đất nền + sổ đỏ trao tay + thổ cư 100% + thiết kế hiện đại + tiện ích cao cấp + an ninh 24/24 + bệnh viện + trường học mầm non (cấp 1 cấp 2) + khu hành chính + khu y tế. Tiện ích dự án: + Sân golf 36 lỗ. + Bến du thuyền. + Club house. + Khu TM dịch vụ - giải trí hồ bơi. Thanh toán linh hoạt từ 6 - 12 tháng. Diện tích đa dạng: - Nhà phố: 90m2 - 100m2 - 120m2. - Biệt thự golf & biệt thự sông: 238m2 - 380m2 - 680m2 - 1200m2. Mọi chi tiết xin liên hệ CĐT Hưng Thịnh: 0943557567 Viết chung.          Tìm kiếm theo từ khóa :  Bán đất nền Biên Hòa ,  Bán đất nền Biên Hòa City ,  Bán đất nền gần sân bay quốc tế Long Thành Biên Hòa               Hình ảnh  ()   Bản đồ                                                                       Đặc điểm bất động sản         Mã số    13560892       Loại tin rao    Bán đất nền dự án (đất trong dự án quy hoạch)       Ngày đăng tin    10/03/2021       Ngày hết hạn    24/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền    13 m       Số t