{"url": "https://dothi.net/ban-nha-rieng-duong-ho-van-hue-phuong-9-12/gap-nha-4-lau-dep-lung-linh-hxh-7-cho-gan-mat-tien-ho-van-hue-p9-pn-5x13m-gia-98-ty-0938214886-pr13536701.htm", "code": "13536701", "title": "Gấp! Nhà 4 lầu đẹp lung linh, HXH 7 chỗ, gần mặt tiền Hồ Văn Huê, P. 9, PN, (5x13m) giá 9.8 tỷ", "description": "Gấp! Nhà 4 lầu đẹp lung linh, HXH 7 chỗ, gần mặt tiền Hồ Văn Huê, P. 9, PN, (5x13m) giá 9.8 tỷ      Khu vực:    Bán nhà riêng tại Đường Hồ Văn Huê  - Quận Phú Nhuận - Hồ Chí Minh     Giá:   9.8 Tỷ  Diện tích:  65 m²       Thông tin mô tả    Cần tiền bán gấp nhà 4 lầu đẹp lung linh, HXH 7 chỗ đậu trong nhà Hồ Văn Huê, P. 9, PN, (5x13m) giá 9.8 tỷ. Diện tích: 5x13m, DTCN 65m2. Nhà kết cấu trệt, lửng, 3 lầu + sân thượng, nhà thiết kế hiện đại gồm phòng khách lớn, bếp, 5 phòng ngủ, phòng làm việc, phòng thờ, ban công sân thượng trồng Bonsai... Vị trí nhà trong khu sang trọng, an ninh, cách MT 50m, khu vực kinh doanh sầm uất, trong khu vực tập trung nhiều chi nhánh shop, cao ốc văn phòng, showroom và kinh doanh buôn bán rất sầm uất (thời trang, mỹ phẩm, nhà hàng)... Dân cư an ninh và yên tĩnh, thoáng mát, giao thông đi lại thuận tiện,... Gần các trục đường huyết mạch của thành phố... Khu vực sang trọng rất thích hợp để ở, tiện làm văn phòng đại diện, công ty hoặc kinh doanh spa - mỹ viện... Giá: 9.8 tỷ thương lượng nhanh giá tốt cho khách thiện chí mua nhanh. Miễn trung gian, MG, QC vui lòng đừng gọi em nhé... Liên hệ: 0938 214 886 - Thùy Dung để xem nhà và biết thêm thông tin.              Hình ảnh  ()   Bản đồ                           Đặc điểm bất động sản         Mã số    13536701       Loại tin rao    Bán nhà riêng       Ngày đăng tin    08/12/2020       Ngày hết hạn    08/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    5       Đường vào    6 m       Mặt tiền    5 m       Số tầng    4       Số toilet    6       Nội thất                 Thông tin liên hệ       Tên liên lạc    Dungnguyen1406       Địa chỉ    Đường Hồ Văn Huê, phường 9, Phú Nhuận, Hồ Chí Minh       Điện thoại    0938214886       Di động    0938214886       Email     <!-- document.write(\"&#100;&#117;&#110;&#103;&#110;&#116;&#116;&#50;&#48;&#48;&#53;&#57;&#56;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0938214886"}
{"url": "https://dothi.net/ban-nha-rieng-pho-lac-trung-phuong-thanh-luong/ban-nha-rieng-pho-lac-trung-hai-ba-trungdien-tich-51m2-mat-tien-42m-6-tang-67-ty-pr13566931.htm", "code": "13566931", "title": "Bán nhà riêng phố Lạc Trung - Hai Bà Trưng - diện tích 51m2 - mặt tiền 4,2m - 6 tầng - 6,7 tỷ", "description": "Bán nhà riêng phố Lạc Trung - Hai Bà Trưng - diện tích 51m2 - mặt tiền 4,2m - 6 tầng - 6,7 tỷ      Khu vực:    Bán nhà riêng tại Phố Lạc Trung  - Quận Hai Bà Trưng - Hà Nội     Giá:   6.7 Tỷ  Diện tích:  51 m²       Thông tin mô tả    Bán cực gấp nhà Lạc Trung, Hai Bà Trưng, 51m2, 6 tầng, SĐCC, 20m ra mặt phố, 6,7 tỷ. + Chủ cần bán cực gấp để mua biệt thự. Căn nhà 6 tầng vị trí đẹp, đầy đủ công năng, có gara, ô tô vào tận nhà, thang máy, sổ đỏ đẹp chính chủ, giao dịch ngay. + Vị trí: 20m ra mặt phố Lạc Trung. + Thiết kế: Khung cột bê tông chắc chắn, xây 6 tầng, 4 ngủ, 4wc khép kín. + Tiện ích: Vài phút đi xe ra tổ hợp khu đô thị Times City, trường, chợ xung quanh nhà. + Pháp lý: Sổ đẹp, chính chủ, sẵn sàng giao dịch ngay. Không quy hoạch, tranh chấp. + Giá: Mềm như bún chỉ còn 6,7 tỷ, có thương lượng lộc lá cho khách. + Liên hệ: Em Linh môi giới thổ cư chuyên Hai Bà Trưng, 0329908261 - 0865578865. Hỗ trợ xem nhà và tư vấn pháp lý hoàn toàn miễn phí.          Tìm kiếm theo từ khóa :  Bán nhà phố Lạc Trung quận Hai Bà Trưng ,  Bán nhà quận Hai Bà Trưng ,  Bán nhà phường Thanh Lương quận Hai Bà Trưng               Hình ảnh  ()   Bản đồ                                                       Đặc điểm bất động sản         Mã số    13566931       Loại tin rao    Bán nhà riêng       Ngày đăng tin    22/03/2021       Ngày hết hạn    05/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    4       Đường vào           Mặt tiền    42 m       Số tầng    6       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Vũ Thị Hồng Linh       Địa chỉ    21/54 Mạc Thị Bưởi, Vĩnh Tuy, Hai Bà Trưng, Hà Nội       Điện thoại    0