{"url": "https://dothi.net/ban-can-ho-chung-cu-gamuda-city-gamuda-gardens/ban-can-ho-chung-cu-cao-cap-canh-cong-vien-yen-so-gia-15-ty-0984-888-458-pr13707145.htm", "code": "13707145", "title": "Bán căn hộ chung cư cao cấp cạnh công viên Yên Sở, giá 1,5 tỷ (0984 888 458)", "description": "Bán căn hộ chung cư cao cấp cạnh công viên Yên Sở, giá 1,5 tỷ (0984 888 458)      Khu vực:    Bán căn hộ chung cư tại Gamuda City (Gamuda Gardens)  - Quận Hoàng Mai - Hà Nội     Giá:   1.5 Tỷ  Diện tích:  Không xác định       Thông tin mô tả    Bán căn hộ chung cư cao cấp cạnh công viên Yên Sở, giá 1,5 tỷ (0984 888 458). Kết nối giao thông rất thuận tiện: Đi vào trung tâm Hà Nội bằng tuyến đường Tam Trinh, di chuyển về phía Thanh Xuân, Cầu Giấy, sân bay Nội Bài bằng đường Vành Đai 3. Nằm trong quần thể dự án Gamuda Gardens cách hồ Hoàn Kiếm 7.5 km và 25 phút đi xe. Cách Times city 2.5 km; Cách siêu thị Metro Hoàng Mai khoảng 1Km và gần rất nhiều tiện ích ngoại khu khác. Thiết kế căn hộ Gamuda. Được thiết kế với các loại diện tích rất phù hợp chỉ từ 60 m2 đến 78m2 với căn hộ 2 phòng ngủ và từ 85m2 đến 106 m2 với căn hộ 3 phòng ngủ. Đặc biệt 100% tất cả các căn đều có phòng ngủ, phòng khách của các căn hộ tiếp xúc với gió trời và ánh sáng tự nhiên. Nên đây được xem là ưu điểm vượt trội mà chủ đầu tư Gamuda mang lại cho cư dân của chung cư Gamuda Garden. - Vui lòng liên hệ để biết thông tin chi tiết: Bạn quan tâm liên hệ: Thảo Yến 0398 533 096 - 0984 888 458. Để được tư vấn và xem nhà miễn phí 100% dịch vụ.              Hình ảnh  ()   Bản đồ                           Đặc điểm bất động sản         Mã số    13707145       Loại tin rao    Bán căn hộ chung cư       Ngày đăng tin    25/06/2021       Ngày hết hạn    25/09/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    2       Đường vào           Mặt tiền    4 m       Số tầng           Số toilet    2       Nội thất                 Thông tin liên hệ       Tên liên lạc    Dương Thị Ngọc Yến       Địa chỉ    Dự án Gamud