{"url": "https://dothi.net/ban-nha-rieng-duong-de-tran-khat-chan-phuong-dong-mac/ban-nha-20m2-de-tran-khat-chan-hai-ba-trung-pr13585340.htm", "code": "13585340", "title": "Bán nhà 20m2 Đê Trần Khát Chân - Hai Bà Trưng", "description": "Bán nhà 20m2 Đê Trần Khát Chân - Hai Bà Trưng      Khu vực:    Bán nhà riêng tại Đường Đê Trần Khát Chân  - Quận Hai Bà Trưng - Hà Nội     Giá:   2.1 Tỷ  Diện tích:  20 m²       Thông tin mô tả    Vị trí đẹp - thoáng trước thoáng sau - ở yên tĩnh Đê Trần Khát Chân. Mặt ngõ trước nhà 2 xe máy tránh nhau. Nhà xây khung cột chắc chắn và rất đẹp thích hợp với các gia đình nhỏ. Vị trí giao thông thuận lợi, nhiều tiện ích, gần chợ gần trường học, gần bệnh viện. Diện tích 20m2 mặt tiền 4.3m, xây 4 tầng khép kín: Tầng 1: Để xe, phòng khách - wc. Tầng 2 - 3: Mỗi tầng 1 phòng ngủ - 1 wc. Tầng 4: Bếp, sân phơi - wc. Sổ đỏ vuông vắn, sẵn sàng giao dịch. Giá 2.1 tỷ. LH chính chủ: 0989035383 - miễn môi giới, trung gian.          Tìm kiếm theo từ khóa :  Bán nhà Hai Bà Trưng ,  Bán nhà Đống Mác Hai Bà Trưng ,  Bán nhà Đê Trần Khát Chân Hai Bà Trưng               Hình ảnh  ()   Bản đồ                                                                                       Đặc điểm bất động sản         Mã số    13585340       Loại tin rao    Bán nhà riêng       Ngày đăng tin    02/04/2021       Ngày hết hạn    09/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    2       Đường vào           Mặt tiền    4.3 m       Số tầng    4       Số toilet    4       Nội thất                 Thông tin liên hệ       Tên liên lạc    Trần Phan Khôi       Địa chỉ           Điện thoại           Di động    0989035383       Email     <!-- document.write(\"&#116;&#112;&#107;&#104;&#111;&#105;&#46;&#104;&#110;&#64;&#103;&#109;&#97;&#105;&#108;&#46;&#99;&#111;&#109;\"); //-->   Địa chỉ email này được bảo vệ bởi JavaScript. Bạn cần kích hoạt Javascript để có thể xem.               Lưu tin   In tin này", "phone": "0989035383"}
