{"url": "https://dothi.net/ban-nha-rieng-duong-nguyen-khoai-phuong-bach-dang/ban-nha-nguyen-khoai-nha-mat-pho-o-to-qua-lai-kinh-doanh-hoac-cho-thue-van-phong-gia-sieu-dep-pr13694889.htm", "code": "13694889", "title": "Bán nhà Nguyễn Khoái, gần mặt phố, ô tô qua lại, kinh doanh hoặc cho thuê văn phòng giá siêu đẹp", "description": "Bán nhà Nguyễn Khoái, gần mặt phố, ô tô qua lại, kinh doanh hoặc cho thuê văn phòng giá siêu đẹp      Khu vực:    Bán nhà riêng tại Đường Nguyễn Khoái  - Quận Hai Bà Trưng - Hà Nội     Giá:   3.4 Tỷ  Diện tích:  33 m²       Thông tin mô tả    Mặt phố vị trí đắc địa ô tô qua lại - kinh doanh - văn phòng. Bán nhà Nguyễn Khoái, nhà gần mặt phố, ô tô qua lại, kinh doanh hoặc cho thuê văn phòng giá siêu đẹp 3,4 tỷ. - Thiết kế: + Tầng 1: Khách, bếp, WC. + Tầng 2,3: Mỗi tầng 1 phòng ngủ, 1WC. + Tầng 4: Phòng thờ và sân phơi. - Đường rộng 40m, vỉa hè rộng để ô tô phù hợp ở, kinh doanh hoặc cho thuê văn phòng, khách sạn, spa,... Cách ngã 3 Minh Khai và Nguyễn Khoái 800m. - Toàn bộ nội thất sang trọng trong nhà được chủ nhà tặng lại hết. * Tiện ích: - Gần nhà là chợ, trường học và các trung tâm thương mại lớn,... - Nhà tiện đi các trục Dương Văn Bé, Vĩnh Tuy, Minh Khai, Lạc Trung, gần ngay khu đô thị Time City. Cách time city 2km, cách bờ hồ 4km. - Diện tích 33m2. - Giá: 3.4 tỷ (có thương lượng, sổ đỏ chính chủ). - Liên hệ: Mr. Hùng 0983520623 (xem nhà miễn phí, miễn trung gian, quảng cáo).          Tìm kiếm theo từ khóa :  Bán nhà quận Hai Bà Trưng ,  Bán nhà phường Bạch Đằng quận Hai Bà Trưng ,  Bán nhà đường Nguyễn Khoái quận Hai Bà Trưng ,  Bán nhà gần ngã 3 Minh Khai quận Hai Bà Trưng               Hình ảnh  ()   Bản đồ                                                   Đặc điểm bất động sản         Mã số    13694889       Loại tin rao    Bán nhà riêng       Ngày đăng tin    22/06/2021       Ngày hết hạn    06/07/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng      