{"url": "https://dothi.net/ban-nha-rieng-duong-tay-ket-phuong-bach-dang/ban-nha-rieng-pho-tay-ket-phuong-bach-dang-quan-hai-ba-trung-ha-noi-dien-tich-72m2-pr13493987.htm", "code": "13493987", "title": "Bán nhà riêng phố Tây Kết, Phường Bạch Đằng, Quận Hai Bà Trưng, Hà Nội. Diện tích 72m2", "description": "Bán nhà riêng phố Tây Kết, Phường Bạch Đằng, Quận Hai Bà Trưng, Hà Nội. Diện tích 72m2      Khu vực:    Bán nhà riêng tại Đường Tây Kết  - Quận Hai Bà Trưng - Hà Nội     Giá:   13.8 Tỷ  Diện tích:  72 m²       Thông tin mô tả    Phân lô - mặt tiền rộng - gara ô tô - 3 bước sang phố cổ. + Diện tích cực rộng 72m2, Xây chuẩn 4 tầng, mặt tiền 5.5m, giá 13.8 tỷ. + Trung tâm phố đẹp nhất phường Bạch Đằng, Hai Bà Trưng, Hà Nội. + Đầu tư hôm nay, tương lai mở đường lợi nhuận tăng đủ đường. + Vị trí nhà rất gần Trung tâm phố Cổ, khu dân trí cao, giao thông thuận lợi, xung quanh tiện ích không thiếu thứ gì. Đường rộng, thông thoáng, ô tô ra vào đỗ thoải mái. + Nhà thuê thiết kế và thi công rất chắc chắn, móng 10 tầng, có ô chờ thang máy. Hiện gia đình mới xây 4 tầng, khách mua về có thể xây thêm 3 - 4 tầng nữa để vừa ở vừa kinh doanh làm văn phòng, spa, phòng khám, trường học... Đều rất tuyệt vời. + Nhà nội thất cực xịn. Toàn bộ thiết bị và nội thất đều nhập ngoại. - Tầng 1: Gara, bếp, phòng ăn, phụ. - Tầng 2: Phòng khách cực rộng, phụ. - Tầng 3: Hai phòng ngủ, WC khép kín. - Tầng 4: Phòng thờ, kho, sân phơi. + Sổ đỏ phân lô vuông vắn đẹp hơn hoa hậu. + Liên hệ và xem miễn phí Mr. Hải. Hỗ trợ vay ngân hàng lãi suất ưu đãi và dài hạn.          Tìm kiếm theo từ khóa :  Bán nhà quận Hai Bà Trưng ,  Bán nhà phường Bạch Đằng quận Hai Bà Trưng ,  Bán nhà đường Tây Kết quận Hai Bà Trưng               Hình ảnh  ()   Bản đồ                                                                       Đặc điểm bất động sản         Mã số    13493987       Loại tin rao    Bán nhà riêng       Ngày đăng tin    28/12/2020       Ngày hết hạn    11/01/2021       Hướng nhà    KXĐ       Hướng ban 