{"url": "https://dothi.net/ban-nha-rieng-pho-lo-duc-phuong-dong-mac/sieu-pham-lo-duc-thang-may-gan-pho-45-m2-7-tang-95-ty-pr13610763.htm", "code": "13610763", "title": "Siêu phẩm Lò Đúc thang máy gần phố - 45m2 7 tầng - 9,5 tỷ", "description": "Siêu phẩm Lò Đúc thang máy gần phố - 45m2 7 tầng - 9,5 tỷ      Khu vực:    Bán nhà riêng tại Phố Lò Đúc  - Quận Hai Bà Trưng - Hà Nội     Giá:   9.5 Tỷ  Diện tích:  45 m²       Thông tin mô tả    Một ngôi nhà cực đẹp như tòa lâu đài giữa trung tâm quận Hai Bà, ngay gần ngã tư Lò Đúc - Trần Khát Chân, nhà xây dựng theo lối kiến trúc Tân Cổ Điển, rất sang trọng và hiện đại, gia chủ xây dựng tâm huyết đến từng chi tiết nhỏ, với lợi thế mặt tiền lớn lại thoáng trước, sau nên các phòng trong nhà cực thoáng, đón ánh sáng tự nhiên, nhà có ban công trồng hoa rất đẹp, ban đêm ánh đèn chiếu hắt trông rất lộng lẫy. Vị trí nhà rất trung tâm, vài bước chân là ra phố, vài phút là lên Bờ Hồ, giao thông đi lại rất thuận tiện. Diện tích nhà 45 m2, mặt tiền 8 m, thiết kế 7 tầng thang máy, các thiết bị nội thất nhập khẩu, sàn gỗ, cầu thang gỗ thịt, thiết bị phòng tắm xịn sò. Thiết kế: Tầng 1: Phòng khách rất rộng + Wc, Tầng 2, 3, 4, 5, 6: Mỗi tầng 1 phòng rộng + ban công + Wc. Tầng 7: Bếp + sân vườn café view cầu vượt ngã tư Lò Đúc Trần Khát Chân. Sổ đỏ chính chủ, pháp lý chuẩn. Liên hệ xem nhà: Quang Hưng.          Tìm kiếm theo từ khóa :  Bán nhà phường Đống Mác quận Hai Bà Trưng ,  Bán nhà phố Lò Đúc quận Hai Bà Trưng ,  Bán nhà gần ngã tư Lò Đúc Trần Khát Chân quận Hai Bà Trưng ,  Bán nhà quận Hai Bà Trưng               Hình ảnh  ()   Bản đồ                                                                       Đặc điểm bất động sản         Mã số    13610763       Loại tin rao    Bán nhà riêng       Ngày đăng tin    12/04/2021       Ngày hết hạn    26/04/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    5       Đường vào    3 m       Mặt tiền    8 m       Số tầng    7       Số toilet    6       Nội thất              