{"url": "https://dothi.net/ban-can-ho-chung-cu-mizuki-park/chinh-chu-gui-ban-can-ho-mizuki-park-co-noi-that-72m2-2-phong-ngu-pr13394186.htm", "code": "13394186", "title": "Chính chủ gửi bán căn hộ Mizuki Park có nội thất, 72m2, 2 phòng ngủ", "description": "Chính chủ gửi bán căn hộ Mizuki Park có nội thất, 72m2, 2 phòng ngủ      Khu vực:    Bán căn hộ chung cư tại Mizuki Park  - Huyện Bình Chánh - Hồ Chí Minh     Giá:   2.6 Tỷ  Diện tích:  72 m²       Thông tin mô tả    Chủ thân gửi bán căn hộ chung cư Mizuki Park, của nhật và Nam Long đầu tư. Được thiết kế 72m2, 2 phòng ngủ, 2 vệ sinh, phòng khách, nhà bếp được thiết kế có bếp trên bếp dưới, được tặng bếp từ và máy hút mùi, nhà đã có nội thất, bàn ăn, rèm cửa, máy lạnh kính bếp, máy nước nóng, tất cả như hình, màu xanh nhẹ hơn trong hình xíu. * Vị trí dự án. Nằm trong tổng thể khu đô thị Mizuki Park lớn bậc khu Nam Sài Gòn, ngay mặt tiền đại lộ Nguyễn Văn Linh. + Chỉ 5 phút tới khu Phú Mỹ Hưng Q7. + 10 phút tới trung tâm Q8, Q5, Q4. * Nội thất bàn giao. Sàn gỗ toàn căn hộ, Cửa chống cháy thẩm mỹ cao. Khóa thông minh sang trọng. Tủ bếp trên - dưới, bếp điện từ, máy hút mùi. Thiết bị nhà vệ sinh cap cấp. Videocall tiện lợi. Ngăn phòng, cửa gỗ, nhôm kính. * Tiện ích nội khu free. Hồ bơi người lớn, hồ bơi trẻ em. Sân vườn trên cao có nơi chơi bóng rổ. Khu tiệc BBQ hoạt động ngoài trời. Phòng Gym, phòng Yoga, phòng Bóng bàn. Phòng cộng đồng, khu công viên sinh hoạ. Giai đoạn 2 xây thêm quảng trường đi bộ. Kênh đào có công viên bonsai. * Tiện ích hiện hữu. Siêu thị, nhà thuốc, quán cafe, trường mầm non, quán ăn uống, quán nhậu, sửa xe, văn phòng. Hotline Châu 0704060593.          Tìm kiếm theo từ khóa :  Bán căn hộ Mizuki Park ,  Bán căn hộ huyện Bình Chánh               Hình ảnh  ()   Bản đồ                                                                               Đặc điểm bất động sản         Mã số    13394186       Loại tin rao    Bán căn hộ chung cư       Ngày đăng tin    30/12/2020       Ngày hết hạn    29/01/20