{"url": "https://dothi.net/ban-dat-nen-du-an-kdt-nam-cau-nguyen-tri-phuong/dat-biet-thu-view-song-khu-ntp-hoa-xuan-duong-ton-that-duong-ky-lo-dat-cuc-vip-moi-duoc-ra-lo-pr13494527.htm", "code": "13494527", "title": "Đất biệt thự view sông khu NTP Hoà Xuân đường Tôn Thất Dương Kỵ - lô đất cực vip mới được ra lò", "description": "Đất biệt thự view sông khu NTP Hoà Xuân đường Tôn Thất Dương Kỵ - lô đất cực vip mới được ra lò      Khu vực:    Bán đất nền dự án tại KĐT Nam cầu Nguyễn Tri Phương  - Quận Cẩm Lệ - Đà Nẵng     Giá:   11 Tỷ  Diện tích:  254 m²       Thông tin mô tả    Đất biệt thự view sông khu NTP Hoà Xuân đường Tôn Thất Dương Kỵ. - Lô đất cực vip mới được ra lò. Nhượng lại quyền sở hữu cho những ai yêu thích cái đẹp. - Vị trí đối diện mặt sông Cẩm Lệ, không khí thoáng mát trong lành. Nơi tập trung nhiều đại gia có tên tuổi ở Đà Nẵng. - Gần cầu Hoà Xuân, gần trung tâm Tp, gần chợ, gần bệnh viện, gần trường học. - Khu vực đã xây nhà gần hết, dân cư đông đúc, thích hợp xây biệt thự vườn. - Hướng của lô đất là Tây Bắc, diện tích 254 m2. - Giá bán chính chủ 11 tỷ (miễn trung gian). - Liên hệ 0905288525 Sgd BĐS Đà Thành Đô.          Tìm kiếm theo từ khóa :  Bán đất nền KĐT Nam cầu Nguyễn Tri Phương ,  Bán đất nền quận Cẩm Lệ               Hình ảnh  ()   Bản đồ                                                                   Đặc điểm bất động sản         Mã số    13494527       Loại tin rao    Bán đất nền dự án (đất trong dự án quy hoạch)       Ngày đăng tin    28/12/2020       Ngày hết hạn    11/01/2021       Hướng nhà    Tây-Bắc       Hướng ban công           Số phòng           Đường vào           Mặt tiền           Số tầng           Số toilet           Nội thất                 Thông tin liên hệ       Tên liên lạc    Mr Phi       Địa chỉ    Hải Châu - Đà Nẵng       Điện thoại           Di động    0905288525       Email     <!-- document.write(\"&#112;&#104;&#105;&#103;&#105;&#97;&#50;&#48;&#48;&#48;&#64;&#121;&#97;&#104;&#111;&#111;&#46;&#99;&#111;&#109;\"); //