{"url": "https://dothi.net/ban-nha-rieng-pho-hoang-sam-phuong-nghia-do-1/ban-biet-thu-khu-hoang-sam-gara-80mx-56m-5t-139-ty-pr13531523.htm", "code": "13531523", "title": "Bán biệt thự khu Hoàng Sâm, gara 80m2 x MT 5.6m, 5T, 13.9 tỷ", "description": "Bán biệt thự khu Hoàng Sâm, gara 80m2 x MT 5.6m, 5T, 13.9 tỷ      Khu vực:    Bán nhà riêng tại Phố Hoàng Sâm  - Quận Cầu Giấy - Hà Nội     Giá:   13.9 Tỷ  Diện tích:  80 m²       Thông tin mô tả    + Căn biệt thự đẹp tựa thiên đường, đẳng cấp 6 sao, khu vực dân cư siêu Vip, toàn giới tinh hoa, an ninh tuyệt đối. Nhà thiết kế hiện đại, cực kì sang trọng, đẳng cấp, nội thất, ngoại thất Châu Âu, đẹp không còn mỹ từ nào để miêu tả. + Nhà ở vị trí giao thông cực thuận tiện, xung quanh kết nối các đường lớn như Phùng Chí Kiên, Đông Quan, Nguyễn Văn Huyên, Nguyễn Khánh Toàn, Chùa Hà, Cầu Giấy, Xuân Thủy, Trần Cung, Nghĩa Tân, Võ Chí Công, Hoàng Quốc Việt, Tô Hiệu, Nguyễn Phong Sắc, Trần Đăng Ninh, Dịch Vọng Hậu, Bảo Tàng Dân tộc học, Công viên Nghĩa Đô, gần các cơ quan công sở, trường mầm non, tiểu học, trung hoc, chợ. + Thiết kế: - Tầng 1. Gara cho 2 ô tô, siêu bếp, phòng ăn, vệ sinh. - Tầng 2. Phòng thưởng nhạc và 1 phòng ngủ rộng. - Tầng 3 + 4 gồm 4 phòng ngủ riêng biệt. - Tầng 5. Phòng Thờ + Phòng masage. + Sổ đỏ chính chủ, có thương lượng.              Hình ảnh  ()   Bản đồ                                               Đặc điểm bất động sản         Mã số    13531523       Loại tin rao    Bán nhà riêng       Ngày đăng tin    01/12/2020       Ngày hết hạn    01/03/2021       Hướng nhà    KXĐ       Hướng ban công           Số phòng    5       Đường vào           Mặt tiền    5.6 m       Số tầng    5       Số toilet           Nội thất    Đầy đủ             Thông tin liên hệ       Tên liên lạc    Ngô Chí Công       Địa chỉ    Đường Hoàng Sâm, Cầu Giấy, Hà Nội        Điện thoại    0975314275       Di động    0975314275       Email     <!-- document.write(\"&#110;&#103;&#99;&#111;&#116;&#121;&#99;&#110;&#64;&#121;&#97;&#104;&